INSERT INTO `activities` (`id`, `category`, `ranking`, `image`, `field1`, `field2`, `field3`, `field5`, `field7`, `field11`, `field12`, `field13`, `field14`, `field15`, `creationDate`, `creationHour`, `updateDate`, `updateHour`, `ogimage`, `visible`) VALUES
(2, 0, 1, '/assets/images/activites/art-dramatique.jpg', '', '<p>Notre offre culturelle refl&egrave;te notre mission : un &eacute;l&egrave;ve, une passion! Nous proposons un &eacute;ventail d&rsquo;activit&eacute;s enrichissantes qui permettent &agrave; nos jeunes de s&rsquo;exprimer et de d&eacute;velopper leur cr&eacute;ativit&eacute;. En voici quelques exemples :</p>\r\n\r\n<ul>\r\n	<li>Club d&rsquo;&eacute;checs</li>\r\n	<li>G&eacute;nie en herbes</li>\r\n	<li>Harmonie</li>\r\n	<li>Improvisation</li>\r\n	<li>Secondaire en Spectacle</li>\r\n	<li>Soir&eacute;e des D&ocirc;mes</li>\r\n</ul>\r\n\r\n<p>Mais ce n&rsquo;est pas tout! Gr&acirc;ce &agrave; nos concentrations, nos &eacute;l&egrave;ves ont aussi acc&egrave;s &agrave; des disciplines telles que l&rsquo;art dramatique, les arts visuels, la danse, la musique et m&ecirc;me les sciences.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '20:47:45', '2025-05-11', '20:49:29', NULL, 1),
(3, 0, 2, '/assets/images/activites/engagements-et-comites.jpg', NULL, '<p>L&rsquo;engagement b&eacute;n&eacute;vole fait partie int&eacute;grante de notre vie scolaire. Ces projets permettent aux &eacute;l&egrave;ves de se d&eacute;couvrir de nouveaux talents tout en renfor&ccedil;ant leur sens de la communaut&eacute;. Voici quelques exemples :</p>\r\n\r\n<ul>\r\n	<li>Album des finissants</li>\r\n	<li>Animation de la radio &eacute;tudiante</li>\r\n	<li>Bal des finissants</li>\r\n	<li>Casse-cro&ucirc;te &eacute;tudiant</li>\r\n	<li>Gouvernement &eacute;tudiant</li>\r\n	<li>Une action pour le monde</li>\r\n</ul>\r\n\r\n<p>L&rsquo;implication dans ces projets permet &agrave; nos jeunes de grandir et de tisser des liens forts avec leurs pairs.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '20:49:36', '2025-05-11', '20:50:07', NULL, 1),
(4, 0, 4, '/assets/images/activites/sorties-et-voyages.jpg', NULL, '<p>Parce qu&rsquo;apprendre, c&rsquo;est aussi sortir des murs de l&rsquo;&eacute;cole, nous organisons de nombreuses sorties tout au long de l&rsquo;ann&eacute;e :</p>\r\n\r\n<ul>\r\n	<li>Sports de glisse en hiver</li>\r\n	<li>Sorties &eacute;ducatives li&eacute;es aux cours</li>\r\n	<li>Voyages annuels aux &Eacute;tats-Unis et ailleurs au Canada</li>\r\n	<li>Voyages en Europe (p. ex. France, Italie, Gr&egrave;ce, Royaume-Uni, Allemagne)</li>\r\n</ul>\r\n\r\n<p>Sans oublier Paramundo, notre concentration internationale qui consiste en l&rsquo;organisation d&rsquo;un voyage de sensibilisation aux r&eacute;alit&eacute;s internationales, et nos immersions linguistiques pour les &eacute;l&egrave;ves du programme Multilangue.</p>\r\n\r\n<p>Chez nous, chaque &eacute;l&egrave;ve a l&rsquo;occasion de vivre des exp&eacute;riences uniques qui enrichiront leur parcours scolaire et personnel. Rejoignez-nous pour une aventure &eacute;tudiante incomparable!</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '20:50:26', '2025-05-11', '20:50:55', NULL, 1),
(5, 0, 3, '/assets/images/activites/activites-sportives.jpg', NULL, '<p>Chez nous, le sport s&#39;adapte aux saisons et satisfait tous les go&ucirc;ts! &Agrave; l&rsquo;automne, nous favorisons les activit&eacute;s ext&eacute;rieures comme le soccer, le volleyball de plage, le flag football ou encore l&rsquo;ultimate frisbee. En hiver, place aux sports en gymnase avec le basketball, le volleyball, le hockey cosom et bien plus. Et au printemps, tout le monde se met au rythme de l&rsquo;athl&eacute;tisme, un projet d&rsquo;&eacute;cole unique au Qu&eacute;bec!</p>\r\n\r\n<p>Que vous soyez un amateur de plein air ou un passionn&eacute; de comp&eacute;tition, nous avons de quoi vous combler gr&acirc;ce &agrave; notre programme sport, nos concentrations ainsi que nos perfectionnements sportifs.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '20:51:46', '2025-05-11', '20:52:18', NULL, 1);
