(5, 5, 'fr', 'Activités sportives', NULL, '<p>Chez nous, le sport s&#39;adapte aux saisons et satisfait tous les go&ucirc;ts! &Agrave; l&rsquo;automne, nous favorisons les activit&eacute;s ext&eacute;rieures comme le soccer, le volleyball de plage, le flag football ou encore l&rsquo;ultimate frisbee. En hiver, place aux sports en gymnase avec le basketball, le volleyball, le hockey cosom et bien plus. Et au printemps, tout le monde se met au rythme de l&rsquo;athl&eacute;tisme, un projet d&rsquo;&eacute;cole unique au Qu&eacute;bec!</p>\r\n\r\n<p>Que vous soyez un amateur de plein air ou un passionn&eacute; de comp&eacute;tition, nous avons de quoi vous combler gr&acirc;ce &agrave; notre programme sport, nos concentrations ainsi que nos perfectionnements sportifs.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
