(1, 0, 1, '', '<p>L&#39;Association des anciens &eacute;l&egrave;ves du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re a &eacute;t&eacute; fond&eacute;e le 23 juin 1890. Elle porte aujourd&rsquo;hui le nom de l&#39;Amicale du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re.</p>\r\n', 'https://amicalecsa.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-04', '14:42:25', '2025-06-04', '14:46:16', NULL, 1),
(2, 0, 2, NULL, '<p>L&rsquo;Association des parents du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re repr&eacute;sente activement les parents au sein des comit&eacute;s du Coll&egrave;ge, participe aux d&eacute;cisions et soutient la tradition d&rsquo;excellence. Elle si&egrave;ge &agrave; la Corporation et &agrave; la Commission p&eacute;dagogique, et finance divers projets &eacute;ducatifs, parascolaires, humanitaires et culturels.</p>\r\n\r\n<p>Sophie Duguay, pr&eacute;sidente :&nbsp;<a href=\"mailto:adpcsa@gmail.com\">adpcsa@gmail.com</a></p>\r\n\r\n<p>Rejoignez leur&nbsp;page Facebook!&nbsp;</p>\r\n', 'https://www.facebook.com/share/g/1Acaq99w51/', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:27:45', '2025-12-03', '16:02:17', NULL, 1),
(3, 0, 3, NULL, '<p>La Fondation Bouchard soutient l&rsquo;enseignement priv&eacute; au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re, visant l&rsquo;&eacute;panouissement des &eacute;l&egrave;ves. Elle agit pour la r&eacute;ussite scolaire, la qualit&eacute; des services &eacute;ducatifs et l&rsquo;entretien du Coll&egrave;ge. Elle valorise engagement, respect, rigueur et transparence dans toutes ses actions.</p>\r\n', 'http://fondationbouchard.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:35:30', '2025-06-30', '17:36:42', NULL, 1),
(4, 0, 4, NULL, '<p>L&rsquo;&Eacute;cole Destroismaisons, bas&eacute;e au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re et pr&eacute;sente &agrave; Saint-Pascal et Saint-Jean-Port-Joli, offre depuis 16 ans des cours de musique et de danse vari&eacute;s. Avec plus de 400 &eacute;l&egrave;ves, 15 enseignants, elle propose musique individuelle, ensembles, danse, ateliers de musicoth&eacute;rapie et collabore avec l&rsquo;Universit&eacute; Laval. Elle est reconnue par le Minist&egrave;re de la Culture du Qu&eacute;bec.</p>\r\n\r\n<p>Pour de plus amples informations, veuillez communiquer avec nous au 418 856-3012 #320.</p>\r\n', 'http://www.destroismaisons.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:37:12', '2025-06-30', '17:38:14', NULL, 0),
(5, 0, 5, NULL, '<p>Pour enfants de 18 mois &agrave; 5 ans</p>\r\n\r\n<ul>\r\n	<li>Programme de pr&eacute;paration &agrave; la maternelle (permettant une int&eacute;gration et une transition ais&eacute;e &agrave; l&rsquo;&eacute;cole et le d&eacute;veloppement de plusieurs aptitudes)</li>\r\n	<li>Garderie &eacute;ducative pour les 18 mois et plus (l&rsquo;enfant apprend par le jeu et la manipulation)</li>\r\n</ul>\r\n\r\n<p>Dans l&#39;enceinte m&ecirc;me du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re.<br />\r\nUne &eacute;quipe d&#39;&eacute;ducatrices form&eacute;es et motiv&eacute;es.</p>\r\n\r\n<p>Ouvert &agrave; l&#39;ann&eacute;e de 7 h &agrave; 17 h 30 (sauf f&eacute;ri&eacute;s).<br />\r\nPermis du Minist&egrave;re de la Famille et des A&icirc;n&eacute;s</p>\r\n\r\n<p>Pour nous joindre :<br />\r\n418 856-3012 poste 628<br />\r\n<a href=\"mailto:montessorilapocatiere@gmail.com\">montessorilapocatiere@gmail.com</a></p>\r\n', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:38:42', '2025-06-30', '17:40:29', NULL, 1);
