(1, 1, 'fr', 'Amicale du Collège', '<p>L&#39;Association des anciens &eacute;l&egrave;ves du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re a &eacute;t&eacute; fond&eacute;e le 23 juin 1890. Elle porte aujourd&rsquo;hui le nom de l&#39;Amicale du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re.</p>\r\n', 'https://amicalecsa.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 2, 'fr', 'Association des parents', '<p>L&rsquo;Association des parents du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re repr&eacute;sente activement les parents au sein des comit&eacute;s du Coll&egrave;ge, participe aux d&eacute;cisions et soutient la tradition d&rsquo;excellence. Elle si&egrave;ge &agrave; la Corporation et &agrave; la Commission p&eacute;dagogique, et finance divers projets &eacute;ducatifs, parascolaires, humanitaires et culturels.</p>\r\n\r\n<p>Sophie Duguay, pr&eacute;sidente :&nbsp;<a href=\"mailto:adpcsa@gmail.com\">adpcsa@gmail.com</a></p>\r\n\r\n<p>Rejoignez leur&nbsp;page Facebook!&nbsp;</p>\r\n', 'https://www.facebook.com/share/g/1Acaq99w51/', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 3, 'fr', 'Fondation Bouchard', '<p>La Fondation Bouchard soutient l&rsquo;enseignement priv&eacute; au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re, visant l&rsquo;&eacute;panouissement des &eacute;l&egrave;ves. Elle agit pour la r&eacute;ussite scolaire, la qualit&eacute; des services &eacute;ducatifs et l&rsquo;entretien du Coll&egrave;ge. Elle valorise engagement, respect, rigueur et transparence dans toutes ses actions.</p>\r\n', 'http://fondationbouchard.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 4, 'fr', 'École Destroismaisons', '<p>L&rsquo;&Eacute;cole Destroismaisons, bas&eacute;e au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re et pr&eacute;sente &agrave; Saint-Pascal et Saint-Jean-Port-Joli, offre depuis 16 ans des cours de musique et de danse vari&eacute;s. Avec plus de 400 &eacute;l&egrave;ves, 15 enseignants, elle propose musique individuelle, ensembles, danse, ateliers de musicoth&eacute;rapie et collabore avec l&rsquo;Universit&eacute; Laval. Elle est reconnue par le Minist&egrave;re de la Culture du Qu&eacute;bec.</p>\r\n\r\n<p>Pour de plus amples informations, veuillez communiquer avec nous au 418 856-3012 #320.</p>\r\n', 'http://www.destroismaisons.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 5, 'fr', 'Petite École Montessori', '<p>Pour enfants de 18 mois &agrave; 5 ans</p>\r\n\r\n<ul>\r\n	<li>Programme de pr&eacute;paration &agrave; la maternelle (permettant une int&eacute;gration et une transition ais&eacute;e &agrave; l&rsquo;&eacute;cole et le d&eacute;veloppement de plusieurs aptitudes)</li>\r\n	<li>Garderie &eacute;ducative pour les 18 mois et plus (l&rsquo;enfant apprend par le jeu et la manipulation)</li>\r\n</ul>\r\n\r\n<p>Dans l&#39;enceinte m&ecirc;me du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re.<br />\r\nUne &eacute;quipe d&#39;&eacute;ducatrices form&eacute;es et motiv&eacute;es.</p>\r\n\r\n<p>Ouvert &agrave; l&#39;ann&eacute;e de 7 h &agrave; 17 h 30 (sauf f&eacute;ri&eacute;s).<br />\r\nPermis du Minist&egrave;re de la Famille et des A&icirc;n&eacute;s</p>\r\n\r\n<p>Pour nous joindre :<br />\r\n418 856-3012 poste 628<br />\r\n<a href=\"mailto:montessorilapocatiere@gmail.com\">montessorilapocatiere@gmail.com</a></p>\r\n', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `concentrations` (`id`, `category`, `ranking`, `image`, `field1`, `field2`, `field3`, `field5`, `field7`, `field11`, `field12`, `field13`, `field14`, `field15`, `creationDate`, `creationHour`, `updateDate`, `updateHour`, `ogimage`, `visible`) VALUES
(1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '14:03:56', NULL, NULL, NULL, 0),
(2, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '14:05:33', NULL, NULL, NULL, 0),
(3, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '14:06:09', NULL, NULL, NULL, 0),
(4, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '14:19:51', NULL, NULL, NULL, 0),
(5, 6, 1, '/assets/images/concentrations/concentration-art-dramatique.jpg', '1re à 5e secondaire', '<p>Cette concentration permet aux &eacute;l&egrave;ves de d&eacute;couvrir les diff&eacute;rentes facettes de l&rsquo;art dramatique, &agrave; savoir les techniques de jeu et de mise en sc&egrave;ne, l&rsquo;&eacute;tude des auteurs et des styles, de m&ecirc;me que la promotion et la production d&rsquo;un spectacle d&rsquo;envergure.</p>\r\n\r\n<p>&Agrave; travers des ateliers diversifi&eacute;s et des jeux d&rsquo;improvisation, ils d&eacute;veloppent de solides comp&eacute;tences en expression publique et en communication, tout en travaillant la confiance et l&rsquo;esprit d&rsquo;&eacute;quipe.</p>\r\n\r\n<p>Cette concentration est faite sur mesure pour l&#39;&eacute;l&egrave;ve qui d&eacute;sire communiquer et se d&eacute;passer.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '14:20:25', '2025-05-11', '14:26:55', NULL, 1),
(6, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '14:28:22', NULL, NULL, NULL, 0),
(7, 6, 2, '/assets/images/concentrations/concentration-art-visuels.jpg', '1re et 2e secondaire et 3e à 5e secondaire', '<p>Cette concentration permet &agrave; l&rsquo;&eacute;l&egrave;ve d&rsquo;explorer de nouvelles techniques de dessin (ombre et lumi&egrave;re, relief, 3D, perspective et point de fuite) et diff&eacute;rents styles (impressionnisme, surr&eacute;alisme, cubisme, fauvisme, etc.). L&rsquo;&eacute;l&egrave;ve explore la sculpture en exp&eacute;rimentant diverses mati&egrave;res (neige, pl&acirc;tre, argile synth&eacute;tique). &Agrave; l&rsquo;aide de logiciels informatiques, l&rsquo;&eacute;l&egrave;ve approfondit ses connaissances en infographie en travaillant l&rsquo;image, la conception et le design.</p>\r\n\r\n<p>De plus, l&rsquo;&eacute;l&egrave;ve d&eacute;couvre diff&eacute;rentes techniques et sortes de peinture en utilisant pinceaux, spatules et pochoirs et en utilisant diff&eacute;rentes peintures (acrylique, gouache, aquarelle).</p>\r\n\r\n<p>Notre formateur est un artiste professionnel passionn&eacute; de sculpture et de conception graphique.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '14:33:00', '2025-05-11', '14:40:12', NULL, 1),
(8, 6, 3, '/assets/images/concentrations/concentration-brigades-culinaires.jpg', '1re et 2e secondaire et 3e à 5e secondaire', '<p>Cette concentration propose 20 ateliers culinaires pratiques, trois grands d&eacute;fis construits autour de trois grands axes (social, saine alimentation et multiculturel) ainsi qu&rsquo;une comp&eacute;tition. Les &eacute;l&egrave;ves inscrits d&eacute;veloppent leurs comp&eacute;tences culinaires et leurs connaissances en alimentation afin d&rsquo;&ecirc;tre amen&eacute;s vers leur propre autonomie alimentaire.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '15:00:44', '2025-05-11', '15:02:03', NULL, 1),
(9, 6, 4, '/assets/images/concentrations/concentration-danse.jpg', '1re et 2e secondaire et 3e à 5e secondaire', '<p>Tu as toujours aim&eacute; la danse, mais tu n&rsquo;as jamais vraiment os&eacute; te lancer&hellip; Il n&rsquo;est pas trop tard. &Agrave; ton &acirc;ge, tout est possible! C&rsquo;est pour TOI! La concentration danse s&rsquo;adresse aux d&eacute;butants ou initi&eacute;s de la danse!</p>\r\n\r\n<p>Tu pourras apprendre la technique du ballet contemporain et le style Hip-Hop. Tu t&rsquo;entra&icirc;nera aussi r&eacute;guli&egrave;rement pour gagner de la puissance et pr&eacute;parer ton corps &agrave; r&eacute;aliser des grands sauts, des port&eacute;s, etc. Ensemble, nous r&eacute;aliserons des chor&eacute;graphies originales refl&eacute;tant le fruit de nos efforts.</p>\r\n\r\n<p>La danse deviendra sans doute un moyen de plus pour t&rsquo;exprimer.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '15:02:16', '2025-05-11', '15:03:35', NULL, 1),
(10, 6, 5, '/assets/images/concentrations/concentration-decore-ton-csa.jpg', '1re à 5e secondaire', '<p>Les &eacute;l&egrave;ves qui sont inscrits &agrave; cette concentration sont impliqu&eacute;s directement dans la vie artistique de notre Coll&egrave;ge par la production de d&eacute;cors qui sont mis en vedette lors d&rsquo;&eacute;v&eacute;nements tels que la Saint-Valentin, l&rsquo;Halloween et No&euml;l ou encore qui soutiennent de grands &eacute;v&eacute;nements : Portes ouvertes, repr&eacute;sentation th&eacute;&acirc;trale, Semaine du Bonheur, etc.</p>\r\n\r\n<p>De plus, ils y d&eacute;veloppent des habilet&eacute;s manuelles et cr&eacute;atives en s&rsquo;initiant &agrave; divers m&eacute;diums.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '15:03:49', '2025-05-11', '15:04:43', NULL, 1),
(11, 7, 1, '/assets/images/concentrations/concentration-paramundo.jpg', '5e secondaire', '<p>Chaque ann&eacute;e, &agrave; la fin de l&rsquo;hiver, des &eacute;l&egrave;ves de 5<sup>e</sup> secondaire et leurs accompagnateurs bouclent leurs valises et partent &agrave; la d&eacute;couverte d&rsquo;un autre pays, d&rsquo;une autre culture. Dans leurs bagages : six mois de pr&eacute;paratifs. Ils quittent l&rsquo;hiver pour le sud. Non pas celui du tourisme et des plages anim&eacute;es, mais celui o&ugrave; des milliers de personnes luttent chaque jour pour leur subsistance. Paramundo, c&rsquo;est partir pour voir, comprendre, d&eacute;couvrir et s&rsquo;approprier un regard nouveau sur le monde. Formation : deux heures de cours de langues par semaine (espagnol) et deux autres heures de formation (planification du s&eacute;jour).</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '15:07:17', '2025-06-27', '13:51:50', NULL, 1),
(12, 8, 1, '/assets/images/concentrations/concentration-robotique.jpg', '1re et 2e secondaire et 3e à 5e secondaire', '<p>Cette concentration qui vise l&rsquo;int&eacute;gration technologique est bas&eacute;e sur la cr&eacute;ation, la r&eacute;alisation et la programmation d&rsquo;un robot. En &eacute;quipe, les &eacute;l&egrave;ves apprennent une foule de notions qui leur permettent de concevoir, construire, programmer et manipuler un robot. Ils d&eacute;veloppent des comp&eacute;tences en r&eacute;solution de probl&egrave;mes et en informatique. Les &eacute;l&egrave;ves inscrits auront la chance de participer &agrave; des comp&eacute;titions &agrave; l&rsquo;&eacute;chelle nationale et internationale comme le D&eacute;fi FIRST LEGO League.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '15:08:47', '2025-05-11', '15:14:31', NULL, 1),
(13, 9, 1, '/assets/images/concentrations/concentration-athletisme.jpg', '1re à 5e secondaire', '<p>Cette concentration s&rsquo;adresse aux &eacute;l&egrave;ves qui d&eacute;sirent pratiquer la discipline du cross-country pendant l&rsquo;automne et les diff&eacute;rentes disciplines de l&rsquo;athl&eacute;tisme durant la p&eacute;riode hivernale. Les participants ont l&rsquo;occasion d&rsquo;y d&eacute;velopper leurs capacit&eacute;s physiques en course, en lancer ou en saut, &agrave; raison d&rsquo;un entra&icirc;nement par semaine. Durant l&rsquo;ann&eacute;e, les athl&egrave;tes participent &agrave; au moins une comp&eacute;tition de cross-country et &agrave; deux comp&eacute;titions d&rsquo;athl&eacute;tisme en salle organis&eacute;es par le R&eacute;seau du sport &eacute;tudiant du Qu&eacute;bec (RSEQ).</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '15:14:53', '2025-05-11', '15:16:37', NULL, 1),
(14, 9, 2, '/assets/images/concentrations/concentration-badminton.jpg', '1re à 5e secondaire', '<p>La concentration badminton s&rsquo;adresse &agrave; tous les jeunes qui souhaitent s&rsquo;initier &agrave; ce sport ou peaufiner leur technique dans le but de participer &agrave; diverses comp&eacute;titions en simple ou en double durant l&rsquo;ann&eacute;e scolaire au sein du R&eacute;seau du sport &eacute;tudiant du Qu&eacute;bec (RSEQ). Qu&rsquo;ils soient d&eacute;butants ou non, les &eacute;l&egrave;ves pourront rapidement parfaire leur jeu.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '15:16:45', '2025-05-11', '15:17:05', NULL, 1),
(15, 9, 3, '/assets/images/concentrations/concentration-basketball.jpg', '1re à 5e secondaire', '<p>Le basketball scolaire de comp&eacute;tition se poursuit au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re! Cette concentration permet aux &eacute;l&egrave;ves passionn&eacute;s d&rsquo;approfondir les gestes et les techniques li&eacute;s &agrave; ce sport. De plus, en se joignant aux ligues du R&eacute;seau du sport &eacute;tudiant du Qu&eacute;bec (RSEQ), ils auront la chance d&rsquo;appliquer l&rsquo;enseignement re&ccedil;u en situation de partie.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '15:17:08', '2025-05-11', '15:17:33', NULL, 1),
(16, 9, 4, '/assets/images/concentrations/concentration-football.jpg', 'Benjamin (1re et 2e secondaire) et Juvénile (3e à 5e secondaire)', '<p>Le programme de football des Wisigoths du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re en est &agrave; sa 21e ann&eacute;e de comp&eacute;tition dans les ligues scolaires du R&eacute;seau du sport &eacute;tudiant du Qu&eacute;bec (RSEQ). Nos deux &eacute;quipes s&rsquo;entra&icirc;nent &agrave; l&rsquo;ann&eacute;e et b&eacute;n&eacute;ficient d&rsquo;entra&icirc;neurs qualifi&eacute;s qui permettent aux &eacute;l&egrave;ves d&rsquo;&eacute;lever leur niveau de jeu. De plus, les participants ont la chance d&rsquo;&ecirc;tre vus et soutenus par les entra&icirc;neurs des clubs coll&eacute;giaux de premi&egrave;re et de deuxi&egrave;me division.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '15:17:46', '2025-05-11', '15:18:13', NULL, 1),
(18, 9, 5, '/assets/images/concentrations/concentration-plein-air.jpg', '1re à 5e secondaire', '<p>Cette concentration est une introduction au plein air et au respect de l&rsquo;environnement. L&rsquo;accent est mis sur la d&eacute;couverte d&rsquo;activit&eacute;s de plein air et leurs concepts de base. Les &eacute;l&egrave;ves inscrits assistent &agrave; des formations et &agrave; des ateliers techniques. Ils ont aussi la chance de participer &agrave; plusieurs sorties tout au long de l&rsquo;ann&eacute;e scolaire telles que la randonn&eacute;e en montagne, l&rsquo;escalade, le v&eacute;lo de montagne, le ski de fond, le canot-camping, etc. &Agrave; travers ces exp&eacute;riences inoubliables, les &eacute;l&egrave;ves d&eacute;veloppent leur esprit d&rsquo;&eacute;quipe, leur d&eacute;brouillardise, leur sens du leadership et leurs aptitudes sociales en plus de favoriser le maintien d&rsquo;une bonne sant&eacute; physique et mentale.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '15:18:49', '2025-05-11', '15:19:15', NULL, 1),
(19, 9, 6, '/assets/images/concentrations/concentration-volleyball-feminin.jpg', '1re à 5e secondaire', '<p>Cette concentration s&rsquo;adresse aux &eacute;l&egrave;ves qui d&eacute;sirent accro&icirc;tre leurs comp&eacute;tences en volleyball. Les participantes y apprennent les rudiments de base du volleyball et y perfectionnent leurs techniques dans un milieu dynamique, tout en &eacute;tant appuy&eacute;es par des entra&icirc;neurs passionn&eacute;s.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '15:19:16', '2025-05-11', '15:19:38', NULL, 1);
