INSERT INTO `concentrations_ml` (`id`, `originId`, `langCode`, `name`, `field1`, `field2`, `field3`, `field4`, `field6`, `field7`, `field8`, `field9`, `field10`, `field11`, `field12`, `urlRewrite`, `title`, `descriptionMeta`, `h1`) VALUES
(1, 1, 'fr', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 2, 'fr', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 3, 'fr', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 4, 'fr', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 5, 'fr', 'Art dramatique', '1re à 5e secondaire', '<p>Cette concentration permet aux &eacute;l&egrave;ves de d&eacute;couvrir les diff&eacute;rentes facettes de l&rsquo;art dramatique, &agrave; savoir les techniques de jeu et de mise en sc&egrave;ne, l&rsquo;&eacute;tude des auteurs et des styles, de m&ecirc;me que la promotion et la production d&rsquo;un spectacle d&rsquo;envergure.</p>\r\n\r\n<p>&Agrave; travers des ateliers diversifi&eacute;s et des jeux d&rsquo;improvisation, ils d&eacute;veloppent de solides comp&eacute;tences en expression publique et en communication, tout en travaillant la confiance et l&rsquo;esprit d&rsquo;&eacute;quipe.</p>\r\n\r\n<p>Cette concentration est faite sur mesure pour l&#39;&eacute;l&egrave;ve qui d&eacute;sire communiquer et se d&eacute;passer.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 6, 'fr', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 7, 'fr', 'Arts visuels', '1re et 2e secondaire et 3e à 5e secondaire', '<p>Cette concentration permet &agrave; l&rsquo;&eacute;l&egrave;ve d&rsquo;explorer de nouvelles techniques de dessin (ombre et lumi&egrave;re, relief, 3D, perspective et point de fuite) et diff&eacute;rents styles (impressionnisme, surr&eacute;alisme, cubisme, fauvisme, etc.). L&rsquo;&eacute;l&egrave;ve explore la sculpture en exp&eacute;rimentant diverses mati&egrave;res (neige, pl&acirc;tre, argile synth&eacute;tique). &Agrave; l&rsquo;aide de logiciels informatiques, l&rsquo;&eacute;l&egrave;ve approfondit ses connaissances en infographie en travaillant l&rsquo;image, la conception et le design.</p>\r\n\r\n<p>De plus, l&rsquo;&eacute;l&egrave;ve d&eacute;couvre diff&eacute;rentes techniques et sortes de peinture en utilisant pinceaux, spatules et pochoirs et en utilisant diff&eacute;rentes peintures (acrylique, gouache, aquarelle).</p>\r\n\r\n<p>Notre formateur est un artiste professionnel passionn&eacute; de sculpture et de conception graphique.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 8, 'fr', 'Brigades culinaires', '1re et 2e secondaire et 3e à 5e secondaire', '<p>Cette concentration propose 20 ateliers culinaires pratiques, trois grands d&eacute;fis construits autour de trois grands axes (social, saine alimentation et multiculturel) ainsi qu&rsquo;une comp&eacute;tition. Les &eacute;l&egrave;ves inscrits d&eacute;veloppent leurs comp&eacute;tences culinaires et leurs connaissances en alimentation afin d&rsquo;&ecirc;tre amen&eacute;s vers leur propre autonomie alimentaire.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 9, 'fr', 'Danse', '1re et 2e secondaire et 3e à 5e secondaire', '<p>Tu as toujours aim&eacute; la danse, mais tu n&rsquo;as jamais vraiment os&eacute; te lancer&hellip; Il n&rsquo;est pas trop tard. &Agrave; ton &acirc;ge, tout est possible! C&rsquo;est pour TOI! La concentration danse s&rsquo;adresse aux d&eacute;butants ou initi&eacute;s de la danse!</p>\r\n\r\n<p>Tu pourras apprendre la technique du ballet contemporain et le style Hip-Hop. Tu t&rsquo;entra&icirc;nera aussi r&eacute;guli&egrave;rement pour gagner de la puissance et pr&eacute;parer ton corps &agrave; r&eacute;aliser des grands sauts, des port&eacute;s, etc. Ensemble, nous r&eacute;aliserons des chor&eacute;graphies originales refl&eacute;tant le fruit de nos efforts.</p>\r\n\r\n<p>La danse deviendra sans doute un moyen de plus pour t&rsquo;exprimer.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(10, 10, 'fr', 'Décore ton CSA', '1re à 5e secondaire', '<p>Les &eacute;l&egrave;ves qui sont inscrits &agrave; cette concentration sont impliqu&eacute;s directement dans la vie artistique de notre Coll&egrave;ge par la production de d&eacute;cors qui sont mis en vedette lors d&rsquo;&eacute;v&eacute;nements tels que la Saint-Valentin, l&rsquo;Halloween et No&euml;l ou encore qui soutiennent de grands &eacute;v&eacute;nements : Portes ouvertes, repr&eacute;sentation th&eacute;&acirc;trale, Semaine du Bonheur, etc.</p>\r\n\r\n<p>De plus, ils y d&eacute;veloppent des habilet&eacute;s manuelles et cr&eacute;atives en s&rsquo;initiant &agrave; divers m&eacute;diums.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 11, 'fr', 'Paramundo', '5e secondaire', '<p>Chaque ann&eacute;e, &agrave; la fin de l&rsquo;hiver, des &eacute;l&egrave;ves de 5<sup>e</sup> secondaire et leurs accompagnateurs bouclent leurs valises et partent &agrave; la d&eacute;couverte d&rsquo;un autre pays, d&rsquo;une autre culture. Dans leurs bagages : six mois de pr&eacute;paratifs. Ils quittent l&rsquo;hiver pour le sud. Non pas celui du tourisme et des plages anim&eacute;es, mais celui o&ugrave; des milliers de personnes luttent chaque jour pour leur subsistance. Paramundo, c&rsquo;est partir pour voir, comprendre, d&eacute;couvrir et s&rsquo;approprier un regard nouveau sur le monde. Formation : deux heures de cours de langues par semaine (espagnol) et deux autres heures de formation (planification du s&eacute;jour).</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(12, 12, 'fr', 'Robotique', '1re et 2e secondaire et 3e à 5e secondaire', '<p>Cette concentration qui vise l&rsquo;int&eacute;gration technologique est bas&eacute;e sur la cr&eacute;ation, la r&eacute;alisation et la programmation d&rsquo;un robot. En &eacute;quipe, les &eacute;l&egrave;ves apprennent une foule de notions qui leur permettent de concevoir, construire, programmer et manipuler un robot. Ils d&eacute;veloppent des comp&eacute;tences en r&eacute;solution de probl&egrave;mes et en informatique. Les &eacute;l&egrave;ves inscrits auront la chance de participer &agrave; des comp&eacute;titions &agrave; l&rsquo;&eacute;chelle nationale et internationale comme le D&eacute;fi FIRST LEGO League.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(13, 13, 'fr', 'Athlétisme / Cross-country', '1re à 5e secondaire', '<p>Cette concentration s&rsquo;adresse aux &eacute;l&egrave;ves qui d&eacute;sirent pratiquer la discipline du cross-country pendant l&rsquo;automne et les diff&eacute;rentes disciplines de l&rsquo;athl&eacute;tisme durant la p&eacute;riode hivernale. Les participants ont l&rsquo;occasion d&rsquo;y d&eacute;velopper leurs capacit&eacute;s physiques en course, en lancer ou en saut, &agrave; raison d&rsquo;un entra&icirc;nement par semaine. Durant l&rsquo;ann&eacute;e, les athl&egrave;tes participent &agrave; au moins une comp&eacute;tition de cross-country et &agrave; deux comp&eacute;titions d&rsquo;athl&eacute;tisme en salle organis&eacute;es par le R&eacute;seau du sport &eacute;tudiant du Qu&eacute;bec (RSEQ).</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(14, 14, 'fr', 'Badminton', '1re à 5e secondaire', '<p>La concentration badminton s&rsquo;adresse &agrave; tous les jeunes qui souhaitent s&rsquo;initier &agrave; ce sport ou peaufiner leur technique dans le but de participer &agrave; diverses comp&eacute;titions en simple ou en double durant l&rsquo;ann&eacute;e scolaire au sein du R&eacute;seau du sport &eacute;tudiant du Qu&eacute;bec (RSEQ). Qu&rsquo;ils soient d&eacute;butants ou non, les &eacute;l&egrave;ves pourront rapidement parfaire leur jeu.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(15, 15, 'fr', 'Basketball', '1re à 5e secondaire', '<p>Le basketball scolaire de comp&eacute;tition se poursuit au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re! Cette concentration permet aux &eacute;l&egrave;ves passionn&eacute;s d&rsquo;approfondir les gestes et les techniques li&eacute;s &agrave; ce sport. De plus, en se joignant aux ligues du R&eacute;seau du sport &eacute;tudiant du Qu&eacute;bec (RSEQ), ils auront la chance d&rsquo;appliquer l&rsquo;enseignement re&ccedil;u en situation de partie.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(16, 16, 'fr', 'Football', 'Benjamin (1re et 2e secondaire) et Juvénile (3e à 5e secondaire)', '<p>Le programme de football des Wisigoths du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re en est &agrave; sa 21e ann&eacute;e de comp&eacute;tition dans les ligues scolaires du R&eacute;seau du sport &eacute;tudiant du Qu&eacute;bec (RSEQ). Nos deux &eacute;quipes s&rsquo;entra&icirc;nent &agrave; l&rsquo;ann&eacute;e et b&eacute;n&eacute;ficient d&rsquo;entra&icirc;neurs qualifi&eacute;s qui permettent aux &eacute;l&egrave;ves d&rsquo;&eacute;lever leur niveau de jeu. De plus, les participants ont la chance d&rsquo;&ecirc;tre vus et soutenus par les entra&icirc;neurs des clubs coll&eacute;giaux de premi&egrave;re et de deuxi&egrave;me division.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(18, 18, 'fr', 'Plein air', '1re à 5e secondaire', '<p>Cette concentration est une introduction au plein air et au respect de l&rsquo;environnement. L&rsquo;accent est mis sur la d&eacute;couverte d&rsquo;activit&eacute;s de plein air et leurs concepts de base. Les &eacute;l&egrave;ves inscrits assistent &agrave; des formations et &agrave; des ateliers techniques. Ils ont aussi la chance de participer &agrave; plusieurs sorties tout au long de l&rsquo;ann&eacute;e scolaire telles que la randonn&eacute;e en montagne, l&rsquo;escalade, le v&eacute;lo de montagne, le ski de fond, le canot-camping, etc. &Agrave; travers ces exp&eacute;riences inoubliables, les &eacute;l&egrave;ves d&eacute;veloppent leur esprit d&rsquo;&eacute;quipe, leur d&eacute;brouillardise, leur sens du leadership et leurs aptitudes sociales en plus de favoriser le maintien d&rsquo;une bonne sant&eacute; physique et mentale.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(19, 19, 'fr', 'Volleyball féminin', '1re à 5e secondaire', '<p>Cette concentration s&rsquo;adresse aux &eacute;l&egrave;ves qui d&eacute;sirent accro&icirc;tre leurs comp&eacute;tences en volleyball. Les participantes y apprennent les rudiments de base du volleyball et y perfectionnent leurs techniques dans un milieu dynamique, tout en &eacute;tant appuy&eacute;es par des entra&icirc;neurs passionn&eacute;s.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
