(24, 0, 0, '0000-00-00', '', NULL, 'Léon', 'KERREMANS', 'leon.kerremans@scarlet.be', NULL, NULL, 'Bonjour. Pourriez-vous m\\\'aider dans ma recherche? Un de vos anciens professeurs, l\\\'abbé Léon Destroismaisons (1890-1980), a composé une Suite pour grand orgue sur un thème collégial (jouée chaque année à l\\\'époque en prélude à la cérémonie d\\\'adieu des finissants du collège). Auriez-vous la partition de cette œuvre dans la bibliothèque de votre établissement? Si oui, serait-il possible d\\\'en obtenir un scan ou une photocopie. Merci d\\\'avance, et bien cordialement. Léon Kerremans; organiste titulaire de l\\\'église Saint-Servais à Bruxelles.', NULL, NULL, 'Recherche d\\\'une composition de l\\\'abbé L. Destroismaisons', 0, '2025-10-03', '19:13:28', '2025-10-03', '19:13:28', 0),
(25, 0, 0, '0000-00-00', '', NULL, 'Denise', 'Levesque', 'levesquedenise18@gmail.com', NULL, NULL, 'J’ai gradué dans l’année du 150e au collège. J’habite en Ontario mais j’aimerais me déplacer pour assister aux célébrations du 200e. Serait-il possible d’en être informé?', NULL, NULL, 'Célébrations du 200e anniversaire', 0, '2025-11-24', '17:10:06', '2025-11-24', '17:10:06', 0),
(26, 0, 0, '0000-00-00', '', NULL, '418-714-0772', 'Kpangni Fabrice KASSI', 'kassikpangnifabrice@gmail.com', NULL, NULL, 'Bonjour Monsieur, Madame,\r\nj\\\'espère que vous allez bien, je vous écris pour de l\\\'aide concernant la prise de rdv pour la passation du TCF Canada. Possible de me guider svp pour l\\\'inscription svp ? Merci d\\\'avance.', NULL, NULL, 'Information sur la prise de rdv pour le TCF Canada', 0, '2025-12-16', '21:28:48', '2025-12-16', '21:28:48', 0),
