(28, 0, 0, '0000-00-00', '', NULL, 'Luis Paul', 'Martinez Sotomayor', 'lpsotomayor@gmail.com', NULL, NULL, 'Dear Admissions Team,\r\n\r\nI hope this message finds you well.\r\n\r\nI am writing to request information regarding your international academic program for the 2026–2027 school year. I am interested in exploring the possibility of enrolling my 14-year-old son, who would be entering his 9th year of studies (equivalent to 3rd year of secondary school).\r\n\r\nMy son has a strong command of the English language. The main objective of this international experience is for him to develop proficiency in French. At present, his level of French is very basic; however, he would begin a structured learning process prior to the start of the 2026–2027 academic year in order to enter the program with an improved foundational level.\r\n\r\nWe are a family based in Mexico, and my son holds both Mexican and French nationality. I would like to k whether your international program is primarily delivered in English with a focus or pathway for learning French.\r\n\r\nAdditionally, I would appreciate it if you could share detailed information regarding:\r\n\r\nAdmission requirements\r\n\r\nTuition and enrollment fees\r\n\r\nAny additional service or program-related costs for the full academic year\r\n\r\nThank you very much for your time and support. I look forward to your response.\r\n\r\nKind regards,\r\nLuis Martínez\r\nMexico', NULL, NULL, 'Information request', 0, '2026-01-03', '23:15:18', '2026-01-03', '23:15:18', 0),
(29, 0, 0, '0000-00-00', '', NULL, 'Dave Stever', 'Carmichael', 'dstever@carmichael-eng.ca', NULL, NULL, 'Bonjour svp j’aimerais vous rencontrer pour  discuter de nos services de maintenances pour votre batiment\r\nChauffage, Ventilation, Air Climatisé, Réfrigération   (industriel et commercial)\r\n', NULL, NULL, 'Chauffage, Ventilation, Air Climatisé', 0, '2026-01-15', '14:43:54', '2026-01-15', '14:43:54', 0),
(30, 0, 0, '0000-00-00', '', NULL, 'Amélie', 'Bérubé', 'pattedouce@telus.net', NULL, NULL, 'Bonjour ! J\\\'aimerais savoir s\\\'il y aura une concentration équitation pour l\\\'année 2026-2027 ? Est-ce possible d\\\'avoir plus d\\\'informations ? Je ne vois rien à ce sujet sur le site web. Merci beaucoup !', NULL, NULL, 'Info concentration équitation', 0, '2026-01-18', '14:56:18', '2026-01-18', '14:56:18', 0),
(31, 0, 0, '0000-00-00', '', NULL, 'Sebastien', 'Lizotte', 'bandit-machine@hotmail.com', NULL, NULL, 'Bonjour a vous tous, je me présente, Sébastien Lizotte . je suis une personne qui est capable de faire face a des défis et des situation difficiles . ponctuel ,efficace .courtois,compréhensif,collaborat eur et surtout fiable . je tien a vous remercier du temps \r\napporter envers moi et au plaisir d\\\'échanger et travailler avec votre belles équipes. Avec mes plus sincères salutations, bonne lecture et journée', NULL, NULL, 'Emploi', 0, '2026-01-18', '15:55:27', '2026-01-18', '15:55:27', 0);
