INSERT INTO `faq_ml` (`id`, `originId`, `langCode`, `name`, `field1`, `field2`, `field3`, `field4`, `field6`, `field7`, `field8`, `field9`, `field10`, `field11`, `field12`, `urlRewrite`, `title`, `descriptionMeta`, `h1`) VALUES
(1, 1, 'fr', 'Acceptez-vous tous les élèves?', '<p>Oui, tous les &eacute;l&egrave;ves admis en cheminement r&eacute;gulier au secondaire peuvent s&#39;inscrire au Coll&egrave;ge!</p>\r\n', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 2, 'fr', 'Mon enfant doit-il avoir une moyenne particulière pour s’inscrire à un programme?', '<p data-end=\"932\" data-start=\"780\">Oui, certains programmes exigent un seuil de r&eacute;sultats :</p>\r\n\r\n<ul data-end=\"1134\" data-start=\"933\" style=\"margin-left: 40px;\">\r\n	<li data-end=\"1030\" data-start=\"933\">\r\n	<p data-end=\"1030\" data-start=\"935\">Programme Multilangue : minimum 75 % dans chaque mati&egrave;re</p>\r\n	</li>\r\n	<li data-end=\"1134\" data-start=\"1031\">\r\n	<p data-end=\"1134\" data-start=\"1033\">Programme Volleyball : moyenne g&eacute;n&eacute;rale de 75 % et aucun &eacute;chec</p>\r\n	</li>\r\n</ul>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 3, 'fr', 'Faut-il passer un examen d’admission pour entrer au Collège?', '<p>Non. Tous les &eacute;l&egrave;ves ayant r&eacute;ussi leurs &eacute;tudes primaires en cheminement r&eacute;gulier sont admis, sans test d&rsquo;entr&eacute;e. Nos programmes ou concentrations peuvent toutefois exiger un processus de s&eacute;lection.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 4, 'fr', 'Existe-t-il un programme d’aide financière?', '<p>Oui. Les familles peuvent faire une demande d&rsquo;aide financi&egrave;re. Les montants varient selon le revenu, le nombre d&rsquo;enfants &agrave; charge et les situations particuli&egrave;res. Depuis 24 ans, plus de 3,3 M$ d&rsquo;aide ont &eacute;t&eacute; distribu&eacute;s gr&acirc;ce au Fonds Charles-Fran&ccedil;ois-Painchaud.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 5, 'fr', 'Qu’est-ce que le Programme Multilangue?', '<p>Unique au Qu&eacute;bec, ce programme gratuit permet aux &eacute;l&egrave;ves de consacrer 25 % de leur horaire &agrave; l&rsquo;&eacute;tude des langues (anglais avanc&eacute;, espagnol enrichi, allemand ou mandarin). Des activit&eacute;s et voyages d&rsquo;immersion compl&egrave;tent la formation.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 6, 'fr', 'Pourquoi choisir le Collège de Sainte-Anne-de-la-Pocatière?', '<p data-end=\"316\" data-start=\"153\">Choisir le Coll&egrave;ge, c&rsquo;est offrir &agrave; votre enfant bien plus qu&rsquo;une formation scolaire :</p>\r\n\r\n<ul style=\"margin-left: 40px;\">\r\n	<li>Un encadrement personnalis&eacute; et bienveillant, o&ugrave; chaque &eacute;l&egrave;ve est connu et accompagn&eacute;.</li>\r\n	<li>Une tradition d&rsquo;excellence qui se renouvelle depuis 1827, alliant innovation p&eacute;dagogique et valeurs fortes (respect, engagement, autonomie et ouverture sur le monde).</li>\r\n	<li>Une vie &eacute;tudiante riche, avec une multitude de programmes, de concentrations sportives, artistiques et scientifiques, ainsi que des activit&eacute;s culturelles et sociales vari&eacute;es.</li>\r\n	<li>Des technologies int&eacute;gr&eacute;es &agrave; l&rsquo;apprentissage (iPad, tableaux interactifs, classe invers&eacute;e, outils num&eacute;riques) pour mieux pr&eacute;parer les leaders de demain.</li>\r\n	<li>Une famille accueillante o&ugrave; les &eacute;l&egrave;ves d&eacute;veloppent leurs talents, nourrissent leurs passions et b&acirc;tissent des amiti&eacute;s durables.</li>\r\n</ul>\r\n\r\n<p data-end=\"1349\" data-start=\"1161\">En r&eacute;sum&eacute;, le Coll&egrave;ge est un milieu de vie stimulant, s&eacute;curitaire et inspirant, o&ugrave; chaque adolescent peut s&rsquo;&eacute;panouir pleinement et se pr&eacute;parer &agrave; devenir un citoyen engag&eacute; et responsable.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 7, 'fr', 'Y a-t-il un service de transport scolaire?', '<p>Oui. Le Coll&egrave;ge offre un service de transport scolaire couvrant plusieurs municipalit&eacute;s de la r&eacute;gion, ce qui permet aux &eacute;l&egrave;ves de diff&eacute;rents secteurs de se rendre facilement &agrave; l&rsquo;&eacute;cole. En plus du transport quotidien du matin et de l&rsquo;apr&egrave;s-midi, un deuxi&egrave;me est pr&eacute;vu&nbsp;en soir&eacute;e &agrave; 17 h 30, principalement pour les &eacute;l&egrave;ves inscrits &agrave; des activit&eacute;s parascolaires, au programme Volleyball&nbsp;et &agrave; des concentrations.</p>\r\n\r\n<p data-end=\"364\" data-start=\"101\">Les secteurs desservis incluent notamment :</p>\r\n\r\n<ul data-end=\"822\" data-start=\"366\">\r\n	<li data-end=\"386\" data-start=\"366\">\r\n	<p data-end=\"386\" data-start=\"368\">Cap-Saint-Ignace</p>\r\n	</li>\r\n	<li data-end=\"401\" data-start=\"387\">\r\n	<p data-end=\"401\" data-start=\"389\">Kamouraska</p>\r\n	</li>\r\n	<li data-end=\"418\" data-start=\"402\">\r\n	<p data-end=\"418\" data-start=\"404\">La Pocati&egrave;re</p>\r\n	</li>\r\n	<li data-end=\"430\" data-start=\"419\">\r\n	<p data-end=\"430\" data-start=\"421\">L&rsquo;Islet</p>\r\n	</li>\r\n	<li data-end=\"446\" data-start=\"431\">\r\n	<p data-end=\"446\" data-start=\"433\">Mont-Carmel</p>\r\n	</li>\r\n	<li data-end=\"460\" data-start=\"447\">\r\n	<p data-end=\"460\" data-start=\"449\">Montmagny</p>\r\n	</li>\r\n	<li data-end=\"479\" data-start=\"461\">\r\n	<p data-end=\"479\" data-start=\"463\">Rivi&egrave;re-Ouelle</p>\r\n	</li>\r\n	<li data-end=\"496\" data-start=\"480\">\r\n	<p data-end=\"496\" data-start=\"482\">Saint-Aubert</p>\r\n	</li>\r\n	<li data-end=\"512\" data-start=\"497\">\r\n	<p data-end=\"512\" data-start=\"499\">Saint-Bruno-de-Kamouraska</p>\r\n	</li>\r\n	<li data-end=\"529\" data-start=\"513\">\r\n	<p data-end=\"529\" data-start=\"515\">Saint-Damase</p>\r\n	</li>\r\n	<li data-end=\"545\" data-start=\"530\">\r\n	<p data-end=\"545\" data-start=\"532\">Saint-Denis-De La Bouteillerie</p>\r\n	</li>\r\n	<li data-end=\"562\" data-start=\"546\">\r\n	<p data-end=\"562\" data-start=\"548\">Saint-Eug&egrave;ne (L&#39;Islet)</p>\r\n	</li>\r\n	<li data-end=\"580\" data-start=\"563\">\r\n	<p data-end=\"580\" data-start=\"565\">Saint-Gabriel-Lalemant</p>\r\n	</li>\r\n	<li data-end=\"598\" data-start=\"581\">\r\n	<p data-end=\"598\" data-start=\"583\">Saint-Germain-de-Kamouraska</p>\r\n	</li>\r\n	<li data-end=\"616\" data-start=\"599\">\r\n	<p data-end=\"616\" data-start=\"601\">Sainte-H&eacute;l&egrave;ne-de-Kamouraska</p>\r\n	</li>\r\n	<li data-end=\"641\" data-start=\"617\">\r\n	<p data-end=\"641\" data-start=\"619\">Saint-Jean-Port-Joli</p>\r\n	</li>\r\n	<li data-end=\"658\" data-start=\"642\">\r\n	<p data-end=\"658\" data-start=\"644\">Saint-Joseph-de-Kamouraska</p>\r\n	</li>\r\n	<li data-end=\"676\" data-start=\"659\">\r\n	<p data-end=\"676\" data-start=\"661\">Sainte-Louise</p>\r\n	</li>\r\n	<li data-end=\"694\" data-start=\"677\">\r\n	<p data-end=\"694\" data-start=\"679\">Saint-On&eacute;sime-d&#39;Ixworth (La Pocati&egrave;re)</p>\r\n	</li>\r\n	<li data-end=\"711\" data-start=\"695\">\r\n	<p data-end=\"711\" data-start=\"697\">Saint-Pac&ocirc;me</p>\r\n	</li>\r\n	<li data-end=\"730\" data-start=\"712\">\r\n	<p data-end=\"730\" data-start=\"714\">Saint-Pamphile</p>\r\n	</li>\r\n	<li data-end=\"747\" data-start=\"731\">\r\n	<p data-end=\"747\" data-start=\"733\">Saint-Pascal</p>\r\n	</li>\r\n	<li data-end=\"767\" data-start=\"748\">\r\n	<p data-end=\"767\" data-start=\"750\">Sainte-Perp&eacute;tue</p>\r\n	</li>\r\n	<li data-end=\"794\" data-start=\"768\">\r\n	<p data-end=\"794\" data-start=\"770\">Saint-Philippe-de-N&eacute;ri</p>\r\n	</li>\r\n	<li data-end=\"822\" data-start=\"795\">\r\n	<p data-end=\"822\" data-start=\"797\">Saint-Roch-des-Aulnaies</p>\r\n	</li>\r\n	<li data-end=\"822\" data-start=\"795\">\r\n	<p data-end=\"822\" data-start=\"797\">Sainte-Anne-de-la-Pocati&egrave;re (La Pocati&egrave;re)</p>\r\n	</li>\r\n</ul>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(10, 10, 'fr', 'Qu\'en est-il de la vie étudiante au Collège? ', '<p>La vie &eacute;tudiante au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re est riche et dynamique! Les &eacute;l&egrave;ves peuvent s&rsquo;impliquer dans une foule d&rsquo;activit&eacute;s culturelles, sportives et sociales qui compl&egrave;tent leur formation scolaire et favorisent leur &eacute;panouissement personnel.</p>\r\n\r\n<ul style=\"margin-left: 40px;\">\r\n	<li>Activit&eacute;s sp&eacute;ciales : journ&eacute;e d&rsquo;accueil, classes rouges et blanches, Coupe Andr&eacute;-Larouche, activit&eacute;s de neige, voyages &eacute;ducatifs, f&ecirc;tes th&eacute;matiques (Halloween, No&euml;l, Saint-Valentin), Secondaire en spectacle, etc.</li>\r\n	<li>Vie sportive et culturelle&nbsp;: concentrations artistiques, culturelles, internationale et sportives, programme sport en Volleyball et&nbsp;perfectionnement sportifs</li>\r\n	<li>Engagements &eacute;tudiants : Gouvernement &eacute;tudiant, comit&eacute;s, b&eacute;n&eacute;volat, radio et animation scolaire, projets de solidarit&eacute; internationale (ex. Paramundo).</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bref, au Coll&egrave;ge, les &eacute;l&egrave;ves trouvent un milieu de vie stimulant o&ugrave; ils peuvent d&eacute;velopper leurs talents, b&acirc;tir des amiti&eacute;s durables et vivre des exp&eacute;riences m&eacute;morables.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 11, 'fr', 'Qu’est-ce que ça apporte de côtoyer chaque jour des élèves venus d’ailleurs?', '<p>C&rsquo;est comme voyager sans quitter l&rsquo;&eacute;cole!</p>\r\n\r\n<p>Au Coll&egrave;ge, nos &eacute;l&egrave;ves partagent leur quotidien avec des jeunes de la Chine, du Mexique, de Saint-Barth&eacute;lemy (France) et d&rsquo;ailleurs. Cette diversit&eacute; cr&eacute;e une ouverture unique sur le monde, d&eacute;veloppe le respect des diff&eacute;rences et enrichit les amiti&eacute;s. Ensemble, nos &eacute;l&egrave;ves d&eacute;couvrent de nouvelles cultures, &eacute;largissent leurs horizons et b&acirc;tissent des souvenirs communs qui les pr&eacute;parent &agrave; devenir des citoyens ouverts et engag&eacute;s.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(12, 12, 'fr', 'Comment le Collège aide-t-il les élèves à réussir leurs études?', '<p>Ici, personne n&rsquo;est laiss&eacute; de c&ocirc;t&eacute;!</p>\r\n\r\n<p>Nos &eacute;l&egrave;ves b&eacute;n&eacute;ficient d&rsquo;un accompagnement personnalis&eacute; &agrave; chaque &eacute;tape : p&eacute;riodes d&#39;&eacute;tude et de&nbsp;devoirs supervis&eacute;es int&eacute;gr&eacute;es &agrave; l&rsquo;horaire, r&eacute;cup&eacute;rations gratuites dans les mati&egrave;res de base, soutien en orthop&eacute;dagogie, service de &laquo; Prof. Secours &raquo; pour un coup de main rapide, psycho&eacute;ducation, infirmi&egrave;re, suivi avec les parents via le Pluriportail et plus encore.</p>\r\n\r\n<p>Tout est pens&eacute; pour que chaque jeune trouve les outils et l&rsquo;encadrement n&eacute;cessaires afin d&rsquo;atteindre son plein potentiel&hellip; et m&ecirc;me de le d&eacute;passer!</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
