INSERT INTO `fundraisingCampaignWelcomeWords` (`id`, `category`, `ranking`, `image`, `field1`, `field2`, `field3`, `field5`, `field7`, `field11`, `field12`, `field13`, `field14`, `field15`, `creationDate`, `creationHour`, `updateDate`, `updateHour`, `ogimage`, `visible`) VALUES
(4, 0, 1, '/assets/images/campagne-de-financement/christine-st-pierre.jpg', 'Christine St-Pierre, finissante du 142e cours', '<p>C&rsquo;est avec un immense plaisir que je me joins &agrave; la campagne majeure de financement du 200<sup>e</sup>&nbsp;anniversaire de fondation du Coll&egrave;ge. Cette campagne se veut non seulement un hommage &agrave; cette grande institution, mais aussi &agrave; tous ceux et celles qui l&rsquo;on fait grandir. Nous avons le devoir de poursuivre sa mission et d&rsquo;offrir aux g&eacute;n&eacute;rations &agrave; venir ce qu&rsquo;il y a de meilleur.</p>\r\n\r\n<p>J&rsquo;ai grandi dans un milieu qui croyait &agrave; l&rsquo;importance de l&rsquo;&eacute;ducation. Au Coll&egrave;ge, j&rsquo;ai compris qu&rsquo;elle nous ouvre sur le monde, qu&rsquo;elle abat les pr&eacute;jug&eacute;s et qu&rsquo;elle permet de r&eacute;aliser nos plus grands r&ecirc;ves.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-28', '13:44:44', '2025-05-28', '13:45:04', NULL, 1),
(5, 0, 2, '/assets/images/campagne-de-financement/martin-david-peters.jpg', 'Martin-David Peters, finissant du 156e cours', '<p>Il y a plus de quarante ans, le Coll&egrave;ge a fait une diff&eacute;rence dans la vie de ma soeur, de mon fr&egrave;re et de moi-m&ecirc;me. Par son soutien p&eacute;dagogique et personnel, le Coll&egrave;ge a su &ecirc;tre l&agrave; pour favoriser notre r&eacute;ussite. Aujourd&rsquo;hui, je suis fier d&rsquo;agir comme porte-parole de la campagne de financement 2023-2027.</p>\r\n\r\n<p>Le Coll&egrave;ge est une institution de coeur. Je vous invite &agrave; donner avec le v&ocirc;tre, pour les &eacute;l&egrave;ves d&rsquo;aujourd&rsquo;hui et de demain. Merci!</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-28', '13:45:21', '2025-05-28', '13:46:16', NULL, 1),
(6, 0, 3, '/assets/images/campagne-de-financement/remi-faucher.jpg', 'Rémi Faucher', '<p>Depuis 1970, la Fondation Bouchard appuie le Coll&egrave;ge Sainte-Anne-de-la-Pocati&egrave;re dans ses d&eacute;fis financiers pour assurer sa p&eacute;rennit&eacute; et offrir ainsi, aux jeunes de la r&eacute;gion, l&rsquo;acc&egrave;s &agrave; une &eacute;ducation de qualit&eacute;.</p>\r\n\r\n<p>C&rsquo;est pourquoi, la Fondation Bouchard est fi&egrave;re de r&eacute;it&eacute;rer son engagement envers le Coll&egrave;ge en tant que &laquo; Donateur Prestige &raquo; de la campagne de financement du 200e.</p>\r\n\r\n<p>Nous continuerons de soutenir les projets qui sont au c&oelig;ur de notre mission et nous soutiendrons des projets d&rsquo;envergure associ&eacute;s au bicentenaire du Coll&egrave;ge.</p>\r\n\r\n<p>Bon 200e !</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-28', '13:50:29', '2025-05-28', '13:50:48', NULL, 1),
(7, 0, 4, '/assets/images/campagne-de-financement/paul-cartier.jpg', 'Paul Cartier', '<p>Bien plus qu&rsquo;une institution d&rsquo;enseignement secondaire, notre Coll&egrave;ge est un moteur &eacute;conomique r&eacute;gional et assure, de g&eacute;n&eacute;ration en g&eacute;n&eacute;ration, la formation de nos jeunes. Notre campagne majeure de financement permettra de r&eacute;aliser des projets essentiels &agrave; la poursuite de nos activit&eacute;s tout en facilitant le passage de nos &eacute;l&egrave;ves vers les &eacute;tudes postsecondaires.</p>\r\n\r\n<p>En tant que pr&eacute;sident de la Corporation, il est important que le Coll&egrave;ge demeure accessible &agrave; tou(te)s, qu&rsquo;il permette la r&eacute;ussite de l&rsquo;ensemble de ses &eacute;l&egrave;ves et qu&rsquo;il continue d&rsquo;&ecirc;tre un leader en &eacute;ducation. Votre don est le geste dont nous avons besoin afin d&rsquo;y parvenir. Nous avons besoin de vous!</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-28', '13:50:53', '2025-05-28', '13:51:14', NULL, 1),
(8, 0, 5, '/assets/images/campagne-de-financement/stephane-lemelin.jpg', 'Stéphane Lemelin', '<p>Je tiens &agrave; vous remercier de tout mon coeur pour votre soutien &agrave; notre campagne de financement des f&ecirc;tes du 200e anniversaire du Coll&egrave;ge. Celle-ci permettra de soutenir tous nos &eacute;l&egrave;ves afin de favoriser leur r&eacute;ussite scolaire, de leur donner acc&egrave;s &agrave; des ressources p&eacute;dagogiques de qualit&eacute; et leur donner la chance d&rsquo;&eacute;voluer dans un milieu de vie ad&eacute;quat et s&eacute;curitaire.</p>\r\n\r\n<p>De plus, &eacute;tant donn&eacute; que notre Coll&egrave;ge ne fait pas la s&eacute;lection de ses &eacute;l&egrave;ves, nous avons besoin de vous afin de continuer notre mandat qui est d&rsquo;assurer la r&eacute;ussite de nos &eacute;l&egrave;ves.</p>\r\n\r\n<p>Merci de votre g&eacute;n&eacute;rosit&eacute;! Merci de croire en votre Coll&egrave;ge! Merci de faire la diff&eacute;rence dans la vie et le futur de nos &eacute;l&egrave;ves!</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-28', '13:51:23', '2025-05-28', '13:51:42', NULL, 1);
INSERT INTO `fundraisingCampaignWelcomeWords_f` (`id`, `originId`, `category`, `ranking`, `name`, `image`, `field1`, `field2`, `field3`, `field4`, `field5`, `field6`, `field7`, `field8`, `field9`, `field10`, `field11`, `field12`, `field13`, `field14`, `field15`) VALUES
(2, 0, '', '\"rank\":0.5, \r\n\"type\":4, \r\n\"width\":50, \r\n\"name\":\"Numéro\",\r\n\"help\":\"Pour l\'ordre d\'apparition sur le site\"', '\"rank\":1, \r\n\"type\":4, \r\n\"width\":900, \r\n\"name\":\"Nom\"', '\"rank\":3, \r\n\"type\":14,\r\n\"name\":\"Photo\",\r\n\"folder\":\"campagne-de-financement\"', '\"rank\":2, \r\n\"type\":4, \r\n\"width\":900, \r\n\"name\":\"Nom de la personne\"', '\"rank\":4, \r\n\"type\":10, \r\n\"width\":900, \r\n\"name\":\"Texte\"', '', '', '', '', '', '', '', '', '', '', '', '', '');
INSERT INTO `fundraisingCampaignWelcomeWords_ml` (`id`, `originId`, `langCode`, `name`, `field1`, `field2`, `field3`, `field4`, `field6`, `field7`, `field8`, `field9`, `field10`, `field11`, `field12`, `urlRewrite`, `title`, `descriptionMeta`, `h1`) VALUES
(4, 4, 'fr', 'Présidente de la campagne', 'Christine St-Pierre, finissante du 142e cours', '<p>C&rsquo;est avec un immense plaisir que je me joins &agrave; la campagne majeure de financement du 200<sup>e</sup>&nbsp;anniversaire de fondation du Coll&egrave;ge. Cette campagne se veut non seulement un hommage &agrave; cette grande institution, mais aussi &agrave; tous ceux et celles qui l&rsquo;on fait grandir. Nous avons le devoir de poursuivre sa mission et d&rsquo;offrir aux g&eacute;n&eacute;rations &agrave; venir ce qu&rsquo;il y a de meilleur.</p>\r\n\r\n<p>J&rsquo;ai grandi dans un milieu qui croyait &agrave; l&rsquo;importance de l&rsquo;&eacute;ducation. Au Coll&egrave;ge, j&rsquo;ai compris qu&rsquo;elle nous ouvre sur le monde, qu&rsquo;elle abat les pr&eacute;jug&eacute;s et qu&rsquo;elle permet de r&eacute;aliser nos plus grands r&ecirc;ves.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 5, 'fr', 'Porte-parole de la campagne', 'Martin-David Peters, finissant du 156e cours', '<p>Il y a plus de quarante ans, le Coll&egrave;ge a fait une diff&eacute;rence dans la vie de ma soeur, de mon fr&egrave;re et de moi-m&ecirc;me. Par son soutien p&eacute;dagogique et personnel, le Coll&egrave;ge a su &ecirc;tre l&agrave; pour favoriser notre r&eacute;ussite. Aujourd&rsquo;hui, je suis fier d&rsquo;agir comme porte-parole de la campagne de financement 2023-2027.</p>\r\n\r\n<p>Le Coll&egrave;ge est une institution de coeur. Je vous invite &agrave; donner avec le v&ocirc;tre, pour les &eacute;l&egrave;ves d&rsquo;aujourd&rsquo;hui et de demain. Merci!</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 6, 'fr', 'Président de la fondation Bouchard', 'Rémi Faucher', '<p>Depuis 1970, la Fondation Bouchard appuie le Coll&egrave;ge Sainte-Anne-de-la-Pocati&egrave;re dans ses d&eacute;fis financiers pour assurer sa p&eacute;rennit&eacute; et offrir ainsi, aux jeunes de la r&eacute;gion, l&rsquo;acc&egrave;s &agrave; une &eacute;ducation de qualit&eacute;.</p>\r\n\r\n<p>C&rsquo;est pourquoi, la Fondation Bouchard est fi&egrave;re de r&eacute;it&eacute;rer son engagement envers le Coll&egrave;ge en tant que &laquo; Donateur Prestige &raquo; de la campagne de financement du 200e.</p>\r\n\r\n<p>Nous continuerons de soutenir les projets qui sont au c&oelig;ur de notre mission et nous soutiendrons des projets d&rsquo;envergure associ&eacute;s au bicentenaire du Coll&egrave;ge.</p>\r\n\r\n<p>Bon 200e !</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 7, 'fr', 'Président de la Corporation du Collège', 'Paul Cartier', '<p>Bien plus qu&rsquo;une institution d&rsquo;enseignement secondaire, notre Coll&egrave;ge est un moteur &eacute;conomique r&eacute;gional et assure, de g&eacute;n&eacute;ration en g&eacute;n&eacute;ration, la formation de nos jeunes. Notre campagne majeure de financement permettra de r&eacute;aliser des projets essentiels &agrave; la poursuite de nos activit&eacute;s tout en facilitant le passage de nos &eacute;l&egrave;ves vers les &eacute;tudes postsecondaires.</p>\r\n\r\n<p>En tant que pr&eacute;sident de la Corporation, il est important que le Coll&egrave;ge demeure accessible &agrave; tou(te)s, qu&rsquo;il permette la r&eacute;ussite de l&rsquo;ensemble de ses &eacute;l&egrave;ves et qu&rsquo;il continue d&rsquo;&ecirc;tre un leader en &eacute;ducation. Votre don est le geste dont nous avons besoin afin d&rsquo;y parvenir. Nous avons besoin de vous!</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 8, 'fr', 'Directeur général du Collège', 'Stéphane Lemelin', '<p>Je tiens &agrave; vous remercier de tout mon coeur pour votre soutien &agrave; notre campagne de financement des f&ecirc;tes du 200e anniversaire du Coll&egrave;ge. Celle-ci permettra de soutenir tous nos &eacute;l&egrave;ves afin de favoriser leur r&eacute;ussite scolaire, de leur donner acc&egrave;s &agrave; des ressources p&eacute;dagogiques de qualit&eacute; et leur donner la chance d&rsquo;&eacute;voluer dans un milieu de vie ad&eacute;quat et s&eacute;curitaire.</p>\r\n\r\n<p>De plus, &eacute;tant donn&eacute; que notre Coll&egrave;ge ne fait pas la s&eacute;lection de ses &eacute;l&egrave;ves, nous avons besoin de vous afin de continuer notre mandat qui est d&rsquo;assurer la r&eacute;ussite de nos &eacute;l&egrave;ves.</p>\r\n\r\n<p>Merci de votre g&eacute;n&eacute;rosit&eacute;! Merci de croire en votre Coll&egrave;ge! Merci de faire la diff&eacute;rence dans la vie et le futur de nos &eacute;l&egrave;ves!</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `history` (`id`, `category`, `ranking`, `image`, `field1`, `field2`, `field3`, `field5`, `field7`, `field11`, `field12`, `field13`, `field14`, `field15`, `creationDate`, `creationHour`, `updateDate`, `updateHour`, `ogimage`, `visible`) VALUES
(1, 0, 41, '', '<p>D&egrave;s le mois de juin 1827, les travaux commencent. Avec ses paroissiens, l&#39;abb&eacute; Painchaud va couper le bois dans la for&ecirc;t et extraire la pierre dans les champs. Les paroissiens de Sainte-Anne-de-la-Pocati&egrave;re se distingu&egrave;rent en donnant argent, mat&eacute;riaux, journ&eacute;es de travail, voyages pour transporter le bois, la chaux, la pierre. La construction durera deux ans.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:04:47', '2025-05-11', '19:04:57', NULL, 1),
(2, 0, 40, '', '<p>L&#39;abb&eacute; Fran&ccedil;ois Pilote, alors directeur du CSA, fonde l&#39;&Eacute;cole d&#39;Agriculture, devenue aujourd&#39;hui l&#39;Institut de technologie agroalimentaire de La Pocati&egrave;re.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:05:02', '2025-05-11', '19:05:10', NULL, 1),
(3, 0, 39, '', '<p>L&rsquo;Association des anciens &eacute;l&egrave;ves du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re voit le jour le 23 juin 1890.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:05:14', '2025-05-11', '19:05:18', NULL, 1),
(4, 0, 38, '/assets/images/histoire/historique-1894.jpg', '<p>Le 14 novembre 1894, l&rsquo;eau arrive au CSA, une v&eacute;ritable r&eacute;volution.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:05:25', '2025-06-30', '16:45:31', NULL, 1),
(5, 0, 37, '', '<p>Composition du chant d&rsquo;adieu &laquo; Fils de Ste-Anne &raquo; qui est toujours chant&eacute; aujourd&rsquo;hui lors du d&eacute;part de nos finissants et finissantes.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:05:36', '2025-05-11', '19:05:43', NULL, 1),
(6, 0, 36, '/assets/images/histoire/historique-1915.jpg', '<p>Le 20 novembre 1915, l&#39;ampoule &eacute;lectrique fait son entr&eacute;e au CSA. La vie ne serait plus jamais la m&ecirc;me.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:05:48', '2025-06-30', '16:47:25', NULL, 1),
(7, 0, 35, '', '<p>Comme si les cons&eacute;quences de la Premi&egrave;re Guerre mondiale ne suffisaient pas, la grippe espagnole fait treize d&eacute;c&egrave;s parmi nos &eacute;l&egrave;ves.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:06:00', '2025-05-11', '19:06:04', NULL, 1),
(8, 0, 34, '/assets/images/histoire/historique-1920.jpeg', '<p>Incendie du CSA le 15 d&eacute;cembre 1920. Le feu est le ma&icirc;tre! On donne l&#39;alarme g&eacute;n&eacute;rale et les paroissiens accourent pour travailler au sauvetage. Malheureusement, le vent va rendre inutile toute tentative d&#39;extinction. Le feu prend maintenant les proportions d&#39;une immense conflagration et il ne reste plus qu&#39;&agrave; sauver du d&eacute;sastre le plus d&#39;objets possible. Les paroissiens, les &eacute;l&egrave;ves, les pr&ecirc;tres arrachent &agrave; l&#39;incendie une partie du mobilier, et ne reculent que pas &agrave; pas devant l&#39;&eacute;l&eacute;ment destructeur. Mais le feu fait rage, il attaque, l&#39;une apr&egrave;s l&#39;autre, les diff&eacute;rentes ailes du CSA presque centenaire.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:06:08', '2025-05-11', '19:06:44', NULL, 1),
(9, 0, 33, '/assets/images/histoire/historique-1926.jpg', '<p>Le CSA ne devait pas tarder &agrave; sortir graduellement de ses cendres. En effet, le 25 f&eacute;vrier 1921, la Corporation du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re adopte les plans propos&eacute;s par son architecte. Le coll&egrave;ge nouveau s&#39;&eacute;l&egrave;vera sur les ruines de l&#39;ancien. Le 23 mai 1921, commencent les fondations de la fa&ccedil;ade et le 29 mai 1923, on y c&eacute;l&egrave;bre le couronnement des travaux de reconstruction qui ont dur&eacute; deux ans.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:06:57', '2025-06-30', '16:49:57', NULL, 1),
(10, 0, 32, '', '<p>Cr&eacute;ation de l&#39;&OElig;uvre St-Charles qui vient en aide financi&egrave;re &agrave; nos familles d&#39;&eacute;l&egrave;ves. Ce fonds de bourses d&rsquo;&eacute;tudes existe toujours aujourd&rsquo;hui mais sous le nom du fondateur du CSA : le Fonds d&rsquo;&eacute;tude Charles-Fran&ccedil;ois-Painchaud, cr&eacute;&eacute; en 2002.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:07:14', '2025-05-11', '19:07:21', NULL, 1),
(11, 0, 31, '/assets/images/histoire/historique-1927.jpeg', '<p>Le 20 juin 1927, 1 500 anciens &eacute;l&egrave;ves se donnent rendez-vous pour les F&ecirc;tes du Centenaire du CSA.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:07:30', '2025-05-11', '19:07:51', NULL, 1),
(12, 0, 30, '/assets/images/histoire/historique-1933.jpg', '<p>Premier num&eacute;ro d&rsquo;un journal destin&eacute; aux anciens &eacute;l&egrave;ves du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re :&nbsp;<a href=\"http://leadercsa.com/?rub=9&amp;sousRub=60\" target=\"_blank\"><u><strong>L&#39;Union Amicale</strong></u></a>&nbsp;qui existe toujours et qui est distribu&eacute; trois fois par ann&eacute;e &agrave; plus de 5 000 anciens et anciennes &eacute;l&egrave;ves.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:08:50', '2025-05-11', '19:09:45', NULL, 1),
(13, 0, 29, '/assets/images/histoire/historique-1945-1.jpg', '<p>En septembre 1945, l&#39;imp&eacute;ratrice Zita d&#39;Autriche est re&ccedil;ue au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re. Nous avons le privil&egrave;ge d&#39;avoir en nos murs un magnifique piano lui ayant appartenu.</p>\r\n', '/assets/images/histoire/historique-1945-2.jpg', '/assets/images/histoire/historique-1945-3.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '19:13:16', '2025-05-11', '19:14:27', NULL, 1),
(14, 0, 28, '', '<p>Tout est pr&ecirc;t pour l&#39;ouverture des classes, mais il faudra attendre au 1er octobre pour commencer l&#39;enseignement parce que seulement 8 &eacute;l&egrave;ves se sont pr&eacute;sent&eacute;s le jour de la rentr&eacute;e, les futurs &eacute;tudiants &eacute;tant occup&eacute;s aux r&eacute;coltes. On compte alors 20 pensionnaires et quelques externes. &Agrave; la fin de l&#39;ann&eacute;e, on comptait 47 &eacute;l&egrave;ves.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '16:41:34', '2025-06-30', '16:41:44', NULL, 1),
(15, 0, 27, '/assets/images/histoire/historique-1838.jpg', '<p>D&eacute;c&egrave;s du fondateur du CSA, Charles-Fran&ccedil;ois Painchaud, le 9 f&eacute;vrier 1838.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '16:42:05', '2025-06-30', '16:43:13', NULL, 1),
(16, 0, 26, '', '<p>Cr&eacute;ation du concours oratoire Painchaud, le plus vieux concours existant encore aujourd&rsquo;hui chez nous. Il portait &agrave; l&rsquo;&eacute;poque le nom de Soci&eacute;t&eacute; Painchaud qui se voulait une soci&eacute;t&eacute; d&rsquo;&eacute;loquence.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '16:43:44', '2025-06-30', '16:43:50', NULL, 1),
(18, 0, 25, '', '<p>Port du suisse &laquo; capot d&rsquo;&eacute;colier &raquo; obligatoire, l&rsquo;uniforme du temps. Il dispara&icirc;tra &agrave; tout jamais en 1955.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '16:44:30', '2025-06-30', '16:44:52', NULL, 1),
(20, 0, 24, '', '<p>1re guerre mondiale. Cent soixante-deux (162) &eacute;l&egrave;ves du CSA, anciens ou actuels, ont pris part &agrave; cette grande guerre : un dans l&#39;arm&eacute;e anglaise, cent cinquante et un dans l&#39;arm&eacute;e canadienne et dix dans l&#39;arm&eacute;e am&eacute;ricaine. Le CSA y d&eacute;l&eacute;gua quatre aum&ocirc;niers, neuf m&eacute;decins, un colonel, six capitaines, douze lieutenants, trois sergents et cent vingt-sept soldats. Parmi eux, il y eut 15 morts en service actif.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '16:46:04', '2025-06-30', '16:46:16', NULL, 1),
(21, 0, 23, '', '<p>R&eacute;novation de la Chapelle du CSA, un joyau dans un &eacute;crin de pierres.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '16:51:09', '2025-06-30', '16:51:20', NULL, 1),
(22, 0, 22, '', '<p>En septembre 1964, les filles font discr&egrave;tement leur entr&eacute;e au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re en Belles-Lettres sp&eacute;ciales ! Une autre r&eacute;volution.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '16:51:28', '2025-06-30', '16:51:43', NULL, 1),
(23, 0, 21, '', '<p>Les Petites S&oelig;urs de la Sainte-Famille quittent le CSA. Pendant 62 ans, soit de 1905 &agrave; 1967, elles ont &eacute;t&eacute; quatre cent cinquante-deux (452) &agrave; se relayer au service des pr&ecirc;tres et de nos &eacute;l&egrave;ves.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '16:51:51', '2025-06-30', '16:51:59', NULL, 1),
(24, 0, 20, '', '<p>Cr&eacute;ation de la Fondation Bouchard qui soutient remarquablement notre &eacute;cole dans son d&eacute;veloppement p&eacute;dagogique depuis plus de 40 ans.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '16:52:04', '2025-06-30', '16:52:12', NULL, 1),
(25, 0, 19, '', '<p>Ouverture du Mus&eacute;e Fran&ccedil;ois-Pilote, maintenant Mus&eacute;e Qu&eacute;b&eacute;cois de l&#39;agriculture et de l&#39;alimentation, situ&eacute; &agrave; l&rsquo;arri&egrave;re du CSA. Un mus&eacute;e qui met en vedette l&rsquo;agriculture.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '16:52:18', '2025-06-30', '16:52:25', NULL, 1),
(26, 0, 18, '', '<p>D&eacute;but de la construction de notre gymnase actuel.<br />\r\nCette m&ecirc;me ann&eacute;e, on c&eacute;l&egrave;bre le 150e anniversaire du CSA.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:10:29', '2025-06-30', '17:10:46', NULL, 1),
(27, 0, 17, '', '<p>Cr&eacute;ation du groupe humanitaire Paramundo.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:10:51', '2025-06-30', '17:11:05', NULL, 1),
(28, 0, 16, '', '<p>Ouverture du Centre d&rsquo;archives de la C&ocirc;te-Sud et du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:11:11', '2025-06-30', '17:11:20', NULL, 1),
(29, 0, 15, '', '<p>Le 16 septembre 1994, le C&eacute;gep de La Pocati&egrave;re fait l&rsquo;acquisition des locaux du CSA qu&rsquo;il occupe d&eacute;j&agrave;, mais dont il &eacute;tait locataire.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:11:25', '2025-06-30', '17:11:36', NULL, 1),
(30, 0, 14, '', '<p>Le 14 juin 1995, arriv&eacute;e du r&eacute;seau Internet au CSA gr&acirc;ce &agrave; la collaboration de la Fondation Bouchard.</p>\r\n\r\n<p>Ouverture de l&#39;&Eacute;cole de Musique du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re devenue aujourd&rsquo;hui l&rsquo;&Eacute;cole Destroismaisons qui a toujours son si&egrave;ge social chez nous.</p>\r\n\r\n<p>Cr&eacute;ation de Secondaire en Spectacle par le CSA qui est devenu aujourd&rsquo;hui un rendez-vous provincial sous la responsabilit&eacute; des U.R.L.S. (Unit&eacute;s R&eacute;gionales de Loisirs et de Sports).</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:11:41', '2025-06-30', '17:12:05', NULL, 1),
(31, 0, 13, '/assets/images/histoire/historique-2000.jpg', '<p>Le football, sport fort populaire au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re dans les ann&eacute;es 60-70, revient en force avec la mise sur pied d&#39;une &eacute;quipe cadette : les Wisigoths. En 2001, une &eacute;quipe juv&eacute;nile s&#39;ajoute &agrave; la premi&egrave;re. Cette derni&egrave;re remporta le Bol d&rsquo;Or &agrave; l&rsquo;automne 2006.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:12:12', '2025-06-30', '17:13:06', NULL, 1),
(32, 0, 12, '', '<p>Premiers stagiaires du Campus Saint-Jean de l&rsquo;Universit&eacute; de l&rsquo;Alberta en s&eacute;jour d&rsquo;immersion fran&ccedil;aise, chez nous, durant les mois de juillet et ao&ucirc;t. Depuis, chaque &eacute;t&eacute;, nous accueillons ces stagiaires du programme Explore.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:13:53', '2025-06-30', '17:14:01', NULL, 1),
(33, 0, 11, '', '<p>Avec la rentr&eacute;e scolaire 2004, une autre page d&#39;histoire s&#39;&eacute;crit puisque l&#39;uniforme est maintenant de mise.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:14:05', '2025-06-30', '17:14:14', NULL, 1),
(34, 0, 10, '', '<p>L&#39;enseignement du latin devient chose du pass&eacute; en juin 2005 c&eacute;dant sa place &agrave; l&rsquo;espagnol.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:14:19', '2025-06-30', '17:14:27', NULL, 1),
(35, 0, 9, '', '<p>En juin 2006, l&#39;abb&eacute; Alfred B&eacute;rub&eacute; quitte l&#39;enseignement apr&egrave;s 39 ann&eacute;es. Avec son d&eacute;part, une autre page d&#39;histoire se tourne puisqu&#39;il &eacute;tait le dernier pr&ecirc;tre &agrave; enseigner chez nous depuis la fondation du CSA en 1829.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:14:33', '2025-06-30', '17:14:44', NULL, 1),
(36, 0, 8, '/assets/images/histoire/historique-2008.jpg', '<p>Conf&eacute;rence de presse le 3 juin 2008 : lancement de notre projet de g&eacute;othermie.</p>\r\n\r\n<p>Le 28 octobre 2008, le CSA fait la page couverture de la revue l&rsquo;Actualit&eacute; s&rsquo;&eacute;tant class&eacute;e 1re &eacute;cole priv&eacute;e au Qu&eacute;bec (et 3e au niveau provincial, &eacute;coles priv&eacute;es et publiques confondues) pour l&rsquo;impact sur la r&eacute;ussite des &eacute;l&egrave;ves.</p>\r\n', '/assets/images/histoire/historique-2008-2.jpg', '/assets/images/histoire/historique-2008-3.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:14:51', '2025-06-30', '17:22:30', NULL, 1),
(37, 0, 7, '', '<p>Le 28 septembre 2010, le CSA remporte un premier prix provincial au concours Excellence Mieux Consommer 2010 parrain&eacute; par Hydro-Qu&eacute;bec pour l&#39;implantation de la g&eacute;othermie.</p>\r\n\r\n<p>Le 1er octobre 2010, lancement officiel d&#39;une campagne de financement de 3 millions de dollars.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:23:26', '2025-06-30', '17:23:36', NULL, 1),
(38, 0, 6, '', '<p>Le 22 juin 2011, fermeture d&eacute;finitive de notre pensionnat. Des familles d&#39;accueil prennent la rel&egrave;ve.</p>\r\n\r\n<p>&Agrave; l&rsquo;&eacute;t&eacute; 2011, gr&acirc;ce &agrave; notre campagne de financement, des travaux majeurs sont rendus possibles. Les vestiaires des gar&ccedil;ons sont refaits au complet, de nouveaux vestiaires pour le football sont am&eacute;nag&eacute;s et nous proc&eacute;dons &agrave; des travaux importants dans la cour int&eacute;rieure o&ugrave; les joints d&#39;&eacute;tanch&eacute;it&eacute; devaient &ecirc;tre refaits.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:23:52', '2025-06-30', '17:23:58', NULL, 1),
(39, 0, 5, '', '<p>Pour la rentr&eacute;e scolaire 2012, tous les &eacute;l&egrave;ves de 1re et de 2e secondaire ont maintenant un iPad dans leur sac d&rsquo;&eacute;cole. Une nouvelle fa&ccedil;on d&rsquo;apprendre et d&rsquo;enseigner.</p>\r\n\r\n<p>Le 4 septembre, ouverture officielle de la Petite &Eacute;cole Montessori de La Pocati&egrave;re dans nos murs.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:24:03', '2025-06-30', '17:24:08', NULL, 1),
(40, 0, 4, '', '<p>Septembre 2013, d&eacute;but de nos Programmes Sports sous la formule des &laquo; Sports-&eacute;tude &raquo;.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:24:13', '2025-06-30', '17:24:19', NULL, 1),
(41, 0, 3, '', '<p>Selon le Palmar&egrave;s des &eacute;coles secondaires diffus&eacute; par l&#39;Institut Fraser &agrave; Vancouver, le CSA occupe la premi&egrave;re place au Qu&eacute;bec pour les r&eacute;sultats de nos &eacute;l&egrave;ves aux examens du Minist&egrave;re, et ce, parmi toutes les &eacute;coles secondaires ne faisant pas de s&eacute;lection d&#39;&eacute;l&egrave;ves. Depuis lors, il continue &agrave; occuper la premi&egrave;re place.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:24:24', '2025-06-30', '17:24:31', NULL, 1),
(42, 0, 2, '', '<p>Ouverture de l&#39;&Eacute;cole d&#39;immersion fran&ccedil;aise.</p>\r\n\r\n<p>Ouverture de la r&eacute;sidence scolaire r&eacute;nov&eacute;e et accueil des premiers &eacute;l&egrave;ves internationaux en formule sept jours sur sept, inscrits aux &eacute;tudes secondaires r&eacute;guli&egrave;res ou en francisation.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:24:40', '2025-06-30', '17:25:01', NULL, 1),
(43, 0, 1, '', '<p>Il y a maintenant 190 ans, les tout premiers &eacute;l&egrave;ves de l&#39;histoire du Coll&egrave;ge faisaient leur entr&eacute;e dans ce qui allait devenir une immense institution...</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-06-30', '17:25:02', '2025-06-30', '17:25:08', NULL, 1);
INSERT INTO `history_f` (`id`, `originId`, `category`, `ranking`, `name`, `image`, `field1`, `field2`, `field3`, `field4`, `field5`, `field6`, `field7`, `field8`, `field9`, `field10`, `field11`, `field12`, `field13`, `field14`, `field15`) VALUES
(1, 0, NULL, NULL, '\"rank\":1, \r\n\"type\":4, \r\n\"width\":900, \r\n\"name\":\"Année\"', '\"rank\":5, \r\n\"type\":14,\r\n\"name\":\"Image 1\",\r\n\"folder\":\"histoire\"', '\"rank\":4, \r\n\"type\":10, \r\n\"width\":900, \r\n\"name\":\"Description\"', '\"rank\":6, \r\n\"type\":14,\r\n\"name\":\"Image 2\",\r\n\"folder\":\"histoire\"', '\"rank\":7, \r\n\"type\":14,\r\n\"name\":\"Image 3\",\r\n\"folder\":\"histoire\"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `history_ml` (`id`, `originId`, `langCode`, `name`, `field1`, `field2`, `field3`, `field4`, `field6`, `field7`, `field8`, `field9`, `field10`, `field11`, `field12`, `urlRewrite`, `title`, `descriptionMeta`, `h1`) VALUES
(1, 1, 'fr', '1827', '<p>D&egrave;s le mois de juin 1827, les travaux commencent. Avec ses paroissiens, l&#39;abb&eacute; Painchaud va couper le bois dans la for&ecirc;t et extraire la pierre dans les champs. Les paroissiens de Sainte-Anne-de-la-Pocati&egrave;re se distingu&egrave;rent en donnant argent, mat&eacute;riaux, journ&eacute;es de travail, voyages pour transporter le bois, la chaux, la pierre. La construction durera deux ans.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 2, 'fr', '1859', '<p>L&#39;abb&eacute; Fran&ccedil;ois Pilote, alors directeur du CSA, fonde l&#39;&Eacute;cole d&#39;Agriculture, devenue aujourd&#39;hui l&#39;Institut de technologie agroalimentaire de La Pocati&egrave;re.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 3, 'fr', '1890', '<p>L&rsquo;Association des anciens &eacute;l&egrave;ves du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re voit le jour le 23 juin 1890.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 4, 'fr', '1894', '<p>Le 14 novembre 1894, l&rsquo;eau arrive au CSA, une v&eacute;ritable r&eacute;volution.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 5, 'fr', '1910', '<p>Composition du chant d&rsquo;adieu &laquo; Fils de Ste-Anne &raquo; qui est toujours chant&eacute; aujourd&rsquo;hui lors du d&eacute;part de nos finissants et finissantes.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 6, 'fr', '1915', '<p>Le 20 novembre 1915, l&#39;ampoule &eacute;lectrique fait son entr&eacute;e au CSA. La vie ne serait plus jamais la m&ecirc;me.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 7, 'fr', '1918', '<p>Comme si les cons&eacute;quences de la Premi&egrave;re Guerre mondiale ne suffisaient pas, la grippe espagnole fait treize d&eacute;c&egrave;s parmi nos &eacute;l&egrave;ves.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 8, 'fr', '1920', '<p>Incendie du CSA le 15 d&eacute;cembre 1920. Le feu est le ma&icirc;tre! On donne l&#39;alarme g&eacute;n&eacute;rale et les paroissiens accourent pour travailler au sauvetage. Malheureusement, le vent va rendre inutile toute tentative d&#39;extinction. Le feu prend maintenant les proportions d&#39;une immense conflagration et il ne reste plus qu&#39;&agrave; sauver du d&eacute;sastre le plus d&#39;objets possible. Les paroissiens, les &eacute;l&egrave;ves, les pr&ecirc;tres arrachent &agrave; l&#39;incendie une partie du mobilier, et ne reculent que pas &agrave; pas devant l&#39;&eacute;l&eacute;ment destructeur. Mais le feu fait rage, il attaque, l&#39;une apr&egrave;s l&#39;autre, les diff&eacute;rentes ailes du CSA presque centenaire.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 9, 'fr', '1921', '<p>Le CSA ne devait pas tarder &agrave; sortir graduellement de ses cendres. En effet, le 25 f&eacute;vrier 1921, la Corporation du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re adopte les plans propos&eacute;s par son architecte. Le coll&egrave;ge nouveau s&#39;&eacute;l&egrave;vera sur les ruines de l&#39;ancien. Le 23 mai 1921, commencent les fondations de la fa&ccedil;ade et le 29 mai 1923, on y c&eacute;l&egrave;bre le couronnement des travaux de reconstruction qui ont dur&eacute; deux ans.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(10, 10, 'fr', '1933', '<p>Cr&eacute;ation de l&#39;&OElig;uvre St-Charles qui vient en aide financi&egrave;re &agrave; nos familles d&#39;&eacute;l&egrave;ves. Ce fonds de bourses d&rsquo;&eacute;tudes existe toujours aujourd&rsquo;hui mais sous le nom du fondateur du CSA : le Fonds d&rsquo;&eacute;tude Charles-Fran&ccedil;ois-Painchaud, cr&eacute;&eacute; en 2002.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 11, 'fr', '1927', '<p>Le 20 juin 1927, 1 500 anciens &eacute;l&egrave;ves se donnent rendez-vous pour les F&ecirc;tes du Centenaire du CSA.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(12, 12, 'fr', '1933', '<p>Premier num&eacute;ro d&rsquo;un journal destin&eacute; aux anciens &eacute;l&egrave;ves du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re :&nbsp;<a href=\"http://leadercsa.com/?rub=9&amp;sousRub=60\" target=\"_blank\"><u><strong>L&#39;Union Amicale</strong></u></a>&nbsp;qui existe toujours et qui est distribu&eacute; trois fois par ann&eacute;e &agrave; plus de 5 000 anciens et anciennes &eacute;l&egrave;ves.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(13, 13, 'fr', '1945', '<p>En septembre 1945, l&#39;imp&eacute;ratrice Zita d&#39;Autriche est re&ccedil;ue au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re. Nous avons le privil&egrave;ge d&#39;avoir en nos murs un magnifique piano lui ayant appartenu.</p>\r\n', '/assets/images/histoire/historique-1945-2.jpg', '/assets/images/histoire/historique-1945-3.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(14, 14, 'fr', '1829', '<p>Tout est pr&ecirc;t pour l&#39;ouverture des classes, mais il faudra attendre au 1er octobre pour commencer l&#39;enseignement parce que seulement 8 &eacute;l&egrave;ves se sont pr&eacute;sent&eacute;s le jour de la rentr&eacute;e, les futurs &eacute;tudiants &eacute;tant occup&eacute;s aux r&eacute;coltes. On compte alors 20 pensionnaires et quelques externes. &Agrave; la fin de l&#39;ann&eacute;e, on comptait 47 &eacute;l&egrave;ves.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(15, 15, 'fr', '1838', '<p>D&eacute;c&egrave;s du fondateur du CSA, Charles-Fran&ccedil;ois Painchaud, le 9 f&eacute;vrier 1838.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(16, 16, 'fr', '1870', '<p>Cr&eacute;ation du concours oratoire Painchaud, le plus vieux concours existant encore aujourd&rsquo;hui chez nous. Il portait &agrave; l&rsquo;&eacute;poque le nom de Soci&eacute;t&eacute; Painchaud qui se voulait une soci&eacute;t&eacute; d&rsquo;&eacute;loquence.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(18, 18, 'fr', '1885', '<p>Port du suisse &laquo; capot d&rsquo;&eacute;colier &raquo; obligatoire, l&rsquo;uniforme du temps. Il dispara&icirc;tra &agrave; tout jamais en 1955.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(20, 20, 'fr', '1914-1918', '<p>1re guerre mondiale. Cent soixante-deux (162) &eacute;l&egrave;ves du CSA, anciens ou actuels, ont pris part &agrave; cette grande guerre : un dans l&#39;arm&eacute;e anglaise, cent cinquante et un dans l&#39;arm&eacute;e canadienne et dix dans l&#39;arm&eacute;e am&eacute;ricaine. Le CSA y d&eacute;l&eacute;gua quatre aum&ocirc;niers, neuf m&eacute;decins, un colonel, six capitaines, douze lieutenants, trois sergents et cent vingt-sept soldats. Parmi eux, il y eut 15 morts en service actif.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(21, 21, 'fr', '1956', '<p>R&eacute;novation de la Chapelle du CSA, un joyau dans un &eacute;crin de pierres.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(22, 22, 'fr', '1964', '<p>En septembre 1964, les filles font discr&egrave;tement leur entr&eacute;e au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re en Belles-Lettres sp&eacute;ciales ! Une autre r&eacute;volution.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(23, 23, 'fr', '1967', '<p>Les Petites S&oelig;urs de la Sainte-Famille quittent le CSA. Pendant 62 ans, soit de 1905 &agrave; 1967, elles ont &eacute;t&eacute; quatre cent cinquante-deux (452) &agrave; se relayer au service des pr&ecirc;tres et de nos &eacute;l&egrave;ves.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(24, 24, 'fr', '1970', '<p>Cr&eacute;ation de la Fondation Bouchard qui soutient remarquablement notre &eacute;cole dans son d&eacute;veloppement p&eacute;dagogique depuis plus de 40 ans.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(25, 25, 'fr', '1974', '<p>Ouverture du Mus&eacute;e Fran&ccedil;ois-Pilote, maintenant Mus&eacute;e Qu&eacute;b&eacute;cois de l&#39;agriculture et de l&#39;alimentation, situ&eacute; &agrave; l&rsquo;arri&egrave;re du CSA. Un mus&eacute;e qui met en vedette l&rsquo;agriculture.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(26, 26, 'fr', '1977', '<p>D&eacute;but de la construction de notre gymnase actuel.<br />\r\nCette m&ecirc;me ann&eacute;e, on c&eacute;l&egrave;bre le 150e anniversaire du CSA.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(27, 27, 'fr', '1985', '<p>Cr&eacute;ation du groupe humanitaire Paramundo.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(28, 28, 'fr', '1991', '<p>Ouverture du Centre d&rsquo;archives de la C&ocirc;te-Sud et du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(29, 29, 'fr', '1994', '<p>Le 16 septembre 1994, le C&eacute;gep de La Pocati&egrave;re fait l&rsquo;acquisition des locaux du CSA qu&rsquo;il occupe d&eacute;j&agrave;, mais dont il &eacute;tait locataire.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(30, 30, 'fr', '1995', '<p>Le 14 juin 1995, arriv&eacute;e du r&eacute;seau Internet au CSA gr&acirc;ce &agrave; la collaboration de la Fondation Bouchard.</p>\r\n\r\n<p>Ouverture de l&#39;&Eacute;cole de Musique du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re devenue aujourd&rsquo;hui l&rsquo;&Eacute;cole Destroismaisons qui a toujours son si&egrave;ge social chez nous.</p>\r\n\r\n<p>Cr&eacute;ation de Secondaire en Spectacle par le CSA qui est devenu aujourd&rsquo;hui un rendez-vous provincial sous la responsabilit&eacute; des U.R.L.S. (Unit&eacute;s R&eacute;gionales de Loisirs et de Sports).</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(31, 31, 'fr', '2000', '<p>Le football, sport fort populaire au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re dans les ann&eacute;es 60-70, revient en force avec la mise sur pied d&#39;une &eacute;quipe cadette : les Wisigoths. En 2001, une &eacute;quipe juv&eacute;nile s&#39;ajoute &agrave; la premi&egrave;re. Cette derni&egrave;re remporta le Bol d&rsquo;Or &agrave; l&rsquo;automne 2006.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(32, 32, 'fr', '2001', '<p>Premiers stagiaires du Campus Saint-Jean de l&rsquo;Universit&eacute; de l&rsquo;Alberta en s&eacute;jour d&rsquo;immersion fran&ccedil;aise, chez nous, durant les mois de juillet et ao&ucirc;t. Depuis, chaque &eacute;t&eacute;, nous accueillons ces stagiaires du programme Explore.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(33, 33, 'fr', '2004', '<p>Avec la rentr&eacute;e scolaire 2004, une autre page d&#39;histoire s&#39;&eacute;crit puisque l&#39;uniforme est maintenant de mise.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(34, 34, 'fr', '2005', '<p>L&#39;enseignement du latin devient chose du pass&eacute; en juin 2005 c&eacute;dant sa place &agrave; l&rsquo;espagnol.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(35, 35, 'fr', '2006', '<p>En juin 2006, l&#39;abb&eacute; Alfred B&eacute;rub&eacute; quitte l&#39;enseignement apr&egrave;s 39 ann&eacute;es. Avec son d&eacute;part, une autre page d&#39;histoire se tourne puisqu&#39;il &eacute;tait le dernier pr&ecirc;tre &agrave; enseigner chez nous depuis la fondation du CSA en 1829.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(36, 36, 'fr', '2008', '<p>Conf&eacute;rence de presse le 3 juin 2008 : lancement de notre projet de g&eacute;othermie.</p>\r\n\r\n<p>Le 28 octobre 2008, le CSA fait la page couverture de la revue l&rsquo;Actualit&eacute; s&rsquo;&eacute;tant class&eacute;e 1re &eacute;cole priv&eacute;e au Qu&eacute;bec (et 3e au niveau provincial, &eacute;coles priv&eacute;es et publiques confondues) pour l&rsquo;impact sur la r&eacute;ussite des &eacute;l&egrave;ves.</p>\r\n', '/assets/images/histoire/historique-2008-2.jpg', '/assets/images/histoire/historique-2008-3.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(37, 37, 'fr', '2010', '<p>Le 28 septembre 2010, le CSA remporte un premier prix provincial au concours Excellence Mieux Consommer 2010 parrain&eacute; par Hydro-Qu&eacute;bec pour l&#39;implantation de la g&eacute;othermie.</p>\r\n\r\n<p>Le 1er octobre 2010, lancement officiel d&#39;une campagne de financement de 3 millions de dollars.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(38, 38, 'fr', '2011', '<p>Le 22 juin 2011, fermeture d&eacute;finitive de notre pensionnat. Des familles d&#39;accueil prennent la rel&egrave;ve.</p>\r\n\r\n<p>&Agrave; l&rsquo;&eacute;t&eacute; 2011, gr&acirc;ce &agrave; notre campagne de financement, des travaux majeurs sont rendus possibles. Les vestiaires des gar&ccedil;ons sont refaits au complet, de nouveaux vestiaires pour le football sont am&eacute;nag&eacute;s et nous proc&eacute;dons &agrave; des travaux importants dans la cour int&eacute;rieure o&ugrave; les joints d&#39;&eacute;tanch&eacute;it&eacute; devaient &ecirc;tre refaits.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(39, 39, 'fr', '2012', '<p>Pour la rentr&eacute;e scolaire 2012, tous les &eacute;l&egrave;ves de 1re et de 2e secondaire ont maintenant un iPad dans leur sac d&rsquo;&eacute;cole. Une nouvelle fa&ccedil;on d&rsquo;apprendre et d&rsquo;enseigner.</p>\r\n\r\n<p>Le 4 septembre, ouverture officielle de la Petite &Eacute;cole Montessori de La Pocati&egrave;re dans nos murs.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(40, 40, 'fr', '2013', '<p>Septembre 2013, d&eacute;but de nos Programmes Sports sous la formule des &laquo; Sports-&eacute;tude &raquo;.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(41, 41, 'fr', '2014', '<p>Selon le Palmar&egrave;s des &eacute;coles secondaires diffus&eacute; par l&#39;Institut Fraser &agrave; Vancouver, le CSA occupe la premi&egrave;re place au Qu&eacute;bec pour les r&eacute;sultats de nos &eacute;l&egrave;ves aux examens du Minist&egrave;re, et ce, parmi toutes les &eacute;coles secondaires ne faisant pas de s&eacute;lection d&#39;&eacute;l&egrave;ves. Depuis lors, il continue &agrave; occuper la premi&egrave;re place.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(42, 42, 'fr', '2015', '<p>Ouverture de l&#39;&Eacute;cole d&#39;immersion fran&ccedil;aise.</p>\r\n\r\n<p>Ouverture de la r&eacute;sidence scolaire r&eacute;nov&eacute;e et accueil des premiers &eacute;l&egrave;ves internationaux en formule sept jours sur sept, inscrits aux &eacute;tudes secondaires r&eacute;guli&egrave;res ou en francisation.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(43, 43, 'fr', '2019', '<p>Il y a maintenant 190 ans, les tout premiers &eacute;l&egrave;ves de l&#39;histoire du Coll&egrave;ge faisaient leur entr&eacute;e dans ce qui allait devenir une immense institution...</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
