(1, 0, 12, '2025-05-02', '/assets/images/nouvelles/nouvelles-image-exemple.jpg', '<p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Cupiditate obcaecati quasi optio aspernatur iure amet tempora ea quos similique. Esse, maxime dignissimos? Quod repellendus ab fuga minus expedita aut rerum?</p>\r\n\r\n<p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Cupiditate obcaecati quasi optio aspernatur iure amet tempora ea quos similique. Esse, maxime dignissimos? Quod repellendus ab fuga minus expedita aut rerum?</p>\r\n\r\n<p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Cupiditate obcaecati quasi optio aspernatur iure amet tempora ea quos similique. Esse, maxime dignissimos? Quod repellendus ab fuga minus expedita aut rerum?</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-27', '19:34:16', '2025-05-27', '19:44:42', NULL, 0),
