(9, 0, 5, '2025-10-31', '/assets/images/nouvelles/2025-10-31%2011_38_22.jpg', '<p>Le samedi 26 octobre 2025, la traditionnelle maison hant&eacute;e du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re a de nouveau fait frissonner des centaines de visiteurs dans le cadre de l&rsquo;Halloween &agrave; La Pocati&egrave;re, en collaboration avec la Ville de La Pocati&egrave;re.</p>\r\n\r\n<p><strong>Une f&ecirc;te foraine&hellip; abandonn&eacute;e (ou presque)</strong></p>\r\n\r\n<p>Sous la th&eacute;matique d&rsquo;une f&ecirc;te foraine d&eacute;jant&eacute;e, les courageux visiteurs ont travers&eacute; un univers peupl&eacute; de clowns fous, d&rsquo;attractions d&eacute;traqu&eacute;es et de curieux spectres qui n&rsquo;avaient visiblement jamais quitt&eacute; les lieux. Entre les rires et les cris, les lumi&egrave;res vacillantes et les couloirs tordus, cette &eacute;dition s&rsquo;est r&eacute;v&eacute;l&eacute;e plus immersive que jamais!</p>\r\n\r\n<p><strong>Un succ&egrave;s &eacute;clatant</strong></p>\r\n\r\n<p>Avec 1 416 visiteurs ayant franchi les portes de notre maison hant&eacute;e, c&rsquo;est une somme de 4 250,65 $ qui a &eacute;t&eacute; amass&eacute;e pour soutenir le Gouvernement &eacute;tudiant et le projet Paramundo, un voyage &eacute;ducatif et solidaire en &Eacute;quateur.</p>\r\n\r\n<p><strong>Une &oelig;uvre collective</strong></p>\r\n\r\n<p>Sous la direction de Mme Val&eacute;rie Dufour, grande ma&icirc;tresse d&rsquo;&oelig;uvre de cette cr&eacute;ation lugubre, &eacute;paul&eacute;e par Mme&nbsp;Kassandra Desch&ecirc;nes et Mme Vicky Dumont, v&eacute;ritable&nbsp;g&eacute;nie&nbsp;de l&rsquo;ombre, les &eacute;l&egrave;ves ont con&ccedil;u et d&eacute;cor&eacute; ce parcours cauchemardesque dans les moindres d&eacute;tails. Leur cr&eacute;ativit&eacute;, leur &eacute;nergie et leur sens du r&eacute;alisme ont permis de transformer le Coll&egrave;ge en un univers terrifiant digne des plus grands parcs d&rsquo;horreur.</p>\r\n\r\n<p>Nos jeunes ont aussi pu profiter de cette r&eacute;ussite lors de la journ&eacute;e d&rsquo;Halloween, c&eacute;l&eacute;br&eacute;e au Coll&egrave;ge dans une ambiance festive et color&eacute;e.</p>\r\n\r\n<p>Encore une fois, bravo &agrave; toute l&rsquo;&eacute;quipe pour cette &eacute;dition exceptionnelle qui fait rayonner le talent et l&rsquo;esprit d&rsquo;initiative de nos &eacute;l&egrave;ves!</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-11-01', '18:52:04', '2025-11-01', '18:56:32', NULL, 1),
(10, 0, 4, '2025-11-02', '/assets/images/nouvelles/Victoire_junevile_du_31_octobre_2025.jpg', '<p>Les Wisigoths du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re terminent une saison de football 2025 marqu&eacute;e par la progression, la r&eacute;silience et la fiert&eacute; culminant avec une victoire r&eacute;gionale pour la formation juv&eacute;nile. Tant chez les benjamins que chez les juv&eacute;niles, les jeunes athl&egrave;tes ont d&eacute;montr&eacute; un esprit d&rsquo;&eacute;quipe exemplaire et une volont&eacute; constante de se d&eacute;passer. L&rsquo;engagement et le travail constant des entra&icirc;neurs ont jou&eacute; un r&ocirc;le cl&eacute; dans la progression des deux &eacute;quipes au fil de la saison.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Les Wisigoths juv&eacute;niles : champions r&eacute;gionaux!</strong></p>\r\n\r\n<p>Les Wisigoths juv&eacute;niles D3 &agrave; 9 joueurs ont remport&eacute; la finale r&eacute;gionale du R&eacute;seau du sport &eacute;tudiant du Qu&eacute;bec de Qu&eacute;bec et de Chaudi&egrave;re-Appalaches (RSEQ-QCA) face aux Ph&eacute;nix de la Polyvalente La Pocati&egrave;re, par la marque de 8 &agrave; 1, le vendredi 31 octobre dernier.</p>\r\n\r\n<p>Ce duel, disput&eacute; dans des conditions m&eacute;t&eacute;orologiques tr&egrave;s difficiles, qui ont grandement influenc&eacute; le style de jeu des deux &eacute;quipes, a mis en lumi&egrave;re le caract&egrave;re et la discipline des joueurs du Coll&egrave;ge. La d&eacute;fensive s&rsquo;est particuli&egrave;rement illustr&eacute;e, n&rsquo;accordant qu&rsquo;un seul point durant toute la rencontre et jouant un r&ocirc;le d&eacute;terminant dans cette conqu&ecirc;te du titre. En offensive, malgr&eacute; la pluie et les rafales, les Wisigoths ont su trouver la faille au bon moment gr&acirc;ce &agrave; une passe de touch&eacute; parfaitement ex&eacute;cut&eacute;e, marquant ainsi le seul touch&eacute; de la rencontre.</p>\r\n\r\n<p style=\"text-align: right;\"><em>&laquo; C&rsquo;est la pers&eacute;v&eacute;rance qui aura &eacute;t&eacute; la qualit&eacute; principale de nos juv&eacute;niles qui ont su se relever les manches malgr&eacute; les difficult&eacute;s connues en saison r&eacute;guli&egrave;re. &raquo;<br />\r\nPierre Beaulieu, responsable des sports au Coll&egrave;ge</em></p>\r\n\r\n<p>Les Wisigoths terminent leur saison avec une fiche globale de 6 victoires et 3 d&eacute;faites, incluant les s&eacute;ries &eacute;liminatoires. Leur parcours s&rsquo;est distingu&eacute; par une d&eacute;fensive intraitable avec seulement 10 points conc&eacute;d&eacute;s en deux matchs de s&eacute;ries et une offensive opportuniste malgr&eacute; un effectif limit&eacute; &agrave; certaines positions.</p>\r\n\r\n<p>Ce championnat r&eacute;gional rev&ecirc;t une signification particuli&egrave;re pour l&rsquo;&eacute;quipe puisque plusieurs joueurs d&rsquo;impact avaient quitt&eacute; &agrave; la fin de la saison pr&eacute;c&eacute;dente, et plusieurs jeunes de 3e et 4e secondaire ont d&ucirc; s&rsquo;adapter rapidement au niveau juv&eacute;nile.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Les Wisigoths benjamins : une saison d&rsquo;apprentissage et de progression</strong></p>\r\n\r\n<p>De leur c&ocirc;t&eacute;, les Wisigoths benjamins concluent leur saison 2025 avec une fiche &eacute;quilibr&eacute;e de 3 victoires et 3 d&eacute;faites, reflet d&rsquo;une &eacute;quipe en pleine croissance. Malgr&eacute; plusieurs blessures, les 27 jeunes athl&egrave;tes de 1re et de 2e secondaire ont multipli&eacute; les efforts &agrave; l&rsquo;entra&icirc;nement et d&eacute;montr&eacute; une belle coh&eacute;sion sur le terrain.</p>\r\n\r\n<p>Le dimanche 2 novembre, les benjamins ont clos leur saison de belle fa&ccedil;on avec une victoire serr&eacute;e au C&eacute;gep de L&eacute;vis contre l&rsquo;&Eacute;cole secondaire Champagnat, Guillaume-Couture. Un touch&eacute; inscrit dans les derni&egrave;res minutes a permis de concr&eacute;tiser une fin de saison &agrave; la hauteur de leur progression.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Une m&ecirc;me fiert&eacute;, un m&ecirc;me esprit d&rsquo;&eacute;quipe</strong></p>\r\n\r\n<p>La saison 2025 confirme la vitalit&eacute; du programme de football des Wisigoths, qui continue de former des athl&egrave;tes engag&eacute;s, fiers et solidaires. Au-del&agrave; des victoires, c&rsquo;est l&rsquo;esprit d&rsquo;&eacute;quipe et la passion du sport qui demeurent les plus belles r&eacute;ussites de cette saison.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-11-06', '15:35:43', '2025-11-06', '15:59:53', NULL, 1),
(11, 0, 3, '2025-11-07', '/assets/images/nouvelles/AP6A68242.jpg', '<p data-end=\"596\" data-start=\"295\">Le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re est fier d&rsquo;annoncer que M. Fr&eacute;d&eacute;ric Ouellet, directeur des services p&eacute;dagogiques au Coll&egrave;ge, a re&ccedil;u le prestigieux&nbsp;Prix Claude Janvier lors du Congr&egrave;s 2025 du&nbsp;GRMS &ndash; Groupe des responsables en math&eacute;matique au secondaire.</p>\r\n\r\n<p data-end=\"879\" data-start=\"598\">Cette distinction, la plus haute remise par le GRMS, souligne l&rsquo;apport exceptionnel d&rsquo;un enseignant ou d&rsquo;un leader en math&eacute;matique dont le dynamisme, le leadership, l&rsquo;innovation p&eacute;dagogique et la qualit&eacute; du travail exercent un rayonnement notable dans le r&eacute;seau scolaire qu&eacute;b&eacute;cois.</p>\r\n\r\n<p data-end=\"1198\" data-start=\"881\">M. Ouellet, reconnu pour sa vision &eacute;ducative, son engagement ind&eacute;fectible et son influence positive aupr&egrave;s des enseignants et des &eacute;l&egrave;ves, s&rsquo;est particuli&egrave;rement d&eacute;marqu&eacute; au fil des ann&eacute;es. Son passage &agrave; la pr&eacute;sidence du GRMS (2022-2023) t&eacute;moigne d&rsquo;ailleurs de la confiance que lui porte la communaut&eacute; professionnelle.</p>\r\n\r\n<p data-end=\"1460\" data-start=\"1200\">&laquo; Nous sommes extr&ecirc;mement fiers de voir M. Ouellet&nbsp;recevoir cet honneur pleinement m&eacute;rit&eacute;. Son travail contribue directement &agrave; l&rsquo;excellence acad&eacute;mique du Coll&egrave;ge et &agrave; l&rsquo;avancement de l&rsquo;enseignement des math&eacute;matiques au Qu&eacute;bec &raquo;, souligne la direction du Coll&egrave;ge.</p>\r\n\r\n<p data-end=\"1990\" data-start=\"1765\">Le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re offre ses plus sinc&egrave;res f&eacute;licitations &agrave; M. Ouellet pour cette reconnaissance d&rsquo;envergure et le remercie pour sa contribution remarquable au d&eacute;veloppement p&eacute;dagogique de l&rsquo;institution.</p>\r\n\r\n<p data-end=\"1990\" data-start=\"1765\"><em>Sur la photo, M. Ouellet est photographi&eacute; aux c&ocirc;t&eacute;s de M. Guy Picard , pr&eacute;sident actuel du GRMS (2024-2025), et de&nbsp;M. Guy Gervais, ancien pr&eacute;sident du GRMS (2017-2021).&nbsp;</em></p>\r\n\r\n<p data-end=\"1990\" data-start=\"1765\"><em data-end=\"1763\" data-start=\"1736\">Source de la photo&nbsp;: GRMS</em></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-12-09', '22:06:59', '2025-12-09', '22:14:22', NULL, 1),
(12, 0, 2, '2026-02-13', '/assets/images/nouvelles/Menu_Saint-Valentin_fevrier_2026.png', '<p>Le Coll&egrave;ge&nbsp;annonce le retour de sa populaire activit&eacute; de bo&icirc;tes-repas de la Saint-Valentin, une fa&ccedil;on simple et savoureuse de c&eacute;l&eacute;brer &agrave; la maison tout en posant un geste concret pour soutenir la campagne de financement 2023-2027.</p>\r\n\r\n<p>Propos&eacute;e au co&ucirc;t de 125 $ pour 2 personnes (souper 4 services), la bo&icirc;te-repas se r&eacute;serve en ligne&nbsp;et se r&eacute;cup&egrave;re le vendredi 13 f&eacute;vrier, entre 15 h 45 et 18 h. Pour chaque bo&icirc;te vendue, un re&ccedil;u pour don de charit&eacute; de 60 $ sera remis.</p>\r\n\r\n<p style=\"text-align: right;\"><em>&laquo; Cette initiative rassemble la grande famille du Coll&egrave;ge autour d&rsquo;un moment de plaisir&hellip; et d&rsquo;un geste qui fait une diff&eacute;rence pour nos &eacute;l&egrave;ves d&#39;aujourd&#39;hui et de demain. C&rsquo;est une Saint-Valentin qui a du c&oelig;ur! &raquo;<br />\r\nSamuel Gagnon, directeur du d&eacute;veloppement des affaires et responsable de la campagne</em></p>\r\n\r\n<p><strong>Menu 4 services aux accents gourmands</strong></p>\r\n\r\n<p>Les bo&icirc;tes-repas comprennent un souper complet, avec choix d&rsquo;entr&eacute;e :</p>\r\n\r\n<ul>\r\n	<li>Caresse du terroir : fine terrine gourmande accompagn&eacute;e de cro&ucirc;tons et de fra&icirc;che verdurette OU Flirt marin : crevettes nordiques, mangue et l&eacute;gumes color&eacute;s sur cro&ucirc;ton craquant</li>\r\n	<li>&Eacute;lixir rouge passion : potage rubis &agrave; la betterave et au sirop d&rsquo;&eacute;rable, servi avec demi-baguette dor&eacute;e</li>\r\n	<li>Baiser brais&eacute; : joue de porc fondante au duo bi&egrave;re ambr&eacute;e et &eacute;rable, pur&eacute;e de pois et gratin dauphinois</li>\r\n	<li>Velours interdit : Red Velvet infus&eacute; au bourbon et cr&egrave;me au fromage soyeuse</li>\r\n</ul>\r\n\r\n<p><strong>Dates importantes</strong></p>\r\n\r\n<p>Date limite de r&eacute;servation : 5 f&eacute;vrier 2026</p>\r\n\r\n<p>R&eacute;cup&eacute;ration : vendredi 13 f&eacute;vrier, 15 h 45 &agrave; 18 h</p>\r\n\r\n<p>Lieu : Hall d&#39;entr&eacute;e du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2026-01-13', '17:30:09', '2026-01-13', '20:05:40', NULL, 1),
(13, 0, 1, '2026-01-21', '/assets/images/nouvelles/Don_Desjardins.jpg', '<p data-end=\"227\" data-start=\"53\">Le Coll&egrave;ge tient &agrave; remercier chaleureusement <strong data-end=\"147\" data-start=\"98\">Desjardins &ndash; Caisse de l&rsquo;Anse de La Pocati&egrave;re</strong> pour son soutien pr&eacute;cieux envers la r&eacute;ussite et l&rsquo;&eacute;panouissement de nos &eacute;l&egrave;ves.</p>\r\n\r\n<p data-end=\"600\" data-start=\"229\">Gr&acirc;ce &agrave; l&rsquo;appui de la Caisse, nous avons pu <strong data-end=\"296\" data-start=\"273\">r&eacute;nover deux locaux</strong> afin de cr&eacute;er de <strong data-end=\"346\" data-start=\"314\">nouveaux ateliers de couture</strong> et d&rsquo;<strong data-end=\"380\" data-start=\"352\">arts multidisciplinaires</strong>. Ce soutien a &eacute;galement permis l&rsquo;achat de mat&eacute;riel pour la <strong data-end=\"467\" data-start=\"440\">concentration robotique</strong>, ainsi que pour les activit&eacute;s de <strong data-end=\"520\" data-start=\"501\">G&eacute;nies en herbe</strong>, de <strong data-end=\"536\" data-start=\"525\">couture</strong>, d&rsquo;<strong data-end=\"568\" data-start=\"540\">arts multidisciplinaires</strong> et de <strong data-end=\"599\" data-start=\"575\">pyrogravure sur bois</strong>.</p>\r\n\r\n<p data-end=\"801\" data-start=\"602\">Depuis septembre, de nombreux &eacute;l&egrave;ves ont d&eacute;j&agrave; pu profiter de ces am&eacute;liorations : ils d&eacute;couvrent de nouvelles passions, d&eacute;veloppent leurs talents et vivent des exp&eacute;riences enrichissantes au quotidien.</p>\r\n\r\n<p data-end=\"1161\" data-is-last-node=\"\" data-is-only-node=\"\" data-start=\"1028\">Merci &agrave; Desjardins de croire en nos jeunes et d&rsquo;investir dans des projets concrets qui font une r&eacute;elle diff&eacute;rence dans leur parcours.</p>\r\n\r\n<p data-end=\"1161\" data-is-last-node=\"\" data-is-only-node=\"\" data-start=\"1028\"><em data-end=\"1026\" data-start=\"803\">Sur la photo : &Eacute;tienne Martel-Octeau, directeur g&eacute;n&eacute;ral de la Caisse, accompagn&eacute; de Charles-Thomas Caron, premier ministre du Gouvernement &eacute;tudiant, ainsi que d&rsquo;&eacute;l&egrave;ves ayant profit&eacute; des am&eacute;liorations permises par la Caisse.</em></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2026-01-21', '18:07:11', '2026-01-21', '23:05:03', NULL, 1);
