(4, 4, 'fr', 'Neuf député·es troquent la Chambre des communes pour le Collège!', '<p>Neuf d&eacute;put&eacute;&middot;es f&eacute;d&eacute;raux&middot;ales ont choisi le Coll&egrave;ge pour perfectionner leur fran&ccedil;ais dans le cadre d&rsquo;une formation intensive. Une belle reconnaissance du savoir-faire de notre &Eacute;cole d&rsquo;immersion fran&ccedil;aise, qui accueille chaque ann&eacute;e des centaines d&rsquo;apprenant&middot;es venu&middot;es d&rsquo;ici et d&rsquo;ailleurs pour vivre une exp&eacute;rience unique.</p>\r\n\r\n<p>Voil&agrave; encore un exemple du r&ocirc;le que joue le Coll&egrave;ge dans la promotion du fran&ccedil;ais et de la francophonie &agrave; travers le pays!</p>\r\n\r\n<p>Lisez l&rsquo;article complet : <a href=\"https://linktr.ee/csalapoc\">https://linktr.ee/csalapoc</a></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 5, 'fr', 'Les inscriptions aux Retrouvailles Wisigoths sont lancées!', '<p>Le moment est enfin arriv&eacute; : rassemblez vos ancien&middot;nes co&eacute;quipier&middot;&egrave;res, vos ami&middot;es et vos couleurs Wisigoths&hellip; C&rsquo;est le temps de s&rsquo;inscrire &agrave; LA grande f&ecirc;te de nos retrouvailles sportives!&nbsp;</p>\r\n\r\n<p>Samedi 4 octobre 2025</p>\r\n\r\n<p style=\"margin-left: 40px;\">Cat&eacute;gories de flag football masculin :</p>\r\n\r\n<p style=\"margin-left: 80px;\">Finissants 2000 &agrave; 2012 / Finissants 2012 &agrave; 2024</p>\r\n\r\n<p style=\"margin-left: 40px;\">Cat&eacute;gories de volleyball :</p>\r\n\r\n<p style=\"margin-left: 80px;\">Comp&eacute;tition (maximum de 2 joueurs masculins par &eacute;quipe) / Participation (f&eacute;minin)</p>\r\n\r\n<p style=\"margin-left: 40px;\">Souper poulet BBQ : 25 $ par personne</p>\r\n\r\n<p style=\"margin-left: 40px;\">C&eacute;r&eacute;monie hommage aux artisans du retour du football</p>\r\n\r\n<p style=\"margin-left: 40px;\">Grande soir&eacute;e retrouvailles avec service de bar sur place</p>\r\n\r\n<p style=\"margin-left: 40px;\">Chandail &agrave; 20 $ pour garder un souvenir de ce moment historique</p>\r\n\r\n<p>Les places sont limit&eacute;es&hellip; inscrivez-vous d&egrave;s maintenant et faites partie de la f&ecirc;te!</p>\r\n\r\n<p>Pour s&#39;inscrire : <a attributionsrc=\"/privacy_sandbox/comet/register/source/?xt=AZWLXSGRJ0ptboOSdQbEBaFUXHKR5Yg5zCxIIilozl1Evy7u2Wy5EYrudhuxaUBrJmBuhVaWzzie-yGEXojWW73pYaCBaI8oOuuqZ5jdbfSsGgcrAWRCxmvLAdd0SZYQmaujZP2gDlERca8B7vEMZztGQEYrDWrVjdkT65E8UJuneEXnMtC_gN6QzQmeJtZTbfhdWRM3T_rRfCW8ualmDau75wuax-d6YYz92mIpWhU8QD0kLULlzXZiQ2ewpy7zvg4UInlu5z3a65Ys7YVfbqFLdltkuf9KAmtakoWXxsatl05GpRPaWxfQBdCOMJ3Ootq6T85-nw1xWhx7k1zYWuuIdbNo2vJp760G9GZ-5SSk1KmGbtpqpFe8n0nevm1XrT1mzTV_220eJ0FVtDJAZ-ADxealTLCtYnoCsagW2oHUZ-1iqZMKWc6vh92450CD_gR056AtYqLCbOAdddm0LLGQwLDt4Y7OcNCwhNla8vTZvvw3tma9zzxSCKOBiOhaRp5V-e2xvg4P3oXDvU-EM3ETcCag23UxkIOWa1_cMFVUSI6yIl