(6, 6, 'fr', 'Une nouvelle ère pour le Collège et son École d’immersion française', '<p>Cet &eacute;t&eacute;, le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re a franchi une &eacute;tape d&eacute;terminante dans le d&eacute;veloppement de son &Eacute;cole d&rsquo;immersion fran&ccedil;aise. En plus d&rsquo;assurer d&eacute;sormais de fa&ccedil;on autonome la gestion de ses sessions du programme Explore, il a sign&eacute; un tout nouveau partenariat avec le minist&egrave;re de l&rsquo;&Eacute;ducation de Terre-Neuve-et-Labrador dans le cadre du programme Voyage.</p>\r\n\r\n<p>Depuis 2001, le Coll&egrave;ge accueillait des &eacute;tudiants au nom du Campus Saint-Jean de l&rsquo;Universit&eacute; de l&rsquo;Alberta. D&eacute;sormais, il op&egrave;re de fa&ccedil;on enti&egrave;rement autonome et travaille directement avec le minist&egrave;re de l&rsquo;Enseignement sup&eacute;rieur du Qu&eacute;bec pour offrir les programmes Explore. Cette transition marque un tournant strat&eacute;gique, confirmant l&#39;engagement de l&rsquo;institution &agrave; offrir des programmes d&#39;immersion en fran&ccedil;ais de haute qualit&eacute;. Cet &eacute;t&eacute;, 323 jeunes &acirc;g&eacute;s entre 13 et 17 ans ont particip&eacute; &agrave; ses s&eacute;jours Explore de trois et cinq semaines, confirmant ainsi sa r&eacute;putation comme destination de choix pour l&#39;apprentissage du fran&ccedil;ais langue seconde en immersion.</p>\r\n\r\n<p>Le Coll&egrave;ge a aussi franchi une nouvelle &eacute;tape dans son rayonnement pancanadien avec un nouveau partenariat conclu avec le minist&egrave;re de l&#39;&Eacute;ducation de Terre-Neuve-et-Labrador. Celui-ci a permis &agrave; 27 jeunes de neuvi&egrave;me ann&eacute;e, &eacute;quivalent &agrave; la troisi&egrave;me secondaire, de venir apprendre le fran&ccedil;ais &agrave; La Pocati&egrave;re pendant trois semaines dans le cadre du programme Voyage.</p>\r\n\r\n<p style=\"text-align: right;\"><em>&laquo; Ce changement vient s&eacute;curiser la tenue du programme Explore &agrave; La Pocati&egrave;re pour les ann&eacute;es &agrave; venir. Alors que l&rsquo;Universit&eacute; pouvait, chaque ann&eacute;e, d&eacute;cider de mettre fin &agrave; son partenariat, nous avons maintenant les pleins pouvoirs pour assurer la continuit&eacute; de nos activit&eacute;s. Cet &eacute;t&eacute; encore, avec l&rsquo;ajout du programme Voyage, nous avons accueilli un nombre record de participants. Notre seule limite, d&eacute;sormais, c&rsquo;est le nombre de lits disponibles! &raquo;</em></p>\r\n\r\n<p style=\"text-align: right;\">St&eacute;phane Lemelin, directeur g&eacute;n&eacute;ral du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re</p>\r\n\r\n<p>Chaque ann&eacute;e, l&rsquo;appui de la communaut&eacute; locale demeure un pilier du succ&egrave;s du programme. L&#39;accueil exceptionnel r&eacute;serv&eacute; aux &eacute;l&egrave;ves et aux &eacute;ducateurs contribue &agrave; une exp&eacute;rience immersive authentique et enrichissante. La communaut&eacute; b&eacute;n&eacute;ficie aussi de plusieurs centaines de milliers de dollars qui sont inject&eacute;s dans l&#39;&eacute;conomie locale, soutenant les commerces et les services de la r&eacute;gion. Par ailleurs, ces programmes estivaux permettent la cr&eacute;ation ou le maintien de plus de 50 emplois pendant la saison chaude.</p>\r\n\r\n<p>Ces deux avanc&eacute;es marquent un moment charni&egrave;re pour le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re, qui consolide son r&ocirc;le de leader en immersion fran&ccedil;aise au Canada et poursuit sa mission d&rsquo;offrir des exp&eacute;riences estivales d&rsquo;apprentissage stimulantes et inclusives &agrave; des jeunes de partout au pays et d&rsquo;ailleurs dans le monde.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 7, 'fr', 'Le Collège en visite à Saint-Barthélemy!', '<p data-end=\"342\" data-start=\"173\">Le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re, reconnu au Qu&eacute;bec pour son excellence acad&eacute;mique et son ouverture internationale, sera bient&ocirc;t en visite &agrave; Saint-Barth&eacute;lemy.</p>\r\n\r\n<p data-end=\"605\" data-start=\"344\">Mme <strong data-end=\"365\" data-start=\"348\">&Eacute;lise Mercier</strong>, directrice du recrutement international, ainsi que M. <strong data-end=\"438\" data-start=\"421\">Samuel Gagnon</strong>, directeur du d&eacute;veloppement des affaires et directeur adjoint de l&rsquo;&Eacute;cole d&rsquo;immersion fran&ccedil;aise, rencontreront les familles int&eacute;ress&eacute;es du <strong data-end=\"602\" data-start=\"577\">9 au 12 novembre 2025</strong>.</p>\r\n\r\n<p data-end=\"777\" data-start=\"607\"><strong data-end=\"637\" data-start=\"610\">Rencontre d&rsquo;information</strong> : le <strong data-end=\"665\" data-start=\"643\">10 novembre &agrave; 19 h</strong> &agrave; la <strong data-end=\"702\" data-start=\"671\">Capitainerie de Saint-Barth</strong>.<br data-end=\"706\" data-start=\"703\" />\r\n<strong data-end=\"731\" data-start=\"709\">Rencontres priv&eacute;es</strong> : du <strong data-end=\"757\" data-start=\"737\">9 au 12 novembre</strong>, sur rendez-vous.</p>\r\n\r\n<p data-end=\"948\" data-start=\"779\">Les familles peuvent r&eacute;server leur rencontre individuelle facilement via <strong data-end=\"882\" data-start=\"852\">WhatsApp au 1 581-994-5468</strong>.</p>\r\n\r\n<p data-end=\"1002\" data-start=\"950\">Le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re, c&rsquo;est :</p>\r\n\r\n<ul data-end=\"1199\" data-start=\"1003\" style=\"margin-left: 40px;\">\r\n	<li data-end=\"1045\" data-start=\"1003\">\r\n	<p data-end=\"1045\" data-start=\"1005\">Une <strong data-end=\"1043\" data-start=\"1009\">&eacute;cole internationale 5 &eacute;toiles</strong></p>\r\n	</li>\r\n	<li data-end=\"1045\" data-start=\"1003\">\r\n	<p data-end=\"1045\" data-start=\"1005\">Une <strong data-end=\"1087\" data-start=\"1052\">r&eacute;sidence scolaire ouverte 24/7</strong></p>\r\n	</li>\r\n	<li data-end=\"1137\" data-start=\"1090\">\r\n	<p data-end=\"1137\" data-start=\"1092\">Des <strong data-end=\"1135\" data-start=\"1096\">programmes &eacute;ducatifs de haut niveau</strong></p>\r\n	</li>\r\n	<li data-end=\"1199\" data-start=\"1138\">\r\n	<p data-end=\"1199\" data-start=\"1140\">Des <strong data-end=\"1197\" data-start=\"1144\">activit&eacute;s culturelles et sportives enrichissantes</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p data-end=\"1362\" data-start=\"1201\">Offrez &agrave; votre enfant une &eacute;ducation de qualit&eacute; dans un environnement stimulant et international.<br data-end=\"1303\" data-start=\"1300\" />\r\n<strong data-end=\"1360\" data-start=\"1303\">Choisissez le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re!</strong></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 8, 'fr', 'Pour votre party des Fêtes, c\'est Noël sous le Dôme!', '<p>Offrez &agrave; votre &eacute;quipe de travail, &agrave; vos amis ou &agrave; votre famille une exp&eacute;rience festive unique tout en soutenant une grande cause! Soyez des n&ocirc;tres le samedi 13 d&eacute;cembre pour No&euml;l sous le D&ocirc;me!, notre tout premier &eacute;v&eacute;nement festif de No&euml;l au profit de notre campagne majeure de financement 2023-2027.&nbsp;</p>\r\n\r\n<p>Que vous soyez 5, 25 ou 150, venez f&ecirc;ter avec nous! Le principe est simple : tous les groupes qui ont fait l&rsquo;achat d&rsquo;une ou de plusieurs tables (OU places individuelles) se retrouvent le m&ecirc;me soir, dans la m&ecirc;me salle, pour partager une exp&eacute;rience inoubliable. Une ambiance chic et conviviale, parfaite pour votre party des F&ecirc;tes!</p>\r\n\r\n<p>Nous nous occupons de <strong>TOUT </strong>pour vous offrir une soir&eacute;e <strong>cl&eacute; en main</strong>, sans tracas&hellip;</p>\r\n\r\n<p>Au programme :</p>\r\n\r\n<ul style=\"margin-left: 40px;\">\r\n	<li>Cocktail et bouch&eacute;es d&egrave;s 17 h 30 (en option)</li>\r\n	<li>Repas festif 4 services &agrave; 18 h 30</li>\r\n	<li>Bar sur place</li>\r\n	<li>Animation et surprises</li>\r\n	<li>Musique et soir&eacute;e dansante jusqu&rsquo;&agrave; 1 h</li>\r\n	<li>Service de raccompagnement disponible (en &eacute;change d&rsquo;un don)</li>\r\n</ul>\r\n\r\n<p>En r&eacute;servant vos places, vous contribuez directement &agrave; la campagne majeure de financement 2023-2027 du Coll&egrave;ge, qui vise &agrave; soutenir la pers&eacute;v&eacute;rance scolaire, pr&eacute;server notre patrimoine architectural et enrichir l&rsquo;exp&eacute;rience &eacute;ducative de nos jeunes.&nbsp;</p>\r\n\r\n<p>R&eacute;servez vos places d&egrave;s maintenant (places limit&eacute;es!) :&nbsp;<a attributionsrc=\"/privacy_sandbox/comet/register/source/?xt=AZUIFem28arv1gls1yxIrH5rOI68JrR8j293Xl2yJTKYbrm6VTdK0g4pfajceuU-xulmJieet8kGlW8SuI