(47, 41, 0, 2, 0, NULL, 0, NULL, 0, 0, '<p>Le <strong>DELF </strong>(Dipl&ocirc;me d&rsquo;&eacute;tudes en langue fran&ccedil;aise) et le <strong>DALF </strong>(Dipl&ocirc;me approfondi de langue fran&ccedil;aise) sont des dipl&ocirc;mes officiels qui certifient les comp&eacute;tences en fran&ccedil;ais langue seconde, du niveau d&eacute;butant (A1) au niveau expert (C2). Ils sont con&ccedil;us et d&eacute;livr&eacute;s par France &Eacute;ducation international, op&eacute;rateur du minist&egrave;re fran&ccedil;ais de l&rsquo;&Eacute;ducation nationale, et reconnus internationalement par divers organismes dont Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) et le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI).</p>\r\n', '/assets/images/DELF_DALF.png', '<p><span style=\"font-size:24px;\"><span style=\"line-height:24px;\"><u><strong>DELF / DALF</strong></u></span></span></p>\r\n\r\n<p>Chaque &eacute;l&egrave;ve international inscrit &agrave; l&#39;&Eacute;cole d&rsquo;immersion fran&ccedil;aise du Coll&egrave;ge a l&rsquo;occasion de passer le test DELF Junior/Scolaire en fin d&#39;ann&eacute;e scolaire. Fait int&eacute;ressant : ce dipl&ocirc;me est bon &agrave; vie!</p>\r\n\r\n<p>Dates des prochaines sessions : <i>&Agrave; venir</i></p>\r\n\r\n<p>Tarifs&nbsp;: <em>&Agrave; venir</em></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le&nbsp;<a href=\"https://www.france-education-international.fr/diplome/delf-tout-public?langue=fr\" target=\"_blank\">DELF Tout public</a></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le&nbsp;<a href=\"https://www.france-education-international.fr/diplome/delf-junior-scolaire?langue=fr\" target=\"_blank\">DELF Junior/Scolaire</a></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le&nbsp;<a href=\"https://www.france-education-international.fr/diplome/delf-prim?langue=fr\" target=\"_blank\">DELF Prim</a></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le&nbsp;<a href=\"https://www.france-education-international.fr/diplome/dalf?langue=fr\" target=\"_blank\">DALF</a></p>\r\n\r\n<p>Contactez madame &Eacute;lise Mercier afin de vous inscrire!&nbsp;</p>\r\n\r\n<p><strong>Contact</strong><br />\r\n&Eacute;lise Mercier<br />\r\nAgente de d&eacute;veloppement<br />\r\nelisemercier@leadercsa.com<br />\r\n418 856-3012 poste 340</p>\r\n\r\n<p><span style=\"line-height:12px;\"><span style=\"font-size:14px;\"><em>Veuillez noter que nous ne pouvons pas r&eacute;pondre aux questions li&eacute;es aux d&eacute;marches d&rsquo;immigration. Pour toute information &agrave; ce sujet, il faut communiquer directement avec Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) ou avec le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI) du Qu&eacute;bec.</em></span></span></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL);
INSERT INTO `sections` (`id`, `parent`, `defaultSubsection`, `ranking`, `nav`, `icon`, `notDisplayedInNav`, `modules`, `addSubSection`, `delSubSection`, `field1`, `field2`, `field3`, `field4`, `field5`, `field6`, `field7`, `field8`, `field9`, `field10`, `field11`, `field12`, `field13`, `field14`, `field15`, `field16`, `field17`, `field18`, `field19`, `field20`, `field21`, `field22`, `field23`, `field24`, `field25`, `field26`, `field27`, `field28`, `field29`, `field30`, `field32`, `ogimage`) VALUES
(48, 41, 0, 4, 0, NULL, 0, NULL, 0, 0, '<p>Le <strong>TCF </strong>(Test de connaissance du fran&ccedil;ais) est un examen officiel qui &eacute;value les comp&eacute;tences g&eacute;n&eacute;rales en fran&ccedil;ais, que ce soit pour des besoins d&rsquo;&eacute;tudes, d&rsquo;immigration ou de naturalisation. Il est con&ccedil;u et administr&eacute; par France &Eacute;ducation international, op&eacute;rateur du minist&egrave;re fran&ccedil;ais de l&rsquo;&Eacute;ducation nationale, et reconnu par plusieurs organismes dont Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) et le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI) du Qu&eacute;bec.</p>\r\n', '/assets/images/tcf2.png', '<p><span style=\"font-size:24px;\"><u><strong>TCF</strong></u></span></p>\r\n\r\n<p>Dates des prochaines sessions : <i>&Agrave; venir</i></p>\r\n\r\n<p>Tarifs&nbsp;: &Agrave; venir</p>\r\n\r\n<p><span style=\"display: inline !important;\">Pour vous inscrire :&nbsp;<em>Lien &agrave; venir</em></span></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le <a href=\"https://www.france-education-international.fr/test/tcf-canada?langue=fr\" target=\"_blank\">TCF Canada</a></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le <a href=\"https://www.france-education-international.fr/test/tcf-quebec?langue=fr\" target=\"_blank\">TCF Qu&eacute;bec</a></p>\r\n\r\n<p><strong>Contact</strong><br />\r\n&Eacute;lise Mercier<br />\r\nAgente de d&eacute;veloppement<br />\r\nelisemercier@leadercsa.com<br />\r\n418 856-3012 poste 340</p>\r\n\r\n<p><span style=\"line-height:12px;\"><span style=\"font-size:14px;\"><em>Veuillez noter que nous ne pouvons pas r&eacute;pondre aux questions li&eacute;es aux d&eacute;marches d&rsquo;immigration. Pour toute information &agrave; ce sujet, il faut communiquer directement avec Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) ou avec le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI) du Qu&eacute;bec.</em></span></span></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL),
(49, 41, 0, 5, 0, NULL, 0, NULL, 0, 0, '<p>Le <strong>TEF </strong>(Test d&rsquo;&eacute;valuation de fran&ccedil;ais) et le <strong>TEFAQ </strong>(Test d&rsquo;&eacute;valuation de fran&ccedil;ais adapt&eacute; pour le Qu&eacute;bec) sont des examens officiels qui mesurent les comp&eacute;tences en fran&ccedil;ais &agrave; des fins d&rsquo;immigration, d&rsquo;&eacute;tudes ou de citoyennet&eacute;. Ils sont con&ccedil;us et g&eacute;r&eacute;s par la Chambre de commerce et d&rsquo;industrie de Paris &Icirc;le-de-France (CCI Paris &Icirc;le-de-France) et reconnus par divers organismes dont Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) et le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI).</p>\r\n', '/assets/images/tef_tefaq_cci2.png', '<p><u><strong><span style=\"font-size:24px;\">TEF Canada / TEF Qu&eacute;bec (TEFAQ)</span></strong></u></p>\r\n\r\n<p>Sessions hebdomadaires pendant l&rsquo;ann&eacute;e scolaire et bimensuelles en &eacute;t&eacute; &agrave; La Pocati&egrave;re<br />\r\nSessions&nbsp;hebdomadaires &agrave; Montr&eacute;al<br />\r\nSessions hebdomadaires &agrave; Qu&eacute;bec</p>\r\n\r\n<p>D&eacute;couvrez en plus&nbsp;sur le <a href=\"https://www.lefrancaisdesaffaires.fr/candidat/test-evaluation-francais/\">TEF</a>!</p>\r\n\r\n<p><strong>Inscrivez-vous &agrave; nos prochaines sessions</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-373/produit-2\">TEF Canada &agrave; La Pocati&egrave;re</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;-&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-373/produit-4\">TEF Qu&eacute;bec (TEFAQ) &agrave; La Pocati&egrave;re</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-990/produit-2\">TEF Canada &agrave; Qu&eacute;bec</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-990/produit-4\">TEF Qu&eacute;bec (TEFAQ) &agrave; Qu&eacute;bec</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-989/produit-2\">TEF Canada &agrave; Montr&eacute;al</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-989/produit-4\">TEF Qu&eacute;bec (TEFAQ) &agrave; Montr&eacute;al</a></p>\r\n\r\n<p style=\"margin-left: 40px;\">Le jour suivant votre pr&eacute;inscription, vous recevrez un courriel afin de proc&eacute;der rapidement au paiement. C&#39;est votre paiement qui confirmera officiellement&nbsp;votre inscription.</p>\r\n\r\n<p style=\"margin-left: 40px;\">Quelques jours avant votre test, vous recevrez un dernier courriel avec toutes les informations pratiques (p. ex. heure de convocation, pi&egrave;ces d&rsquo;identit&eacute; n&eacute;cessaire et&nbsp;consignes).</p>\r\n\r\n<p><strong>Contactez les centres de passation de La Pocati&egrave;re et de Qu&eacute;bec</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &Eacute;lise Mercier<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Agente de d&eacute;veloppement<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"mailto:tef@leadercsa.com\">tef@leadercsa.com</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"tel:418 292-2001\">418 292-2001</a></p>\r\n\r\n<p><strong>Contactez le centre de passation de Montr&eacute;al</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"mailto:tef.mtl@leadercsa.com\">tef.mtl@leadercsa.com</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"tel:418 292-2001\">418 292-2001</a></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"line-height:12px;\"><em>Veuillez noter que nous ne pouvons pas r&eacute;pondre aux questions li&eacute;es aux d&eacute;marches d&rsquo;immigration. Pour toute information &agrave; ce sujet, il faut communiquer directement avec Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) ou avec le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI) du Qu&eacute;bec.</em></span></span></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL),
(50, 41, 0, 3, 0, NULL, 0, NULL, 0, 0, '<p>Le <strong>DFP </strong>(Dipl&ocirc;me de fran&ccedil;ais professionnel) est une certification officielle qui atteste des comp&eacute;tences en fran&ccedil;ais dans un contexte de travail et de communication professionnelle. Il est con&ccedil;u et d&eacute;livr&eacute; par la Chambre de commerce et d&rsquo;industrie de Paris &Icirc;le-de-France (CCI Paris &Icirc;le-de-France) et reconnu &agrave; l&rsquo;international par des entreprises, des institutions &eacute;ducatives et divers organismes professionnels.</p>\r\n', '/assets/images/dfp_cci2.png', '<p><span style=\"font-size:24px;\"><u><strong>DFP</strong></u></span></p>\r\n\r\n<p>Dates des prochaines sessions : <i>&Agrave; venir</i><br />\r\nTarifs&nbsp;: &Agrave; venir<br />\r\nPour vous inscrire :&nbsp;<em>Lien &agrave; venir</em></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le <a href=\"https://www.lefrancaisdesaffaires.fr/candidat/diplomes-francais-professionnel/\" target=\"_blank\">DFP</a></p>\r\n\r\n<p><strong>Contact</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &Eacute;lise Mercier<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Agente de d&eacute;veloppement<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"mailto:elisemercier@leadercsa.com\">elisemercier@leadercsa.com</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"tel:418 292-2001\">418 292-2001</a></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"line-height:12px;\"><em>Veuillez noter que nous ne pouvons pas r&eacute;pondre aux questions li&eacute;es aux d&eacute;marches d&rsquo;immigration. Pour toute information &agrave; ce sujet, il faut communiquer directement avec Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) ou avec le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI) du Qu&eacute;bec.</em></span></span></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL),
(51, 8888, 0, 5, 0, NULL, 0, NULL, 0, 0, '<p>Section en construction</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL),
(52, 8888, 0, 5, 0, NULL, 0, NULL, 0, 0, '<p>Ce test n&#39;est plus offert.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL),
(53, 41, 0, 1, 0, NULL, 0, NULL, 0, 0, '<p>Reconnu pour la qualit&eacute; de son enseignement et son expertise en francisation, le Coll&egrave;ge est &eacute;galement un centre officiel de passation d&rsquo;examens de fran&ccedil;ais. Nous offrons, tout au long de l&rsquo;ann&eacute;e scolaire, plusieurs tests et dipl&ocirc;mes reconnus internationalement tels que le TEF/TEFAQ, le TCF, le DELF/DALF et le DFP.</p>\r\n', '/assets/images/hero-image-direction-generale.jpg', '<p>Avec plusieurs sessions offertes chaque mois dans&nbsp;nos trois centres de passation d&#39;examens de fran&ccedil;ais, nous accueillons des centaines de candidats chaque ann&eacute;e. Ceux-ci b&eacute;n&eacute;ficient d&rsquo;un confort optimal : salles d&rsquo;examen &eacute;quip&eacute;es de mat&eacute;riel informatique de haute qualit&eacute;, salles d&rsquo;attente r&eacute;cemment am&eacute;nag&eacute;es et cadres enchanteurs favorisant la concentration et la r&eacute;ussite.</p>\r\n\r\n<p>Notre &eacute;quipe bienveillante et professionnelle assure une ambiance rassurante, en accompagnant chaque candidat avec respect et patience, afin de leur offrir une exp&eacute;rience humaine et sereine.</p>\r\n\r\n<h4><strong>TROIS CENTRES, UN SEUL NUM&Eacute;RO : <a href=\"tel:418 292-2001\">418 292-2001</a></strong></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><u>La Pocati&egrave;re</u></strong><br />\r\n100, 4e avenue Painchaud<br />\r\nLa Pocati&egrave;re (QC)&nbsp;G0R 1Z0<br />\r\n<a href=\"mailto:tef@leadercsa.com\">tef@leadercsa.com</a></p>\r\n\r\n<p style=\"margin-left: 40px;\">Id&eacute;alement situ&eacute; &agrave; 60 minutes de Qu&eacute;bec, 45 minutes de Rivi&egrave;re-du-Loup et 1 h 50 de Rimouski, le Coll&egrave;ge est facilement accessible en voiture comme en autocar (arr&ecirc;t Orl&eacute;ans Express &agrave; 2 minutes de marche).&nbsp;Notre centre, qui est LA r&eacute;f&eacute;rence dans l&#39;est de la province, allie le charme d&rsquo;un environnement calme &agrave; la qualit&eacute; d&rsquo;un encadrement personnalis&eacute;, offrant aux candidats une exp&eacute;rience &agrave; la fois humaine et professionnelle.</p>\r\n\r\n<p><strong><u>Montr&eacute;al</u></strong><br />\r\n1071, rue Saint-Urbain, bureau 117<br />\r\nMontr&eacute;al (QC) H2Z 9Y9<br />\r\n<a href=\"mailto:tef.mtl@leadercsa.com\">tef.mtl@leadercsa.com</a></p>\r\n\r\n<p style=\"margin-left: 40px;\">Situ&eacute; au c&oelig;ur du centre-ville, notre centre d&rsquo;examen de Montr&eacute;al est facilement accessible en transport en commun, &agrave; proximit&eacute; du Quartier des spectacles et du m&eacute;tro Place-des-Arts. Les candidats profitent d&rsquo;un environnement moderne et accueillant, id&eacute;al pour se pr&eacute;senter &agrave; leur &eacute;valuation en toute confiance.</p>\r\n\r\n<p><strong><u>Ville de Qu&eacute;bec</u></strong><br />\r\n1015, avenue Wilfrid-Pelletier, bureau 480<br />\r\nQu&eacute;bec (QC) G1W 0C4<br />\r\n<a href=\"mailto:???????tef@leadercsa.com\">tef@leadercsa.com</a></p>\r\n\r\n<p style=\"margin-left: 40px;\">Voisin de l&rsquo;autoroute Henri-IV, notre centre de Qu&eacute;bec se distingue par son accessibilit&eacute; et son confort. Les candidats y trouvent des installations modernes, un stationnement facile et une ambiance professionnelle qui favorise la r&eacute;ussite.</p>\r\n\r\n<p style=\"margin-left: 40px;\">&nbsp;</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL),
