INSERT INTO `sections_ml` (`id`, `originId`, `langCode`, `name`, `h1`, `field1`, `field2`, `field3`, `field4`, `field5`, `field7`, `field8`, `field9`, `field11`, `field14`, `field15`, `field17`, `field18`, `field19`, `field20`, `field21`, `field22`, `field23`, `field24`, `field25`, `field26`, `field27`, `field28`, `field29`, `field30`, `field31`, `shorturl`, `urlRewrite`, `title`, `descriptionMeta`, `canceled`) VALUES
(1, 1, 'fr', 'Accueil', 'Le Collège: 200 ans\r\nd’histoire et d’innovation', '/assets/files/videos/csa-hero-loop.mp4', 'Un collège', 'Où l’éducation est en tête des priorités', '<p>Bienvenue au Coll&egrave;ge Sainte-Anne-de-la-Pocati&egrave;re, un milieu de vie inspirant o&ugrave; l&rsquo;excellence acad&eacute;mique, la pers&eacute;v&eacute;rance scolaire et l&rsquo;&eacute;panouissement personnel se rencontrent. D&eacute;couvrez notre &eacute;cole, o&ugrave; chaque &eacute;l&egrave;ve peut atteindre son plein potentiel et se construire un avenir prometteur.</p>\r\n\r\n<p><a class=\"button\" href=\"?rub=2&amp;subRub=15\">D&eacute;couvrir le Coll&egrave;ge</a></p>\r\n', 'Des parcours', '9', '/assets/images/image-a-propos.jpg', 'Visionner la vidéo complète', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Collège Sainte-Anne-de-la-Pocatière', 'Le Collège Sainte-Anne-de-la-Pocatière est un milieu de vie inspirant où l’excellence académique, la persévérance scolaire et l’épanouissement personnel se rencontrent. Découvrez notre école, où chaque élève peut atteindre son plein potentiel et se construire un avenir prometteur.', 0),
(2, 2, 'fr', 'Le Collège', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0),
(7, 7, 'fr', 'Concentration internationale', 'Concentration\r\ninternationale', '<p>Depuis 1985, Paramundo permet aux &eacute;l&egrave;ves de 5<sup>e</sup> secondaire du Coll&egrave;ge de vivre une exp&eacute;rience unique de sensibilisation &agrave; l&#39;international. Chaque voyage, pr&eacute;par&eacute; sur plusieurs mois, est une immersion culturelle et humaine qui transforme leur regard sur le monde.</p>\r\n', '/assets/images/parcours/hero-image-concentration-internationale.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/assets/images/parcours/icones/concentration_internationale.svg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(8, 9, 'fr', 'Concentrations sportives', 'Concentrations\r\nsportives', '<p>Bouger, performer, s&rsquo;accomplir : nos concentrations sportives permettent &agrave; nos &eacute;l&egrave;ves de vivre pleinement leur passion. Encadr&eacute;s par des entra&icirc;neurs motiv&eacute;s, ils d&eacute;veloppent autant leur talent que leur confiance. Au Coll&egrave;ge, l&rsquo;esprit d&rsquo;&eacute;quipe et le d&eacute;passement de soi sont toujours au rendez-vous.</p>\r\n', '/assets/images/parcours/hero-image-concentrations-sportives.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/assets/images/parcours/icones/concentrations_sportives.svg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(9, 10, 'fr', 'Perfectionnement sports', 'Perfectionnement\r\nsports', '<p>Les Perfectionnements sports s&rsquo;adressent aux gar&ccedil;ons et aux filles de 1<sup>re</sup> et 2<sup>e</sup> secondaire qui font d&eacute;j&agrave; partie des &eacute;quipes benjamines des concentrations sportives du Coll&egrave;ge.</p>\r\n', '/assets/images/parcours/hero-image-prog-volleyball.jpg', '<p>Ils permettent principalement de favoriser le d&eacute;veloppement technique des &eacute;l&egrave;ves, en augmentant le nombre d&rsquo;heures d&rsquo;entra&icirc;nement offert lors des concentrations.</p>\r\n\r\n<p>Pour pouvoir participer aux Perfectionnements sports, l&rsquo;&eacute;l&egrave;ve-athl&egrave;te doit conserver une moyenne g&eacute;n&eacute;rale de 70 % et aucun &eacute;chec ne doit appara&icirc;tre &agrave; son dossier durant un cycle de 10 jours. Apr&egrave;s chaque cycle, la personne responsable du suivi s&rsquo;assurera que l&rsquo;&eacute;l&egrave;ve r&eacute;pond encore aux crit&egrave;res.</p>\r\n', 'Nos perfectionnements sports', '/assets/images/parcours/image-01-perfectionnement-sports.jpg', '', '', '', '', '/assets/images/parcours/icones/perfectionnement_sports.svg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(4, 4, 'fr', 'Programme Multilangue', 'Programme\r\nMultilangue', '<p>D&eacute;couvrez notre programme unique pour pr&eacute;parer les &eacute;l&egrave;ves &agrave; devenir les leaders de demain.</p>\r\n', '/assets/images/parcours/hero-image-prog-multilangue.jpg', '<p>On le sait, ma&icirc;triser plusieurs langues n&rsquo;est plus aujourd&rsquo;hui un atout : c&rsquo;est une n&eacute;cessit&eacute;. En 2016, face &agrave; cette r&eacute;alit&eacute;, le Coll&egrave;ge a mis en place un programme unique au Qu&eacute;bec. Celui-ci permet &agrave; ses &eacute;l&egrave;ves de consacrer chaque jour un minimum de 55 minutes, soit au moins 27&nbsp;% de leur temps de classe, &agrave; l&rsquo;&eacute;tude des langues &eacute;trang&egrave;res, et ce, &agrave; l&rsquo;int&eacute;rieur m&ecirc;me de leur horaire r&eacute;gulier!</p>\r\n\r\n<p>Ainsi, un &eacute;l&egrave;ve inscrit au Programme Multilangue durant ses cinq ann&eacute;es au secondaire aura grandement perfectionn&eacute; sa ma&icirc;trise de la langue anglaise, d&eacute;velopp&eacute; de solides comp&eacute;tences en espagnol et acquis des connaissances de niveau interm&eacute;diaire dans une quatri&egrave;me langue (allemand ou mandarin). Il sera de cette mani&egrave;re pleinement outill&eacute; afin d&rsquo;affronter les d&eacute;fis qui attendent les leaders de demain.</p>\r\n', 'Le programme Multilangue, c’est…', '/assets/images/parcours/image-01-prog-multilangue.jpg', '/assets/images/parcours/image-02-prog-multilangue.jpg', '/assets/images/parcours/image-03-prog-multilangue.jpg', '/assets/images/parcours/image-04-prog-multilangue.jpg', '<p>Avoir obtenu une note minimale de 75 % dans chacune de ses mati&egrave;res.</p>\r\n', '/assets/images/parcours/icones/programme_multilangue.svg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', 'Programme Multilangue du CSA', '', 0),
(5, 5, 'fr', 'Programme Volleyball', 'Programme\r\nVolleyball', '<p>Volleyball f&eacute;minin (3<sup>e</sup> &agrave; 5<sup>e</sup> secondaire)</p>\r\n', '/assets/images/parcours/hero-image-prog-volleyball.jpg', '<p>On le sait, d&eacute;velopper ses comp&eacute;tences sportives repr&eacute;sente aujourd&#39;hui bien plus qu&#39;une passion : c&#39;est aussi un moyen de d&eacute;velopper des comp&eacute;tences pour son avenir. Le Coll&egrave;ge offre un programme de volleyball f&eacute;minin unique, sp&eacute;cialement con&ccedil;u pour les &eacute;l&egrave;ves de 3<sup>e</sup> &agrave; 5<sup>e</sup> secondaire qui souhaitent atteindre un niveau de comp&eacute;tition avanc&eacute;. Ce programme s&rsquo;adresse aux jeunes sportives qui aspirent &agrave; devenir des espoirs du volleyball au niveau r&eacute;gional et provincial.</p>\r\n\r\n<p>Avec quatre entra&icirc;nements par semaine et la possibilit&eacute; de s&eacute;ances suppl&eacute;mentaires, les participantes b&eacute;n&eacute;ficient d&rsquo;un encadrement de qualit&eacute; leur permettant de perfectionner leurs habilet&eacute;s techniques et strat&eacute;giques sur le terrain. Elles auront aussi la chance de participer aux tournois du R&eacute;seau du sport &eacute;tudiant du Qu&eacute;bec (RSEQ), leur offrant ainsi des opportunit&eacute;s de se mesurer &agrave; d&rsquo;autres athl&egrave;tes et de se d&eacute;marquer dans le r&eacute;seau sportif.</p>\r\n\r\n<p>Gr&acirc;ce &agrave; cet environnement structur&eacute; et stimulant, nos &eacute;l&egrave;ves acqui&egrave;rent non seulement des comp&eacute;tences sportives, mais aussi des valeurs de discipline, de pers&eacute;v&eacute;rance et d&rsquo;esprit d&rsquo;&eacute;quipe, indispensables pour relever les d&eacute;fis de demain.</p>\r\n', 'Le programme Volleyball, c’est…', '/assets/images/parcours/volleyball_prog.jpg', '/assets/images/parcours/image-02-prog-volleyball.jpg', '/assets/images/parcours/image-03-prog-volleyball.jpg', '/assets/images/parcours/image-04-prog-volleyball.jpg', '<ul>\r\n	<li>&Ecirc;tre inscrite en 3<sup>e</sup>, 4<sup>e</sup> ou 5<sup>e</sup> secondaire</li>\r\n	<li>Obtenir des r&eacute;sultats scolaires satisfaisants</li>\r\n	<li>Participer &agrave; une s&eacute;lection qui permettra de confirmer leur potentiel et leur motivation</li>\r\n</ul>\r\n', '/assets/images/parcours/icones/programme_volleyball.svg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(6, 6, 'fr', 'Concentrations artistiques', 'Concentrations\r\nartistiques', '<p>D&eacute;couvrez les concentrations artistiques offertes par notre coll&egrave;ge, un espace permettant de d&eacute;velopper son talent au sein d&rsquo;un environnement inspirant.</p>\r\n', '/assets/images/parcours/hero-image-concentrations-artistiques.jpeg', '', NULL, NULL, NULL, NULL, NULL, NULL, '/assets/images/parcours/icones/concentrations_artistiques.svg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(3, 3, 'fr', 'Nos parcours', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0),
(11, 12, 'fr', 'Conseil d’administration', '', '<p>Les affaires de la Corporation du Coll&egrave;ge de Sainte-Anne-de-de-la-Pocati&egrave;re sont administr&eacute;es par un conseil d&rsquo;administration compos&eacute; de sept membres. Les administrateurs sont &eacute;lus lors de l&rsquo;assembl&eacute;e g&eacute;n&eacute;rale annuelle des membres de la Corporation. Les membres de l&#39;&eacute;quipe de direction du CSA y sont des invit&eacute;s permanents.</p>\r\n', '/assets/images/ca-hero-image.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(10, 8, 'fr', 'Concentration science', 'Concentration\r\nscience', '<p>Offerte de la 1<sup>re</sup> &agrave; la 3<sup>e</sup> secondaire, notre activit&eacute; de robotique permet aux &eacute;l&egrave;ves de concevoir et programmer des robots tout en participant &agrave; des comp&eacute;titions o&ugrave; ils peuvent d&eacute;passer leurs limites et toujours apprendre plus.</p>\r\n', '/assets/images/parcours/hero-image-concentration-science.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '/assets/images/parcours/icones/concentration_scientique.svg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(12, 13, 'fr', 'Direction générale', 'Mot de la direction générale', '<p>Le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re, c&rsquo;est d&rsquo;abord et avant tout une grande famille qui ne cesse de cro&icirc;tre depuis 1827. Il aura fallu la d&eacute;termination d&rsquo;un visionnaire, l&rsquo;abb&eacute; Charles-Fran&ccedil;ois Painchaud, pour faire na&icirc;tre ce qui allait devenir une grande maison d&rsquo;enseignement aujourd&rsquo;hui reconnue dans tout le r&eacute;seau &eacute;ducationnel pour son leadership.</p>\r\n\r\n<p>Chez nous, tous les &eacute;l&egrave;ves du primaire promus en cheminement r&eacute;gulier sont accept&eacute;s. Le CSA ne se contente pas de faire vivre une tr&egrave;s grande r&eacute;ussite &agrave; un nombre restreint d&rsquo;&eacute;l&egrave;ves, mais plut&ocirc;t une r&eacute;ussite &agrave; l&#39;ensemble de ses &eacute;l&egrave;ves. &Agrave; cette absence de s&eacute;lection s&rsquo;ajoute un service d&rsquo;aide financi&egrave;re qui soutient, ann&eacute;e apr&egrave;s ann&eacute;e, de nombreuses familles. &Agrave; titre d&rsquo;exemple, au cours des 23 derni&egrave;res ann&eacute;es, 4 240 demandes d&#39;aide financ&egrave;re ont &eacute;t&eacute; accept&eacute;es, pour un total de plus de trois-millions-deux-cent-soixante-neuf-mille dollars. Les &eacute;coles priv&eacute;es sont souvent tax&eacute;es d&rsquo;&eacute;litisme et certaines d&rsquo;entre elles le sont. Au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re toutefois, notre accessibilit&eacute; est incontestable, car, peu importe le talent et le revenu familial, chaque adolescent qui le souhaite peut y &eacute;tudier.</p>\r\n\r\n<p>Notre institution est membre de la grande famille des &eacute;tablissements d&rsquo;enseignement secondaire priv&eacute;s et appartenir &agrave; une famille, c&rsquo;est une grande richesse. Faire partie de celle du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re, c&rsquo;est une chance unique, nous en sommes persuad&eacute;s, pour tous les adolescents qui nous sont confi&eacute;s. Ainsi, d&eacute;velopper leurs talents, nourrir leurs passions qui se concr&eacute;tiseront par des choix d&rsquo;&eacute;tudes postsecondaires et ult&eacute;rieurement de carri&egrave;res, c&rsquo;est, pour nous, le plus beau de tous nos d&eacute;fis.</p>\r\n\r\n<p>Nous sommes fiers du CSA et c&rsquo;est cette fiert&eacute; que nous voulons partager avec vous. Choisir le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re, c&rsquo;est offrir aux adolescents des racines pour la vie et des ancrages solides pour l&rsquo;avenir.</p>\r\n', '/assets/images/hero-image-direction-generale.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(13, 14, 'fr', 'Historique', 'Historique', '<p>Depuis 1827, le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re fa&ccedil;onne l&rsquo;avenir avec fiert&eacute; et passion. H&eacute;ritier d&rsquo;une riche tradition, il demeure un lieu d&rsquo;innovation o&ugrave; chaque g&eacute;n&eacute;ration trouve sa place. D&eacute;couvrez une histoire inspirante qui continue de s&rsquo;&eacute;crire au c&oelig;ur de notre communaut&eacute;.</p>\r\n', '/assets/images/historique-blason_v2.png', '/assets/images/historique-fondateur.png', 'Parcourez les 200 d’histoire du collège', '10', '/assets/images/hero-image-direction-generale.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(14, 15, 'fr', 'Mission, vision et valeurs', '', NULL, '/assets/images/mission-hero-image.jpg', 'Notre mission', '<p>Le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re est une institution d&rsquo;enseignement secondaire priv&eacute;e situ&eacute;e dans une communaut&eacute; o&ugrave; l&rsquo;&eacute;ducation est en t&ecirc;te de liste des priorit&eacute;s, un coll&egrave;ge o&ugrave; passions et talents se conjuguent au quotidien. Il se donne comme mission principale de contribuer au d&eacute;veloppement de ses &eacute;l&egrave;ves sur tous les plans pour qu&rsquo;ils puissent devenir des citoyens responsables et engag&eacute;s.</p>\r\n\r\n<p>Il prend sa force dans la volont&eacute; commune de tout son personnel et de ses partenaires soucieux d&rsquo;offrir un environnement s&eacute;curitaire, accueillant, riche en exp&eacute;riences humaines et essentiellement centr&eacute; sur la r&eacute;ussite de ses &eacute;l&egrave;ves.</p>\r\n', '/assets/images/historique-blason_v2.png', '<ul>\r\n	<li>Volet 1\r\n	<p>Le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re est reconnu et s&rsquo;engage &agrave; demeurer une institution d&rsquo;enseignement de grande qualit&eacute;, capable et r&eacute;solument d&eacute;termin&eacute;e &agrave; mener &agrave; la r&eacute;ussite les &eacute;l&egrave;ves qui lui sont confi&eacute;s. R&eacute;ussir, &ecirc;tre un leader de demain, &ecirc;tre entour&eacute; de gens d&eacute;vou&eacute;s, donnant toujours le meilleur d&rsquo;eux-m&ecirc;mes, &ecirc;tre au c&oelig;ur de l&rsquo;innovation et du d&eacute;veloppement p&eacute;dagogique, voil&agrave; les richesses que nos &eacute;l&egrave;ves vivent au quotidien. Avec un dipl&ocirc;me de notre institution dans leur bagage de connaissances, nos finissants seront appr&eacute;ci&eacute;s pour leur sens de l&rsquo;engagement et des responsabilit&eacute;s, pour leur ouverture sur le monde et leurs connaissances.</p>\r\n	</li>\r\n	<li>Volet 2\r\n	<p>Pr&eacute;sent et actif dans sa communaut&eacute;, le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re se distingue par la qualit&eacute; de l&#39;ensemble de ses services d&#39;accueil et de formation et vise &agrave; toujours &ecirc;tre pour ses client&egrave;les une option gagnante.</p>\r\n	</li>\r\n</ul>\r\n', '/assets/images/vision-image-01.jpg', 'Nos valeurs', '<ul>\r\n	<li>\r\n	<h3><img alt=\"Icône\" src=\"/assets/images/icons/icon-respect.svg\" style=\"width: 60px; height: 50px;\" />Respect et ouverture sur le monde</h3>\r\n\r\n	<p>Le respect est une valeur de premi&egrave;re importance pour nous. Elle se concr&eacute;tise dans le r&egrave;glement de notre &eacute;cole, dans le vouvoiement exig&eacute; chez nos &eacute;l&egrave;ves, par notre accueil des autres, par la qualit&eacute; de nos relations interpersonnelles, sans oublier le respect de l&rsquo;environnement.</p>\r\n	</li>\r\n	<li>\r\n	<h3><img alt=\"Icône\" src=\"/assets/images/icons/icon-autonomie.svg\" style=\"width: 66px; height: 49px;\" />Autonomie et sens des responsabilit&eacute;s</h3>\r\n\r\n	<p>L&rsquo;autonomie et le sens des responsabilit&eacute;s sont des valeurs qui guident nos exigences envers les &eacute;l&egrave;ves.</p>\r\n	</li>\r\n	<li>\r\n	<h3><img alt=\"Icône\" src=\"/assets/images/icons/icon-engagement.svg\" style=\"width: 67px; height: 62px;\" />Engagement et d&eacute;passement</h3>\r\n\r\n	<p>L&rsquo;engagement et le d&eacute;passement font r&eacute;f&eacute;rence &agrave; la mobilisation et &agrave; la pers&eacute;v&eacute;rance de l&rsquo;&eacute;l&egrave;ve dans tous leurs choix qu&rsquo;ils soient scolaires ou parascolaires.</p>\r\n	</li>\r\n</ul>\r\n', '<ol>\r\n	<li>Nous nous engageons &agrave; favoriser l&rsquo;implication de chacun de nos &eacute;l&egrave;ves pour en faire un citoyen responsable de ses choix, respectueux et conscient de la richesse des diff&eacute;rences.</li>\r\n	<li>Nous nous engageons &agrave; d&eacute;velopper chez l&rsquo;&eacute;l&egrave;ve des strat&eacute;gies de consommation et d&rsquo;utilisation responsable de biens et de services en nous appuyant sur des valeurs li&eacute;es au sens &eacute;thique et critique.</li>\r\n</ol>\r\n', 'Réussite scolaire', 'Aujourd’hui pour demain', '<ol>\r\n	<li>Nous nous engageons &agrave; d&eacute;velopper chez nos &eacute;l&egrave;ves le go&ucirc;t d&rsquo;apprendre, d&rsquo;explorer et de d&eacute;couvrir.</li>\r\n	<li>Nous nous engageons &agrave; d&eacute;velopper chez nos &eacute;l&egrave;ves diverses habilet&eacute;s en communication orale et &eacute;crite.</li>\r\n	<li>Nous nous engageons &agrave; d&eacute;velopper avec et pour nos &eacute;l&egrave;ves des habitudes de vie sur le plan de la sant&eacute;, du bien-&ecirc;tre, de la s&eacute;curit&eacute; et de la sexualit&eacute;.</li>\r\n</ol>\r\n', '11', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', 'Le Collège de Sainte-Anne-de-la-Pocatière est une institution d’enseignement secondaire privée située dans une communauté où l’éducation est en tête de liste des priorités, un collège où passions et talents se conjuguent au quotidien. Il se donne comme mission principale de contribuer au développement de ses élèves sur tous les plans pour qu’ils puissent devenir des citoyens responsables et engagés.', 0),
(15, 16, 'fr', 'Milieu de vie', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(16, 17, 'fr', 'Activités et sorties étudiantes', '', '<p>La vie &eacute;tudiante chez nous est riche et diversifi&eacute;e, offrant &agrave; chaque &eacute;l&egrave;ve l&#39;occasion de d&eacute;velopper ses passions, d&#39;explorer de nouveaux horizons et de vivre des exp&eacute;riences inoubliables. Que ce soit &agrave; travers des activit&eacute;s culturelles, sportives ou des engagements b&eacute;n&eacute;voles, chacun y trouve sa place.</p>\r\n', '/assets/images/parcours/hero-image-concentrations-artistiques.jpeg', '9', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(17, 18, 'fr', 'Règles de vie', '', '<p>Nous avons con&ccedil;u un cadre de vie pour guider chaque &eacute;l&egrave;ve vers des comportements qui valorisent le respect, la s&eacute;curit&eacute;&nbsp;et le bien-&ecirc;tre de toutes les personnes. Chaque r&egrave;gle contribue &agrave; faire du Coll&egrave;ge un lieu o&ugrave; chaque enfant peut apprendre et &eacute;voluer dans un esprit de camaraderie et de solidarit&eacute;.</p>\r\n\r\n<p>En choisissant de faire partie de notre communaut&eacute;, chaque &eacute;l&egrave;ve et sa famille s&#39;engagent dans ce parcours o&ugrave; l&#39;excellence et la bienveillance se rencontrent pour former des citoyens responsables et respectueux des autres.</p>\r\n', '/assets/images/parcours/regles-de-vie-hero-image.jpg', '9', '/assets/files/les-regles-de-vie-2024-2025.pdf', 'Consulter le code de vie (version 2025-2026 à venir)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(18, 19, 'fr', 'Résidence scolaire', '', '<p>D&eacute;couvrez notre r&eacute;sidence scolaire : un espace s&eacute;curitaire et moderne, con&ccedil;u pour favoriser le bien-&ecirc;tre et la r&eacute;ussite de nos &eacute;l&egrave;ves. Ici, chaque jeune b&eacute;n&eacute;ficie d&rsquo;un environnement stimulant et confortable, o&ugrave; &eacute;tudes, d&eacute;tente et vie en communaut&eacute; se conjuguent harmonieusement.</p>\r\n', '/assets/images/parcours/residence-scolaire-hero-image.jpg', '<p>Profitez du confort et de la tranquillit&eacute; d&#39;une chambre moderne, id&eacute;ale pour &eacute;tudier et se d&eacute;tendre, tout en restant connect&eacute; avec votre famille et vos amis gr&acirc;ce &agrave; notre acc&egrave;s Wi-Fi gratuit.</p>\r\n\r\n<p>Nos &eacute;l&egrave;ves b&eacute;n&eacute;ficient de chambres individuelles r&eacute;cemment r&eacute;nov&eacute;es, &eacute;quip&eacute;es pour offrir un espace de vie agr&eacute;able et fonctionnel. Chaque chambre est meubl&eacute;e d&rsquo;un lit simple (literie incluse), d&rsquo;une armoire, d&rsquo;une table de travail, et d&rsquo;autres am&eacute;nagements modernes pour r&eacute;pondre aux besoins quotidiens des r&eacute;sidents. La r&eacute;sidence dispose &eacute;galement de plusieurs salles de bain avec douches et de salles de s&eacute;jour spacieuses, id&eacute;ales pour se d&eacute;tendre ou socialiser.</p>\r\n', 'Encadrement bienveillant et encadrement continu', '<section>\r\n<section>\r\n<ul>\r\n	<li>\r\n	<p>La r&eacute;sidence scolaire est supervis&eacute;e en permanence par une &eacute;quipe d&eacute;di&eacute;e, assurant une pr&eacute;sence bienveillante de 16 h &agrave; 8 h 30 en semaine et 24 heures sur 24 durant les jours de cong&eacute;.</p>\r\n	</li>\r\n	<li>\r\n	<p>Nos &eacute;ducateur(rice)s encadrent les p&eacute;riodes de devoirs en d&eacute;but de soir&eacute;e, veillent au calme de la r&eacute;sidence, et organisent des activit&eacute;s enrichissantes en semaine et chaque fin de semaine.</p>\r\n	</li>\r\n	<li>\r\n	<p>Les jeunes b&eacute;n&eacute;ficient ainsi d&#39;un environnement s&ucirc;r et stimulant, favorisant la r&eacute;ussite scolaire et l&rsquo;&eacute;panouissement personnel.</p>\r\n	</li>\r\n</ul>\r\n</section>\r\n</section>\r\n', '/assets/images/residence-scolaire-image-02.jpg', '/assets/images/residence-scolaire-image-03.jpg', '/assets/images/residence-scolaire-image-04.jpg', '<p><strong>La priorit&eacute; est donn&eacute;e &agrave; nos &eacute;l&egrave;ves internationaux, mais nos chambres exc&eacute;dentaires sont aussi accessibles aux &eacute;l&egrave;ves du Coll&egrave;ge d&eacute;montrant les qualit&eacute;s suivantes :</strong></p>\r\n\r\n<ul>\r\n	<li>Excellente performance acad&eacute;mique;</li>\r\n	<li>Autonomie et sens des responsabilit&eacute;s;</li>\r\n	<li>Comportement respectueux et calme;</li>\r\n	<li>Bonne sociabilit&eacute;.</li>\r\n</ul>\r\n\r\n<p>Nous avons &agrave; c&oelig;ur d&rsquo;offrir un milieu de vie &eacute;panouissant, propice &agrave; la r&eacute;ussite scolaire et au d&eacute;veloppement personnel pour l&rsquo;ensemble des jeunes. Par cons&eacute;quent, notre r&eacute;sidence accueille uniquement les &eacute;l&egrave;ves capables de s&rsquo;int&eacute;grer harmonieusement sans besoin d&rsquo;encadrement sp&eacute;cifique/suppl&eacute;mentaire.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(19, 20, 'fr', 'Services aux élèves', '', '<p>Au Coll&egrave;ge, nous sommes d&eacute;di&eacute;s &agrave; offrir un environnement enrichissant et bienveillant, o&ugrave; chaque &eacute;l&egrave;ve peut s&#39;&eacute;panouir pleinement. Nos services aux &eacute;l&egrave;ves sont con&ccedil;us pour soutenir leur r&eacute;ussite acad&eacute;mique, leur d&eacute;veloppement personnel et leur bien-&ecirc;tre g&eacute;n&eacute;ral.</p>\r\n', '/assets/images/parcours/services-aux-eleves-hero-image.jpg', '9', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(20, 21, 'fr', 'Services éducatifs', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(21, 22, 'fr', 'Aide à la réussite', '', '<p>Gr&acirc;ce &agrave; un ensemble de services d&rsquo;aide &agrave; la r&eacute;ussite, le Coll&egrave;ge offre &agrave; chaque &eacute;l&egrave;ve un soutien complet et personnalis&eacute;, favorisant l&rsquo;&eacute;panouissement et la r&eacute;ussite dans un cadre structur&eacute; et bienveillant.</p>\r\n', '/assets/images/parcours/hero-image-concentrations-artistiques.jpeg', '9', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(22, 24, 'fr', 'Calendriers et horaires', '', '<p>Chaque journ&eacute;e inclut des cours, une p&eacute;riode d&rsquo;&eacute;tude, et des moments d&eacute;di&eacute;s aux activit&eacute;s sportives et culturelles, permettant aux &eacute;l&egrave;ves de d&eacute;velopper pleinement leurs comp&eacute;tences et de s&rsquo;&eacute;panouir dans un environnement dynamique et bienveillant.</p>\r\n', '/assets/images/parcours/calendrier-et-horaires-hero-image.jpg', '9', 'Calendrier scolaire 2025-2026', '/assets/files/Calendrier%202025-2026_modifi%C3%A9%208%20octobre%202025.pdf', '/assets/files/Horaire_type_2025-2026.pdf', 'Horaire type de nos élèves (midi prolongé)', '/assets/files/Horaire_type_midi_prolonge_2025-2026.pdf', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(23, 25, 'fr', 'Technologie', '', '<p>Au Coll&egrave;ge, nous croyons en un apprentissage &eacute;quilibr&eacute; qui tire parti des atouts de la technologie tout en pr&eacute;servant les bienfaits du papier. Si le num&eacute;rique est omnipr&eacute;sent, c&rsquo;est pour enrichir les exp&eacute;riences d&rsquo;apprentissage sans remplacer le papier qui est aussi essentiel.</p>\r\n', '/assets/images/parcours/technologie-hero-image.jpg', '<p>Dans chaque classe, les &eacute;l&egrave;ves disposent d&rsquo;outils technologiques modernes. Gr&acirc;ce aux iPads, ils acc&egrave;dent &agrave; une multitude d&rsquo;applications p&eacute;dagogiques et organisent leur quotidien scolaire. Les tableaux interactifs rendent les le&ccedil;ons plus dynamiques et participatives, et des lunettes de r&eacute;alit&eacute; virtuelle permettent des d&eacute;couvertes immersives, plongeant les &eacute;tudiants dans des environnements captivants et &eacute;ducatifs.</p>\r\n\r\n<p>Nous avons &eacute;galement &agrave; c&oelig;ur d&rsquo;offrir des outils adapt&eacute;s pour les &eacute;l&egrave;ves avec des troubles d&rsquo;apprentissage, en int&eacute;grant des technologies de soutien qui les aident &agrave; d&eacute;velopper autonomie et confiance. Cependant, nous n&rsquo;abandonnons pas le papier : il conserve sa place pour les activit&eacute;s o&ugrave; il est le plus efficace, comme la prise de notes, les exercices pratiques, et les travaux cr&eacute;atifs.</p>\r\n', 'Éduquer à la responsabilité numérique', '<ul>\r\n	<li>En parall&egrave;le, nous guidons nos &eacute;l&egrave;ves vers le d&eacute;veloppement de saines habitudes num&eacute;riques et cultivons leur comp&eacute;tence critique pour qu&rsquo;ils utilisent la technologie de mani&egrave;re r&eacute;fl&eacute;chie et responsable.</li>\r\n	<li>Ainsi, ils apprennent &agrave; naviguer dans le monde digital avec discernement, en ma&icirc;trisant les outils tout en restant conscients de leurs impacts.</li>\r\n	<li>Cette harmonie entre innovation et m&eacute;thodes traditionnelles permet &agrave; nos &eacute;l&egrave;ves de b&eacute;n&eacute;ficier d&rsquo;une &eacute;ducation compl&egrave;te, ancr&eacute;e dans la modernit&eacute; tout en valorisant les pratiques d&rsquo;apprentissage &eacute;prouv&eacute;es.</li>\r\n</ul>\r\n', '9', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(24, 26, 'fr', 'Diplômes', '', '<p>Au Coll&egrave;ge, nous c&eacute;l&eacute;brons la r&eacute;ussite acad&eacute;mique et le d&eacute;veloppement personnel de nos &eacute;l&egrave;ves avec deux distinctions importantes : le dipl&ocirc;me d&rsquo;&eacute;tudes secondaires (DES) du minist&egrave;re de l&rsquo;&Eacute;ducation du Qu&eacute;bec (MEQ), et notre propre dipl&ocirc;me du Coll&egrave;ge.</p>\r\n', '/assets/images/parcours/diplomes-hero-image.jpg', '<p>Ces dipl&ocirc;mes t&eacute;moignent non seulement des comp&eacute;tences acad&eacute;miques solides, mais aussi des valeurs humaines et des savoir-&ecirc;tre qui fa&ccedil;onnent nos finissants. Chaque dipl&ocirc;me repr&eacute;sente un pas de plus vers l&rsquo;avenir, appuy&eacute; par la rigueur et la fiert&eacute; de nos &eacute;l&egrave;ves et de leurs familles.</p>\r\n', 'Diplôme d’études secondaire du ministère de l’Éducation', '<p>Le DES repr&eacute;sente une &eacute;tape cl&eacute; pour les &eacute;l&egrave;ves de la province, marquant l&rsquo;aboutissement de leurs &eacute;tudes secondaires. Pour obtenir ce dipl&ocirc;me, les &eacute;l&egrave;ves doivent cumuler 54 unit&eacute;s, dont 20 de 5<sup>e</sup> secondaire ou de formation professionnelle, et r&eacute;ussir les cours suivants :</p>\r\n\r\n<ul>\r\n	<li>Langue d&#39;enseignement (5<sup>e</sup> secondaire)</li>\r\n	<li>Math&eacute;matiques (4<sup>e</sup> secondaire)</li>\r\n	<li>Langue seconde (5<sup>e</sup> secondaire)</li>\r\n	<li>Sciences et technologie ou Applications technologiques (4<sup>e</sup> secondaire)</li>\r\n	<li>Histoire et &eacute;ducation &agrave; la citoyennet&eacute; (4<sup>e</sup> secondaire)</li>\r\n	<li>Arts (4<sup>e</sup> secondaire)</li>\r\n	<li>&Eacute;thique et culture religieuse ou &Eacute;ducation physique et sant&eacute; (5<sup>e</sup> secondaire)</li>\r\n</ul>\r\n\r\n<p>Avec une note de passage fix&eacute;e &agrave; 60 % pour chaque cours, le DES ouvre aux finissants un large &eacute;ventail de choix pour leur avenir acad&eacute;mique et professionnel, tels que le c&eacute;gep, la formation professionnelle, ou des parcours diversifi&eacute;s.</p>\r\n', '<p>Au Coll&egrave;ge, nous valorisons l&rsquo;accomplissement personnel et les comp&eacute;tences de chaque &eacute;l&egrave;ve au-del&agrave; du programme officiel du MEQ. En plus du DES, nos &eacute;l&egrave;ves peuvent recevoir notre propre dipl&ocirc;me, une distinction qui atteste de leur savoir-faire acad&eacute;mique et de leur savoir-&ecirc;tre. Ce dipl&ocirc;me est une reconnaissance de leur engagement, de leur responsabilit&eacute; sociale, de leur leadership et de leur d&eacute;veloppement personnel, tous des aspects d&eacute;finis dans notre profil du finissant.</p>\r\n\r\n<p>Pour les familles, ce dipl&ocirc;me est une belle source de fiert&eacute;, car il t&eacute;moigne de la r&eacute;ussite approfondie et des valeurs fortes acquises par leurs jeunes au Coll&egrave;ge. Nos dipl&ocirc;m&eacute;(e)s quittent ainsi notre institution pr&ecirc;t(e)s &agrave; devenir des citoyen(ne)s responsables et engag&eacute;(e)s, fort(e)s de comp&eacute;tences acad&eacute;miques et humaines uniques.</p>\r\n', '9', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(25, 27, 'fr', 'Admission', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(26, 28, 'fr', 'Procédure d’inscription', '', '<p>Pr&ecirc;t &agrave; inscrire votre enfant? Rien de plus simple!</p>\r\n', '/assets/images/parcours/calendrier-et-horaires-hero-image.jpg', '<h3>Inscription en cours d&#39;ann&eacute;e possible!</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Date limite d&rsquo;inscription 26-27&nbsp;:&nbsp;&nbsp; &nbsp; &nbsp;<span style=\"color:#d00023;\">9 mars 2026</span></h3>\r\n', 'Étapes d’inscription', '<h3>Remplissez le formulaire en ligne</h3>\r\n\r\n<p><a class=\"button\" href=\"https://pluri.leadercsa.com/pluriportail/pfr/AdmisExMainExterne.srf?AdmisExReq=1\" target=\"_blank\">Remplir le formulaire</a></p>\r\n', '<h3>Attendez la confirmation d&rsquo;admission</h3>\r\n\r\n<p>Une fois le dossier compl&eacute;t&eacute; et analys&eacute;, nous vous informerons de la d&eacute;cision par courriel.</p>\r\n', '<h3>Remarques importantes</h3>\r\n\r\n<ul>\r\n	<li>Tous les documents soumis restent la propri&eacute;t&eacute; du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re.</li>\r\n	<li>Dans certains cas, des rencontres avec la direction de l&rsquo;&eacute;cole seront n&eacute;cessaires pour compl&eacute;ter l&rsquo;&eacute;tude du dossier.</li>\r\n	<li>L&rsquo;admission de l&rsquo;enfant de 1<sup>re</sup> secondaire est conditionnelle &agrave; la r&eacute;ussite de sa 6<sup>e</sup> ann&eacute;e.</li>\r\n	<li>Les dossiers des &eacute;l&egrave;ves admis au Programme Multilangue ou en anglais enrichi seront r&eacute;&eacute;valu&eacute;s sur r&eacute;ception du bulletin final de l&rsquo;ann&eacute;e en cours afin de s&rsquo;assurer du respect des conditions d&rsquo;admissibilit&eacute;. La direction se r&eacute;serve le droit de refuser d&rsquo;inscrire un &eacute;l&egrave;ve.</li>\r\n</ul>\r\n', '<h2>Une fois admis</h2>\r\n\r\n<p>Vous pourrez finaliser l&rsquo;inscription en ligne en remplissant les derniers documents n&eacute;cessaires (choix de cours, inscription aux programmes, etc.).</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(27, 29, 'fr', 'Coûts et aide financière', 'Coûts - Année scolaire 2026-2027', NULL, '/assets/images/couts-et-aide-financiere-hero-image.jpg', 'Scolarité', '<ul>\r\n	<li>Inscription : 200 $</li>\r\n	<li>Frais aff&eacute;rents<sup>1</sup> : 275 $</li>\r\n	<li>Scolarit&eacute; : 3 620&nbsp;$ (modalit&eacute;s de paiement sur 10 mois)</li>\r\n</ul>\r\n\r\n<p><small><sup>1</sup> Les frais aff&eacute;rents incluent la carte d&rsquo;identit&eacute; avec photo, l&rsquo;assurance accidents scolaire, la location du cadenas et des volumes de classe, une fraction des frais associ&eacute;s aux activit&eacute;s &eacute;tudiantes sp&eacute;ciales, l&rsquo;acc&egrave;s au Pluriportail pour les parents et les &eacute;l&egrave;ves, les frais associ&eacute;s aux nouvelles technologies ainsi que les contributions au Gouvernement &eacute;tudiant et &agrave; l&rsquo;Association des parents d&rsquo;&eacute;l&egrave;ves.</small></p>\r\n', 'Transport scolaire', 'Matériel scolaire', '<p>1<sup>re</sup> &agrave; 5<sup>e</sup>&nbsp;secondaire : 300&nbsp;$</p>\r\n', 'Programmes, concentrations et perfectionnements sportifs', 'Résidence', '<ul>\r\n	<li>R&eacute;duction de 25 % des frais de scolarit&eacute; pour le 2<sup>e</sup> enfant inscrit chez nous la m&ecirc;me ann&eacute;e.</li>\r\n	<li>R&eacute;duction de 50 % des frais de scolarit&eacute; pour le 3<sup>e</sup> enfant inscrit chez nous la m&ecirc;me ann&eacute;e.</li>\r\n	<li>Aucuns frais de scolarit&eacute; pour le 4<sup>e</sup> enfant inscrit chez nous la m&ecirc;me ann&eacute;e.</li>\r\n	<li>Possibilit&eacute; de bourses suppl&eacute;mentaires pour les familles de 3 enfants et plus.</li>\r\n</ul>\r\n', '<h2>Aide financi&egrave;re</h2>\r\n\r\n<h3>Faites de leurs r&ecirc;ves une r&eacute;alit&eacute; !</h3>\r\n\r\n<p>Tous les parents souhaitent offrir &agrave; leurs enfants une &eacute;ducation de qualit&eacute;, un environnement o&ugrave; ils peuvent s&rsquo;&eacute;panouir et se b&acirc;tir un avenir prometteur. Et les enfants ? Ils r&ecirc;vent d&rsquo;apprendre, de relever des d&eacute;fis, de se faire des amis et de s&rsquo;amuser.</p>\r\n\r\n<p>Au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re, nous croyons que chaque enfant m&eacute;rite cette chance, peu importe les moyens financiers de sa famille. Gr&acirc;ce au Fonds d&rsquo;&eacute;tude Charles-Fran&ccedil;ois-Painchaud, nous offrons chaque ann&eacute;e des bourses qui all&egrave;gent les frais de scolarit&eacute;.</p>\r\n\r\n<p>En 24&nbsp;ans, plus de 3,3&nbsp;millions de dollars ont &eacute;t&eacute; distribu&eacute;s, aidant pr&egrave;s de 4 366&nbsp;familles &agrave; concr&eacute;tiser les r&ecirc;ves de leurs enfants. Toutes les demandes sont trait&eacute;es de fa&ccedil;on confidentielle.</p>\r\n\r\n<p>Pour plus d&rsquo;informations sur l&rsquo;admissibilit&eacute;, contactez madame Johanne Soucy, responsable de l&rsquo;aide financi&egrave;re, au <a href=\"tel:418-856-3012\">418 856-3012</a>, poste 231.</p>\r\n', '<h2>Pr&ecirc;t &agrave; inscrire votre enfant ?</h2>\r\n\r\n<p><a class=\"button\" href=\"?rub=27&amp;subRub=28\">Voir la proc&eacute;dure d&rsquo;inscription</a></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', 'Mieux comprendre les coûts au Collège Sainte-Anne-de-la-Pocatière : demande gratuite, frais et résidence, paiements sur 10 mois, réductions familiales et bourses du Fonds Painchaud.', 0),
(28, 30, 'fr', 'Portes ouvertes', '', 'Samedi 17 janvier 2026 à 13 h', 'Visionnez notre vidéo promotionnelle', '/assets/files/videos/csa-hero.mp4', '<p>La journ&eacute;e portes ouvertes au Coll&egrave;ge offre une opportunit&eacute; unique de d&eacute;couvrir ses programmes, concentrations et son encadrement personnalis&eacute;. C&#39;est l&#39;occasion parfaite pour explorer l&#39;&eacute;cole, rencontrer les membres du personnel et s&#39;informer sur les activit&eacute;s parascolaires et sportives. Venez passer un apr&egrave;s-midi avec nous afin que nous puissions r&eacute;pondre &agrave; vos questions et que vous puissiez vivre, l&#39;instant de quelques heures, la magie de pr&egrave;s de 200 ans de r&eacute;ussite acad&eacute;mique et de d&eacute;veloppement personnel.</p>\r\n\r\n<p>C&#39;est un rendez-vous le samedi 17 janvier 2026 &agrave; 13 h!</p>\r\n', '/assets/images/thumbnail-video.png', 'Découvrez', 'Témoignages', 'Documents', '/assets/images/image-portes-ouvertes.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', 'Portes ouvertes du Collège Saint-Anne-de-la-Pocatière.', 'Découvrez la journée portes ouvertes du Collège Sainte-Anne-de-la-Pocatière : une occasion unique de visiter l’école, rencontrer le personnel, explorer les programmes et activités, et plonger dans près de 200 ans d’excellence académique. Rendez-vous le samedi 17 janvier 2026 à 13h!', 0),
(29, 31, 'fr', 'Nouvelles', '', '<p>Bienvenue dans la section Nouvelles du Coll&egrave;ge!</p>\r\n\r\n<p>Vous y trouverez les plus r&eacute;centes informations sur la vie scolaire, les activit&eacute;s parascolaires, les projets p&eacute;dagogiques ainsi que les &eacute;v&eacute;nements qui animent notre communaut&eacute; &eacute;ducative.&nbsp;</p>\r\n\r\n<p>Restez &agrave; l&rsquo;aff&ucirc;t aussi sur nos r&eacute;seaux sociaux pour d&eacute;couvrir les r&eacute;ussites, les initiatives et les moments forts qui font du Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re un milieu de vie unique, stimulant et inspirant.</p>\r\n\r\n<p>Vous verrez tout le dynamisme de notre Coll&egrave;ge, l&rsquo;engagement de nos &eacute;l&egrave;ves et la passion de notre personnel.</p>\r\n', '/assets/images/ca-hero-image.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', 'Nouvelles du Collège Saint-Anne-de-la-Pocatière', '', 0),
(30, 32, 'fr', 'Élève d’un jour et visite privée', '', '', '/assets/images/parcours/calendrier-et-horaires-hero-image.jpg', '<p>Le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re est une institution d&rsquo;enseignement secondaire priv&eacute;e situ&eacute;e dans une communaut&eacute; o&ugrave; l&rsquo;&eacute;ducation est en t&ecirc;te de liste des priorit&eacute;s, un coll&egrave;ge o&ugrave; passions et talents se conjuguent au quotidien. Il se donne comme mission principale de contribuer au d&eacute;veloppement de ses &eacute;l&egrave;ves sur tous les plans pour qu&rsquo;ils puissent devenir des citoyens responsables et engag&eacute;s.</p>\r\n\r\n<p>Il prend sa force dans la volont&eacute; commune de tout son personnel et de ses partenaires soucieux d&rsquo;offrir un environnement s&eacute;curitaire, accueillant, riche en exp&eacute;riences humaines et essentiellement centr&eacute; sur la r&eacute;ussite de ses &eacute;l&egrave;ves.</p>\r\n\r\n<h3>Pourquoi participer ?</h3>\r\n\r\n<p>D&eacute;couvrir le CSA, c&rsquo;est vivre une exp&eacute;rience immersive, ressentir l&rsquo;ambiance de l&rsquo;&eacute;cole et trouver l&rsquo;environnement qui te correspond.</p>\r\n', '<h2>Une seule &eacute;tape pour t&rsquo;inscrire &agrave; &Eacute;l&egrave;ve d&#39;un jour</h2>\r\n\r\n<p>R&eacute;serve ta place en remplissant notre formulaire en ligne d&egrave;s maintenant !</p>\r\n\r\n<p><a class=\"button\" href=\"https://docs.google.com/forms/d/e/1FAIpQLSdxgE7Hghdt5pu6pAmfD8v1Us3PCzfgT-pdslZTbqb79L2BhQ/viewform\" target=\"_blank\">Formulaire d&rsquo;inscription</a></p>\r\n', '/assets/images/image-portes-ouvertes.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0);
INSERT INTO `sections_ml` (`id`, `originId`, `langCode`, `name`, `h1`, `field1`, `field2`, `field3`, `field4`, `field5`, `field7`, `field8`, `field9`, `field11`, `field14`, `field15`, `field17`, `field18`, `field19`, `field20`, `field21`, `field22`, `field23`, `field24`, `field25`, `field26`, `field27`, `field28`, `field29`, `field30`, `field31`, `shorturl`, `urlRewrite`, `title`, `descriptionMeta`, `canceled`) VALUES
(31, 33, 'fr', 'Campagne de financement', 'Campagne majeure de financement 2023-2027', '<p>Ensemble, assurons un avenir prometteur pour notre Coll&egrave;ge!</p>\r\n', '/assets/images/campagne-financement-hero-image.jpg', '3 000 000 $', '<h2>Notre Coll&egrave;ge</h2>\r\n\r\n<ul>\r\n	<li>Accueille plus de 450 &eacute;l&egrave;ves de niveau secondaire;</li>\r\n	<li>Est le 5<sup>e</sup>&nbsp;plus vieil &eacute;tablissement d&rsquo;enseignement secondaire en fran&ccedil;ais en Am&eacute;rique;</li>\r\n	<li>Est au c&oelig;ur de sa communaut&eacute; depuis 1827;</li>\r\n	<li>Est accessible &agrave; tous les &eacute;l&egrave;ves du niveau primaire qui poursuivent leur parcours r&eacute;gulier au secondaire;</li>\r\n	<li>Est l&rsquo;un des seuls coll&egrave;ges au Qu&eacute;bec qui ne fait pas faire de test de classement ni d&rsquo;examen d&rsquo;admission &agrave; ses &eacute;l&egrave;ves.</li>\r\n</ul>\r\n', 'Mots de bienvenue', '/assets/images/campagne-de-financement/cabinet-de-campagne-tree.svg', '<h2>Ensemble</h2>\r\n\r\n<ul>\r\n	<li>Assurons la r&eacute;ussite et la pers&eacute;v&eacute;rance scolaire de nos &eacute;l&egrave;ves;</li>\r\n	<li>Assurons la pr&eacute;servation de notre patrimoine architectural;</li>\r\n	<li>Assurons une &eacute;ducation de qualit&eacute; &agrave; nos &eacute;l&egrave;ves, bas&eacute;e sur les nouvelles m&eacute;thodes &eacute;ducatives;</li>\r\n</ul>\r\n', '/assets/images/campagne-de-financement/ensemble-image.jpg', '/assets/images/campagne-de-financement/ensemble-football.jpg', '3000000', '2005000', '<h4>Les organismes alli&eacute;s :<br />\r\nmontant souhait&eacute; de 750 000 $</h4>\r\n\r\n<ul>\r\n	<li>L&rsquo;Amicale du Coll&egrave;ge</li>\r\n	<li>La Fondation Bouchard Inc.</li>\r\n	<li>Le Fonds Charles-Fran&ccedil;ois-Painchaud</li>\r\n</ul>\r\n', '<h4>La famille :<br />\r\nmontant souhait&eacute; de 760 000 $</h4>\r\n\r\n<ul>\r\n	<li>Les anciens &eacute;l&egrave;ves du Coll&egrave;ge</li>\r\n	<li>Les employ&eacute;s actuels</li>\r\n	<li>Les parents des &eacute;l&egrave;ves du Coll&egrave;ge</li>\r\n	<li>Les retrait&eacute;s</li>\r\n</ul>\r\n', '<h4>Les partenaires :<br />\r\nmontant souhait&eacute; de 1 490 000 $</h4>\r\n\r\n<ul>\r\n	<li>Les entreprises</li>\r\n	<li>Les fondations priv&eacute;es</li>\r\n	<li>Les Villes et les MRC</li>\r\n</ul>\r\n', 'Volet 1 - Persévérance scolaire (500 000 $)', '<h4>Offrir un soutien aux &eacute;l&egrave;ves afin de favoriser leur r&eacute;ussite</h4>\r\n\r\n<p>Comme le Coll&egrave;ge ne s&eacute;lectionne pas ses &eacute;l&egrave;ves selon leur performance scolaire ou leur revenu familial, il est essentiel d&rsquo;offrir du soutien aux &eacute;l&egrave;ves afin de favoriser leur r&eacute;ussite. La campagne de financement permettra ainsi de financer des ressources et des programmes d&rsquo;encadrement qui r&eacute;pondent bien &agrave; cette mission de l&rsquo;institution. Ces mesures font souvent la diff&eacute;rence entre l&rsquo;abandon et la poursuite des &eacute;tudes.</p>\r\n\r\n<h4>Projets &agrave; prioriser</h4>\r\n\r\n<ul>\r\n	<li>Maintenir l&rsquo;acc&egrave;s &agrave; des cours de r&eacute;cup&eacute;ration pour nos &eacute;l&egrave;ves.&nbsp;- - -<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:Aptos,sans-serif\">&nbsp;</span></span></span>EN COURS DE R&Eacute;ALISATION! - - -</li>\r\n	<li>Maintenir l&rsquo;acc&egrave;s au service d&rsquo;orthop&eacute;dagogie.&nbsp;&nbsp;- - -<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:Aptos,sans-serif\">&nbsp;</span></span></span>EN COURS DE R&Eacute;ALISATION! - - -</li>\r\n	<li>Maintenir les services de soutien et d&rsquo;encadrement aux &eacute;l&egrave;ves (psychologue, enseignant(e)s-ressources, Prof. Secours, etc.).&nbsp;&nbsp;- - -<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:Aptos,sans-serif\">&nbsp;</span></span></span>EN COURS DE R&Eacute;ALISATION! - - -</li>\r\n	<li>Ajouter les services d&rsquo;un(e) psycho&eacute;ducateur(trice) ou d&rsquo;un(e) technicien(ne) en &eacute;ducation sp&eacute;cialis&eacute;e.&nbsp;- - -<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:Aptos,sans-serif\">&nbsp;</span></span></span>R&Eacute;ALIS&Eacute;! - - -</li>\r\n</ul>\r\n', 'Volet 2 - Appui aux élèves (1 000 000 $)', '<h4>Favoriser l&rsquo;acc&egrave;s &agrave; des ressources p&eacute;dagogiques</h4>\r\n\r\n<p>Afin de permettre aux &eacute;l&egrave;ves d&rsquo;&ecirc;tre mieux outill&eacute;(e)s &agrave; leur sortie du Coll&egrave;ge, la campagne de financement permettra d&rsquo;acqu&eacute;rir des outils &agrave; la fine pointe de la technologie. L&rsquo;acc&egrave;s &agrave; des ressources mat&eacute;rielles am&eacute;liorera &eacute;galement la qualification des &eacute;l&egrave;ves qui souhaitent acc&eacute;der &agrave; des &eacute;tudes sup&eacute;rieures ou &agrave; des programmes techniques, car ils seront les d&eacute;cideur(euse)s de demain.</p>\r\n\r\n<h4>Projets &agrave; prioriser</h4>\r\n\r\n<ul>\r\n	<li>Mise &agrave; niveau de notre r&eacute;seau Internet afin d&rsquo;augmenter la bande passante.&nbsp;</li>\r\n	<li>Mise &agrave; jour du mat&eacute;riel informatique dans toutes les classes (projecteurs, syst&egrave;mes audios, etc.).</li>\r\n	<li>Renouvellement des iPad pour le personnel enseignant.&nbsp;&nbsp;&nbsp;- - -<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:Aptos,sans-serif\">&nbsp;</span></span></span>EN COURS DE R&Eacute;ALISATION! - - -</li>\r\n	<li>Achat et renouvellement d&rsquo;instruments pour les cours de sciences et de musique.</li>\r\n	<li>Achat et renouvellement de mat&eacute;riel pour les activit&eacute;s sportives et culturelles.</li>\r\n	<li>Am&eacute;lioration des infrastructures sportives int&eacute;rieures et ext&eacute;rieures (terrain de soccer, piste d&rsquo;athl&eacute;tisme, balle au mur, patinoire, etc.) pour les activit&eacute;s parascolaires.</li>\r\n	<li>R&eacute;novation de toutes les classes et ajout de mobilier.</li>\r\n	<li>Achat d&rsquo;un minibus pour les clubs sportifs et les diff&eacute;rentes activit&eacute;s de l&rsquo;&eacute;cole.</li>\r\n	<li>Achat d&#39;un v&eacute;hicule de transport pour les &eacute;l&egrave;ves de la r&eacute;sidence scolaire.</li>\r\n	<li>Transformation de l&#39;ancien local informatique en local multifonction.&nbsp;- - -<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:Aptos,sans-serif\">&nbsp;</span></span></span>R&Eacute;ALIS&Eacute;! - - -</li>\r\n</ul>\r\n', 'Volet 3 - Préservation du joyau architectural (1 500 000 $)', '<h4>Offrir un milieu de vie ad&eacute;quat, s&eacute;curitaire et respectueux des &eacute;l&egrave;ves</h4>\r\n\r\n<p>Joyau architectural et embl&egrave;me de Ville La Pocati&egrave;re et de la r&eacute;gion, le Coll&egrave;ge doit pr&eacute;server son charme et continuer &agrave; offrir un milieu de vie ad&eacute;quat, s&eacute;curitaire et respectueux de ses &eacute;l&egrave;ves. Pour ce faire, le Coll&egrave;ge doit proc&eacute;der &agrave; d&rsquo;importantes am&eacute;liorations de ses infrastructures permanentes et d&eacute;velopper des fa&ccedil;ons de faire qui am&eacute;lioreront l&rsquo;efficacit&eacute; &eacute;nerg&eacute;tique de notre majestueux b&acirc;timent.</p>\r\n\r\n<h4>Projets &agrave; prioriser</h4>\r\n\r\n<ul>\r\n	<li>R&eacute;paration / changement de la couverture du toit du gymnase et de l&rsquo;entr&eacute;e des &eacute;l&egrave;ves.&nbsp;- - -<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:Aptos,sans-serif\">&nbsp;</span></span></span>R&Eacute;ALIS&Eacute;! - - -</li>\r\n	<li>R&eacute;novation du vestiaire des filles de 2<sup>e</sup> &agrave; 5<sup>e</sup> secondaire.&nbsp;- - -<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:Aptos,sans-serif\">&nbsp;</span></span></span>R&Eacute;ALIS&Eacute;! - - -</li>\r\n	<li>R&eacute;novation du vestiaire des filles de 1<sup>re</sup> secondaire.</li>\r\n	<li>R&eacute;novation du Plateau des &eacute;l&egrave;ves.</li>\r\n	<li>Am&eacute;lioration de la r&eacute;g&eacute;n&eacute;rescence des puits g&eacute;othermiques, pour assurer le confort des &eacute;l&egrave;ves par l&rsquo;ajout de climatisation dans les classes de la fa&ccedil;ade du b&acirc;timent.</li>\r\n	<li>Am&eacute;lioration de la qualit&eacute; de l&rsquo;air (concentration de CO<sub><sup>2</sup></sub>) dans les classes.&nbsp;</li>\r\n	<li>Peinture et r&eacute;novation des fen&ecirc;tres du Coll&egrave;ge.</li>\r\n	<li>R&eacute;paration / changement du rev&ecirc;tement du toit du mus&eacute;e. - - -<span style=\"font-size:12pt\"><span style=\"line-height:115%\"><span style=\"font-family:Aptos,sans-serif\">&nbsp;</span></span></span>R&Eacute;ALIS&Eacute;! - - -</li>\r\n	<li>Agrandissement de la r&eacute;sidence scolaire.</li>\r\n</ul>\r\n', 'Plusieurs façons de contribuer', 'Événements et activités de la campagne', '/assets/images/campagne-de-financement/evenement-image.jpeg', 'Partenaires', 'Nous joindre', '<h3>Samuel Gagnon</h3>\r\n\r\n<p><strong>Responsable de la campagne</strong></p>\r\n\r\n<ul>\r\n	<li>418 856-3012, poste 342</li>\r\n	<li><a href=\"mailto:dons@leadercsa.com\">dons@leadercsa.com</a></li>\r\n</ul>\r\n\r\n<p>100, 4<sup>e</sup> avenue Painchaud, bur. 164<br />\r\nLa Pocati&egrave;re (Qu&eacute;bec) G0R 1Z0</p>\r\n', NULL, '', 'Campagne de financement du Collège Sainte-Anne-de-la-Pocatière', '', 0),
(32, 34, 'fr', 'Carrière', '', '<p>Travailler au Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re, c&rsquo;est s&rsquo;int&eacute;grer &agrave; un milieu o&ugrave; l&rsquo;engagement, la qualit&eacute; du travail et le sentiment d&rsquo;appartenance se conjuguent au quotidien.&nbsp;On y valorise la collaboration, l&rsquo;efficacit&eacute; et la qualit&eacute;, tout en offrant des occasions de progresser, autant sur le plan professionnel que personnel. Ici, le respect et la bonne entente rendent le travail motivant et agr&eacute;able.</p>\r\n', '/assets/images/carriere-hero-image.jpg', 'Postes disponibles', 'Pour postuler', '<section>\r\n<section>\r\n<p>Communiquer avec nous au&nbsp;<a href=\"tel:4188563012\">418 856-3012</a>, ou par &eacute;crit &agrave;&nbsp;<a href=\"mailto:info@leadercsa.com\">info@leadercsa.com</a>.</p>\r\n</section>\r\n</section>\r\n', '<p>Faites-nous parvenir votre curriculum vitae et une lettre de pr&eacute;sentation indiquant clairement l&#39;emploi recherch&eacute; &agrave; l&rsquo;adresse&nbsp;<a href=\"mailto:info@leadercsa.com\">info@leadercsa.com</a></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(33, 35, 'fr', 'Nous joindre', '', '<p>Pour toute question ou information, notre &eacute;quipe se fera un plaisir de vous r&eacute;pondre. N&rsquo;h&eacute;sitez pas &agrave; nous contacter; nous sommes l&agrave; pour vous accompagner !</p>\r\n', '/assets/images/ca-hero-image.jpg', 'Coordonnées', 'Écrivez-nous !', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(34, 36, 'fr', 'Communauté', '', '<p>La vie &eacute;tudiante chez nous est riche et diversifi&eacute;e, offrant &agrave; chaque &eacute;l&egrave;ve l&#39;occasion de d&eacute;velopper ses passions, d&#39;explorer de nouveaux horizons et de vivre des exp&eacute;riences inoubliables. Que ce soit &agrave; travers des activit&eacute;s culturelles, sportives ou des engagements b&eacute;n&eacute;voles, chacun y trouve sa place.</p>\r\n', '/assets/images/ca-hero-image.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(35, 37, 'fr', 'FAQ', 'Foire aux questions', '<p>Vous avez des questions? Nous avons les r&eacute;ponses!&nbsp;<br />\r\n<br />\r\nQue ce soit pour en savoir plus sur nos programmes, la vie &eacute;tudiante, les services de soutien, le transport, nous avons rassembl&eacute; ici les r&eacute;ponses aux questions les plus fr&eacute;quentes des parents et des futur(e)s &eacute;l&egrave;ves.</p>\r\n', '/assets/images/faq-hero-image.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(36, 38, 'fr', 'Protection des renseignements personnels (Loi 25)', 'Protection des renseignements personnels (Loi 25)', '<h3>Politique de confidentialit&eacute;</h3>\r\n\r\n<p>Le Coll&egrave;ge de Sainte-Anne-de-la-Pocati&egrave;re reconna&icirc;t l&rsquo;importance de la confidentialit&eacute; et de la sensibilit&eacute; des renseignements personnels qu&rsquo;il recueille par le biais notamment de plateformes informatis&eacute;es, de son site Web ou de tous autres moyens n&eacute;cessaires &agrave; la collecte d&rsquo;informations sensibles. La pr&eacute;sente Politique de confidentialit&eacute; pr&eacute;sente notamment quels renseignements personnels sont recueillis aupr&egrave;s de vous et &agrave; quelles fins.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Renseignements personnels recueillis</strong></p>\r\n\r\n<p>Dans le cadre du processus d&#39;inscription et d&rsquo;admission au Coll&egrave;ge, nous recueillons chez les &eacute;l&egrave;ves et/ou les parents des renseignements&nbsp;:</p>\r\n\r\n<ul>\r\n	<li>Personnels</li>\r\n	<li>Civils</li>\r\n	<li>Scolaires</li>\r\n	<li>M&eacute;dicaux</li>\r\n	<li>Professionnels</li>\r\n	<li>Financiers</li>\r\n</ul>\r\n\r\n<p>Dans le cadre du processus d&rsquo;inscription aux diff&eacute;rents services du Coll&egrave;ge (p. ex.&nbsp;: immersions, inscriptions &agrave; des sorties), nous recueillons chez les &eacute;l&egrave;ves et/ou les parents des renseignements&nbsp;:</p>\r\n\r\n<ul>\r\n	<li>Personnels</li>\r\n	<li>Civils</li>\r\n	<li>M&eacute;dicaux</li>\r\n	<li>Professionnels</li>\r\n	<li>Financiers</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Finalit&eacute; de la collecte et moyens</strong></p>\r\n\r\n<p>Nous utilisons les renseignements recueillis uniquement pour atteindre les objectifs d&eacute;crits ci-dessous&nbsp;:</p>\r\n\r\n<ul>\r\n	<li>Identification des clients (parents et/ou &eacute;l&egrave;ves)</li>\r\n	<li>Inscription et gestion des services scolaires, sportifs et/ou r&eacute;cr&eacute;atifs</li>\r\n	<li>Fourniture ou livraison d&rsquo;une prestation de service</li>\r\n	<li>Communication avec les clients</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Utilisation et communication des renseignements</strong></p>\r\n\r\n<p>Seules les personnes autoris&eacute;es, dans le cadre de leurs fonctions, ont acc&egrave;s aux renseignements personnels des employ&eacute;s, des clients (parents et &eacute;l&egrave;ves) et des fournisseurs.</p>\r\n\r\n<p>Les renseignements personnels sont utilis&eacute;s pour le bon fonctionnement de l&rsquo;&eacute;tablissement de mani&egrave;re exclusive et ne peuvent &ecirc;tre utilis&eacute;s &agrave; d&rsquo;autres fins.</p>\r\n\r\n<p>Le Coll&egrave;ge s&rsquo;assure que les employ&eacute;s, mais aussi les tiers avec qui il fait affaire notamment, les transporteurs et les fournisseurs de services, prot&egrave;gent la confidentialit&eacute; de ces renseignements auxquels ils ont acc&egrave;s, et ce, quel que soit le support sur lequel ils sont accessibles. Les employ&eacute;s ne les utiliseront ni ne les communiqueront &agrave; d&rsquo;autres fins que celles pr&eacute;vues, sauf si cela est requis ou permis par la loi.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Dur&eacute;e de conservation et mesures de s&eacute;curit&eacute;</strong></p>\r\n\r\n<p>Sauf autorisation ou exigence des lois applicables, le Coll&egrave;ge ne conserve vos renseignements personnels que le temps n&eacute;cessaire pour atteindre les fins pour lesquelles ils ont &eacute;t&eacute; collect&eacute;s, y compris aux fins de satisfaire aux exigences l&eacute;gales, comptables ou en mati&egrave;re d&rsquo;avis aux instances gouvernementales appropri&eacute;es.</p>\r\n\r\n<p>Lorsque l&rsquo;utilisation pr&eacute;vue est termin&eacute;e, vos renseignements personnels sont d&eacute;truits, supprim&eacute;s, anonymis&eacute;s ou archiv&eacute;s selon les standards des&nbsp;<em>Archives nationales du Qu&eacute;bec</em>&nbsp;ou conserv&eacute;s selon toutes autres lois nous obligeant &agrave; le faire. Notez que les renseignements anonymis&eacute;s ne permettent plus de vous identifier.</p>\r\n\r\n<p>Le Coll&egrave;ge met en place des m&eacute;canismes de s&eacute;curit&eacute; rigoureux pour prot&eacute;ger vos renseignements personnels contre la perte ou le vol, et contre l&rsquo;acc&egrave;s, la divulgation, la copie, l&rsquo;utilisation ou la modification non autoris&eacute;s.</p>\r\n\r\n<p>Les sous-traitants ayant acc&egrave;s aux renseignements personnels, dont le Coll&egrave;ge a la garde ou le contr&ocirc;le, seront inform&eacute;s de la pr&eacute;sente politique et des autres politiques et/ou processus applicables pour assurer la s&eacute;curit&eacute; et la protection des renseignements personnels. Tous les sous-traitants devront accepter de se conformer aux politiques, aux processus et aux lois avant d&rsquo;entamer leur mandat pour le Coll&egrave;ge.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Acc&egrave;s, rectification &ndash; Retrait du consentement &ndash; Plainte &agrave; l&rsquo;&eacute;gard de vos renseignements personnels</strong></p>\r\n\r\n<p><strong>&nbsp;</strong>Vous pouvez consulter les renseignements que nous d&eacute;tenons &agrave; votre sujet. Si vous y constatez des erreurs, vous pouvez demander leur correction. Vous pouvez &eacute;galement retirer votre consentement &agrave; l&rsquo;utilisation et &agrave; la communication de vos renseignements personnels ou encore porter plainte quant &agrave; la protection de ceux-ci.</p>\r\n\r\n<p>Pour exercer vos droits, adressez-vous &agrave; la personne responsable de la protection des renseignements personnels du Coll&egrave;ge : Mme&nbsp;Cathy Forget, assistante &agrave; la diretction,&nbsp;&agrave;&nbsp;<a href=\"mailto:cathyforget@leadercsa.com\">cathyforget@leadercsa.com</a> ou au <a href=\"tel:418 856-3012\">418 856-3012</a> poste 214.</p>\r\n', '/assets/images/ca-hero-image.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0),
(37, 39, 'fr', 'Erreur 404 - Page non trouvée', NULL, '<p>La page que vous tentez d&rsquo;atteindre est indisponible ou inaccessible pour le moment.</p>\r\n\r\n<p>Suggestions :</p>\r\n\r\n<ul>\r\n	<li>V&eacute;rifiez l&rsquo;adresse que vous avez saisie et corrigez-la si n&eacute;cessaire.</li>\r\n	<li>Retournez &agrave; la page d&rsquo;<a href=\"https://leadercsa.com\">accueil</a>.</li>\r\n</ul>\r\n\r\n<p>Veuillez <a href=\"/?rub=35\">signaler tout probl&egrave;me technique</a>.</p>\r\n', '/assets/images/ca-hero-image.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', '', '', 0);
INSERT INTO `sections_ml` (`id`, `originId`, `langCode`, `name`, `h1`, `field1`, `field2`, `field3`, `field4`, `field5`, `field7`, `field8`, `field9`, `field11`, `field14`, `field15`, `field17`, `field18`, `field19`, `field20`, `field21`, `field22`, `field23`, `field24`, `field25`, `field26`, `field27`, `field28`, `field29`, `field30`, `field31`, `shorturl`, `urlRewrite`, `title`, `descriptionMeta`, `canceled`) VALUES
(38, 40, 'fr', 'Protecteur de l\'élève', '', '<p>Parce que le bien-&ecirc;tre de nos jeunes est au centre de nos actions, le Coll&egrave;ge met &agrave; leur disposition une &eacute;quipe attentive et disponible pour les accompagner au quotidien. Direction, intervenants et membres du personnel travaillent ensemble pour cr&eacute;er un environnement de confiance et de respect. En dernier recours, le Protecteur de l&rsquo;&eacute;l&egrave;ve, ressource ind&eacute;pendante du gouvernement du Qu&eacute;bec, peut aussi &ecirc;tre contact&eacute;.</p>\r\n', '/assets/images/ca-hero-image.jpg', '<p><strong>Droits de l&rsquo;&eacute;l&egrave;ve et des parents</strong></p>\r\n\r\n<p>Le Protecteur national de l&rsquo;&eacute;l&egrave;ve est responsable de l&rsquo;application de la proc&eacute;dure de traitement des plaintes et des signalements dans le milieu scolaire qu&eacute;b&eacute;cois.&nbsp;</p>\r\n\r\n<p>Dans le cadre de cette proc&eacute;dure nationale et uniformis&eacute;e, le Protecteur national de l&rsquo;&eacute;l&egrave;ve peut compter sur la pr&eacute;sence, partout au Qu&eacute;bec, de protecteurs r&eacute;gionaux de l&rsquo;&eacute;l&egrave;ve. Ensemble, ils veillent &agrave; faire respecter les droits des &eacute;l&egrave;ves et de leurs parents et contribuent ainsi &agrave; l&rsquo;am&eacute;lioration continue des services offerts dans le r&eacute;seau de l&rsquo;&eacute;ducation.&nbsp;</p>\r\n\r\n<p><br />\r\n<em><strong>Porter plainte</strong></em></p>\r\n\r\n<p>En cas d&rsquo;insatisfaction au regard des services scolaires qu&rsquo;il a re&ccedil;us, qu&rsquo;il re&ccedil;oit, qu&rsquo;il aurait d&ucirc; recevoir ou qu&rsquo;il requiert, un &eacute;l&egrave;ve ou ses parents peuvent formuler une plainte selon une proc&eacute;dure comportant au plus trois &eacute;tapes :&nbsp;</p>\r\n\r\n<p><u>&Eacute;tape 1 &ndash; Personne directement concern&eacute;e ou son sup&eacute;rieur</u></p>\r\n\r\n<p style=\"margin-left: 40px;\">Pour d&eacute;poser une plainte, l&rsquo;&eacute;l&egrave;ve ou son parent s&rsquo;adresse tout d&rsquo;abord &agrave; la personne directement concern&eacute;e ou &agrave; son sup&eacute;rieur imm&eacute;diat.</p>\r\n\r\n<p style=\"margin-left: 40px;\">La plainte peut &ecirc;tre verbale, mais il est pr&eacute;f&eacute;rable de la faire par &eacute;crit.&nbsp;</p>\r\n\r\n<p style=\"margin-left: 40px;\">La personne qui re&ccedil;oit la plainte a un d&eacute;lai de 10 jours ouvrables pour y r&eacute;pondre.</p>\r\n\r\n<p><u>&Eacute;tape 2 &ndash; Responsable du traitement des plaintes</u></p>\r\n\r\n<p style=\"margin-left: 40px;\">Si l&rsquo;&eacute;l&egrave;ve ou son parent demeure insatisfait du traitement de leur plainte ou si le d&eacute;lai de 10 jours ouvrables est d&eacute;pass&eacute;, il peut ensuite s&rsquo;adresser au responsable du traitement des plaintes du centre de services scolaire, de la commission scolaire ou de l&rsquo;&eacute;tablissement d&rsquo;enseignement priv&eacute; selon le cas.&nbsp;</p>\r\n\r\n<p style=\"margin-left: 40px;\">La plainte peut &ecirc;tre verbale, mais il est pr&eacute;f&eacute;rable de la faire par &eacute;crit.&nbsp;</p>\r\n\r\n<p style=\"margin-left: 40px;\">Le responsable du traitement des plaintes dispose d&rsquo;un d&eacute;lai de 15 jours ouvrables pour y r&eacute;pondre.</p>\r\n\r\n<p style=\"margin-left: 40px;\">La personne responsable du traitement des plaintes au Coll&egrave;ge est monsieur Jonathan Daigle, directeur des services aux &eacute;l&egrave;ves. Il peut &ecirc;tre joint par t&eacute;l&eacute;phone au <a href=\"tel:418-856-3012\">418 856-3012</a> poste 346, par courriel au <a href=\"mailto:jonathandaigle@leadercsa.com\">jonathandaigle@leadercsa.com</a>&nbsp;ou par Pluriportail&shy;.</p>\r\n\r\n<p style=\"margin-left: 40px;\">Formulaire de plainte : <a href=\"https://pne.gouv.qc.ca/Anonymous/Index/a1feb0c1-fd38-4675-ab7d-d4e3f80c0fcf/portal#/portal-request-form/88a1a595-0e6a-42f6-93f5-1a7c1525b078 \">https://pne.gouv.qc.ca/Anonymous/Index/a1feb0c1-fd38-4675-ab7d-d4e3f80c0fcf/portal#/portal-request-form/88a1a595-0e6a-42f6-93f5-1a7c1525b078&nbsp;</a></p>\r\n\r\n<p><u>&Eacute;tape 3 &ndash; Protecteur r&eacute;gional de l&rsquo;&eacute;l&egrave;ve</u></p>\r\n\r\n<p style=\"margin-left: 40px;\">Si l&rsquo;&eacute;l&egrave;ve ou son parent est toujours insatisfait du traitement de sa plainte, ou si le d&eacute;lai de 15 jours ouvrables est d&eacute;pass&eacute;, il peut communiquer avec le protecteur r&eacute;gional de l&rsquo;&eacute;l&egrave;ve de sa r&eacute;gion. Celui-ci assistera l&rsquo;&eacute;l&egrave;ve ou son parent dans la formulation &eacute;crite de sa plainte.&nbsp;</p>\r\n\r\n<p style=\"margin-left: 40px;\">L&rsquo;&eacute;l&egrave;ve ou son parent peut choisir le mode de communication qui lui convient le mieux entre :&nbsp;</p>\r\n\r\n<ul style=\"margin-left: 40px;\">\r\n	<li style=\"margin-left: 40px;\">Formulaire de plainte web : <a href=\"http://pne.gouv.qc.ca/formulaire\">pne.gouv.qc.ca/formulaire</a>&nbsp;</li>\r\n	<li style=\"margin-left: 40px;\">T&eacute;l&eacute;phone ou texto: <a href=\"tel:1-833-420-5233\">1 833 420-5233</a></li>\r\n	<li style=\"margin-left: 40px;\">Courriel : <a href=\"mailto:plaintes-pne@pne.gouv.qc.ca\">plaintes-pne@pne.gouv.qc.ca</a>&nbsp;</li>\r\n</ul>\r\n\r\n<p style=\"margin-left: 40px;\">Le protecteur r&eacute;gional de l&rsquo;&eacute;l&egrave;ve dispose de 20 jours ouvrables pour examiner la plainte et &eacute;mettre ses conclusions. S&rsquo;il juge la plainte fond&eacute;e, il pourra formuler des recommandations au centre de services scolaire, &agrave; la commission scolaire ou &agrave; l&rsquo;&eacute;tablissement d&rsquo;enseignement priv&eacute;.&nbsp;</p>\r\n\r\n<p style=\"margin-left: 40px;\">Avant leur transmission, les conclusions sont cependant examin&eacute;es par le Protecteur national de l&rsquo;&eacute;l&egrave;ve, qui dispose pour sa part d&rsquo;un d&eacute;lai maximal de 5 jours ouvrables pour d&eacute;cider d&rsquo;examiner lui-m&ecirc;me la plainte. Dans cette &eacute;ventualit&eacute;, il dispose alors de 10 jours ouvrables pour en terminer l&rsquo;examen et substituer, au besoin, ses conclusions ou ses recommandations &agrave; celles du protecteur r&eacute;gional de l&rsquo;&eacute;l&egrave;ve. &nbsp;</p>\r\n\r\n<p style=\"margin-left: 40px;\">Le protecteur r&eacute;gional de l&rsquo;&eacute;l&egrave;ve informe ensuite la personne plaignante et le centre de services scolaire, la commission scolaire ou l&rsquo;&eacute;tablissement d&rsquo;enseignement priv&eacute; des conclusions, ainsi que des recommandations s&rsquo;il y a lieu.</p>\r\n\r\n<p style=\"margin-left: 40px;\">Le centre de services scolaire, la commission scolaire ou l&rsquo;&eacute;tablissement d&rsquo;enseignement priv&eacute; a 10 jours ouvrables pour informer la personne plaignante et le protecteur r&eacute;gional de l&rsquo;&eacute;l&egrave;ve des suites qu&rsquo;il entend donner aux conclusions et aux recommandations et, le cas &eacute;ch&eacute;ant, les motifs justifiant son refus d&rsquo;y donner suite.</p>\r\n\r\n<p style=\"text-align: justify; margin-left: 40px;\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><img src=\"data:image/png;base64,\" style=\"width:576px; height:300px\" /></span></span></p>\r\n\r\n<p style=\"text-align: justify; margin-left: 40px;\">&Agrave; noter qu&rsquo;en situation d&rsquo;<strong>acte de violence &agrave; caract&egrave;re sexuel</strong><sup>1</sup>, un &eacute;l&egrave;ve ou l&rsquo;un de ses parents peut s&rsquo;adresser directement au protecteur r&eacute;gional de l&rsquo;&eacute;l&egrave;ve s&rsquo;il le souhaite.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p><strong><em>Faire un signalement</em></strong></p>\r\n\r\n<p>Un signalement, qui peut &ecirc;tre fait par toute personne, n&rsquo;est possible qu&rsquo;en situation d&rsquo;acte de violence &agrave; caract&egrave;re sexuel commis &agrave; l&rsquo;endroit d&rsquo;un &eacute;l&egrave;ve qui fr&eacute;quente un &eacute;tablissement d&#39;enseignement.&nbsp;</p>\r\n\r\n<p style=\"margin-left: 40px;\">Un tel signalement est effectu&eacute; directement au protecteur r&eacute;gional de l&#39;&eacute;l&egrave;ve, sans avoir &agrave; passer par les deux premi&egrave;res &eacute;tapes du processus, par :</p>\r\n\r\n<ul style=\"margin-left: 40px;\">\r\n	<li>une enseignante ou un enseignant</li>\r\n	<li>une professionnelle ou un professionnel &oelig;uvrant en milieu scolaire</li>\r\n	<li>une employ&eacute;e ou un employ&eacute; membre de la direction d&rsquo;un &eacute;tablissement d&rsquo;enseignement</li>\r\n	<li>un autre &eacute;l&egrave;ve ou l&rsquo;un de ses parents</li>\r\n	<li>etc.</li>\r\n</ul>\r\n\r\n<p>La personne signalante pourra choisir le mode de communication qui lui convient le mieux entre :&nbsp;</p>\r\n\r\n<ul style=\"margin-left: 40px;\">\r\n	<li>Formulaire de plainte web : <a href=\"https://pne.gouv.qc.ca/Anonymous/Index/a1feb0c1-fd38-4675-ab7d-d4e3f80c0fcf/portal#/portal-request-form/7cd4e09a-a5c8-4fdb-9588-4a8d73f87640\">https://pne.gouv.qc.ca/Anonymous/Index/a1feb0c1-fd38-4675-ab7d-d4e3f80c0fcf/portal#/portal-request-form/7cd4e09a-a5c8-4fdb-9588-4a8d73f87640</a></li>\r\n	<li>T&eacute;l&eacute;phone ou texto : <a href=\"tel:1-833-420-5233\">1 833 420-5233</a></li>\r\n	<li>Courriel : <a href=\"mailto:plaintes-pne@pne.gouv.qc.ca\">plaintes-pne@pne.gouv.qc.ca</a>&nbsp;</li>\r\n</ul>\r\n\r\n<p>Les signalements sont trait&eacute;s de fa&ccedil;on urgente. La confidentialit&eacute; des renseignements identifiant la personne qui fait un signalement est pr&eacute;serv&eacute;e, sauf avec son consentement. Si requis par la loi, le protecteur r&eacute;gional de l&rsquo;&eacute;l&egrave;ve communique l&rsquo;identit&eacute; de cette personne au directeur de la protection de la jeunesse.</p>\r\n\r\n<p>Le protecteur r&eacute;gional de l&rsquo;&eacute;l&egrave;ve peut aussi traiter un cas d&rsquo;acte de violence &agrave; caract&egrave;re sexuel de sa propre initiative.</p>\r\n\r\n<p><br />\r\n<em><strong>Protection contre les repr&eacute;sailles</strong></em></p>\r\n\r\n<p>La Loi sur le protecteur national de l&rsquo;&eacute;l&egrave;ve prot&egrave;ge contre toute repr&eacute;sailles ou menaces de repr&eacute;sailles les personnes qui portent plainte ou qui font un signalement, collaborent au traitement d&rsquo;une plainte ou d&#39;un signalement ou accompagnent une personne qui formule une plainte ou un signalement.&nbsp;</p>\r\n\r\n<p>Il est &eacute;galement interdit de menacer une personne de mesures de repr&eacute;sailles pour qu&rsquo;elle s&rsquo;abstienne de porter plainte ou de faire un signalement.</p>\r\n\r\n<p>Pour l&rsquo;&eacute;l&egrave;ve ou ses parents formulant une plainte ou un signalement, sont pr&eacute;sum&eacute;es &ecirc;tre des mesures de repr&eacute;sailles :</p>\r\n\r\n<ul style=\"margin-left: 40px;\">\r\n	<li>Le fait de les priver de droits</li>\r\n	<li>L&rsquo;application d&rsquo;un traitement diff&eacute;rent</li>\r\n	<li>La suspension ou l&rsquo;expulsion de l&rsquo;&eacute;l&egrave;ve</li>\r\n</ul>\r\n\r\n<p>Pour le personnel d&rsquo;un &eacute;tablissement d&rsquo;enseignement effectuant un signalement ou collaborant &agrave; l&rsquo;examen d&#39;une plainte ou d&#39;un signalement, sont pr&eacute;sum&eacute;es &ecirc;tre des mesures de repr&eacute;sailles :</p>\r\n\r\n<ul style=\"margin-left: 40px;\">\r\n	<li>Sa r&eacute;trogradation</li>\r\n	<li>Sa suspension</li>\r\n	<li>Son cong&eacute;diement</li>\r\n	<li>Son d&eacute;placement</li>\r\n	<li>Toute sanction disciplinaire ou autre mesure portant atteinte &agrave; son emploi ou &agrave; ses conditions de travail</li>\r\n</ul>\r\n\r\n<p>Les amendes pour une personne physique qui exercera des mesures de repr&eacute;sailles ou menacera de le faire peuvent aller de 2 000 $ &agrave; 20 000 $. Ces amendes peuvent aller de 10 000 $ &agrave; 250 000 $ pour les personnes morales.<br />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px;\"><sup>1</sup> La violence &agrave; caract&egrave;re sexuel est : &laquo; toute forme de violence commise par le biais de pratiques sexuelles ou en ciblant la sexualit&eacute;, dont l&rsquo;agression sexuelle. Cette notion s&rsquo;entend &eacute;galement de toute autre inconduite qui se manifeste notamment par des gestes, paroles, comportements ou attitudes &agrave; connotation sexuelle non d&eacute;sir&eacute;s, incluant celle relative aux diversit&eacute;s sexuelles ou de genre, exprim&eacute;s directement ou indirectement, y compris par un moyen technologique. &raquo; Pour de plus amples renseignements sur les actes de violence &agrave; caract&egrave;re sexuel, vous pouvez consulter la page du gouvernement du Qu&eacute;bec sur les formes de violence.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(39, 41, 'fr', 'Tests de français', '', '<p>Contenu en d&eacute;veloppement.</p>\r\n', '/assets/images/ca-hero-image.jpg', '<p>Contenu en d&eacute;veloppement.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(40, 46, 'fr', 'Test', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(41, 47, 'fr', 'DELF/DALF', 'DELF/DALF', '<p>Le <strong>DELF </strong>(Dipl&ocirc;me d&rsquo;&eacute;tudes en langue fran&ccedil;aise) et le <strong>DALF </strong>(Dipl&ocirc;me approfondi de langue fran&ccedil;aise) sont des dipl&ocirc;mes officiels qui certifient les comp&eacute;tences en fran&ccedil;ais langue seconde, du niveau d&eacute;butant (A1) au niveau expert (C2). Ils sont con&ccedil;us et d&eacute;livr&eacute;s par France &Eacute;ducation international, op&eacute;rateur du minist&egrave;re fran&ccedil;ais de l&rsquo;&Eacute;ducation nationale, et reconnus internationalement par divers organismes dont Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) et le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI).</p>\r\n', '/assets/images/DELF_DALF.png', '<p><span style=\"font-size:24px;\"><span style=\"line-height:24px;\"><u><strong>DELF / DALF</strong></u></span></span></p>\r\n\r\n<p>Chaque &eacute;l&egrave;ve international inscrit &agrave; l&#39;&Eacute;cole d&rsquo;immersion fran&ccedil;aise du Coll&egrave;ge a l&rsquo;occasion de passer le test DELF Junior/Scolaire en fin d&#39;ann&eacute;e scolaire. Fait int&eacute;ressant : ce dipl&ocirc;me est bon &agrave; vie!</p>\r\n\r\n<p>Dates des prochaines sessions : <i>&Agrave; venir</i></p>\r\n\r\n<p>Tarifs&nbsp;: <em>&Agrave; venir</em></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le&nbsp;<a href=\"https://www.france-education-international.fr/diplome/delf-tout-public?langue=fr\" target=\"_blank\">DELF Tout public</a></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le&nbsp;<a href=\"https://www.france-education-international.fr/diplome/delf-junior-scolaire?langue=fr\" target=\"_blank\">DELF Junior/Scolaire</a></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le&nbsp;<a href=\"https://www.france-education-international.fr/diplome/delf-prim?langue=fr\" target=\"_blank\">DELF Prim</a></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le&nbsp;<a href=\"https://www.france-education-international.fr/diplome/dalf?langue=fr\" target=\"_blank\">DALF</a></p>\r\n\r\n<p>Contactez madame &Eacute;lise Mercier afin de vous inscrire!&nbsp;</p>\r\n\r\n<p><strong>Contact</strong><br />\r\n&Eacute;lise Mercier<br />\r\nAgente de d&eacute;veloppement<br />\r\nelisemercier@leadercsa.com<br />\r\n418 856-3012 poste 340</p>\r\n\r\n<p><span style=\"line-height:12px;\"><span style=\"font-size:14px;\"><em>Veuillez noter que nous ne pouvons pas r&eacute;pondre aux questions li&eacute;es aux d&eacute;marches d&rsquo;immigration. Pour toute information &agrave; ce sujet, il faut communiquer directement avec Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) ou avec le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI) du Qu&eacute;bec.</em></span></span></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(42, 48, 'fr', 'TCF', 'TCF', '<p>Le <strong>TCF </strong>(Test de connaissance du fran&ccedil;ais) est un examen officiel qui &eacute;value les comp&eacute;tences g&eacute;n&eacute;rales en fran&ccedil;ais, que ce soit pour des besoins d&rsquo;&eacute;tudes, d&rsquo;immigration ou de naturalisation. Il est con&ccedil;u et administr&eacute; par France &Eacute;ducation international, op&eacute;rateur du minist&egrave;re fran&ccedil;ais de l&rsquo;&Eacute;ducation nationale, et reconnu par plusieurs organismes dont Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) et le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI) du Qu&eacute;bec.</p>\r\n', '/assets/images/tcf2.png', '<p><span style=\"font-size:24px;\"><u><strong>TCF</strong></u></span></p>\r\n\r\n<p>Dates des prochaines sessions : <i>&Agrave; venir</i></p>\r\n\r\n<p>Tarifs&nbsp;: &Agrave; venir</p>\r\n\r\n<p><span style=\"display: inline !important;\">Pour vous inscrire :&nbsp;<em>Lien &agrave; venir</em></span></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le <a href=\"https://www.france-education-international.fr/test/tcf-canada?langue=fr\" target=\"_blank\">TCF Canada</a></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le <a href=\"https://www.france-education-international.fr/test/tcf-quebec?langue=fr\" target=\"_blank\">TCF Qu&eacute;bec</a></p>\r\n\r\n<p><strong>Contact</strong><br />\r\n&Eacute;lise Mercier<br />\r\nAgente de d&eacute;veloppement<br />\r\nelisemercier@leadercsa.com<br />\r\n418 856-3012 poste 340</p>\r\n\r\n<p><span style=\"line-height:12px;\"><span style=\"font-size:14px;\"><em>Veuillez noter que nous ne pouvons pas r&eacute;pondre aux questions li&eacute;es aux d&eacute;marches d&rsquo;immigration. Pour toute information &agrave; ce sujet, il faut communiquer directement avec Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) ou avec le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI) du Qu&eacute;bec.</em></span></span></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0);
INSERT INTO `sections_ml` (`id`, `originId`, `langCode`, `name`, `h1`, `field1`, `field2`, `field3`, `field4`, `field5`, `field7`, `field8`, `field9`, `field11`, `field14`, `field15`, `field17`, `field18`, `field19`, `field20`, `field21`, `field22`, `field23`, `field24`, `field25`, `field26`, `field27`, `field28`, `field29`, `field30`, `field31`, `shorturl`, `urlRewrite`, `title`, `descriptionMeta`, `canceled`) VALUES
(43, 49, 'fr', 'TEF Canada / TEF Québec (TEFAQ)', 'TEF Canada / TEF Québec (TEFAQ)', '<p>Le <strong>TEF </strong>(Test d&rsquo;&eacute;valuation de fran&ccedil;ais) et le <strong>TEFAQ </strong>(Test d&rsquo;&eacute;valuation de fran&ccedil;ais adapt&eacute; pour le Qu&eacute;bec) sont des examens officiels qui mesurent les comp&eacute;tences en fran&ccedil;ais &agrave; des fins d&rsquo;immigration, d&rsquo;&eacute;tudes ou de citoyennet&eacute;. Ils sont con&ccedil;us et g&eacute;r&eacute;s par la Chambre de commerce et d&rsquo;industrie de Paris &Icirc;le-de-France (CCI Paris &Icirc;le-de-France) et reconnus par divers organismes dont Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) et le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI).</p>\r\n', '/assets/images/tef_tefaq_cci2.png', '<p><u><strong><span style=\"font-size:24px;\">TEF Canada / TEF Qu&eacute;bec (TEFAQ)</span></strong></u></p>\r\n\r\n<p>Sessions hebdomadaires pendant l&rsquo;ann&eacute;e scolaire et bimensuelles en &eacute;t&eacute; &agrave; La Pocati&egrave;re<br />\r\nSessions&nbsp;hebdomadaires &agrave; Montr&eacute;al<br />\r\nSessions hebdomadaires &agrave; Qu&eacute;bec</p>\r\n\r\n<p>D&eacute;couvrez en plus&nbsp;sur le <a href=\"https://www.lefrancaisdesaffaires.fr/candidat/test-evaluation-francais/\">TEF</a>!</p>\r\n\r\n<p><strong>Inscrivez-vous &agrave; nos prochaines sessions</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-373/produit-2\">TEF Canada &agrave; La Pocati&egrave;re</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;-&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-373/produit-4\">TEF Qu&eacute;bec (TEFAQ) &agrave; La Pocati&egrave;re</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-990/produit-2\">TEF Canada &agrave; Qu&eacute;bec</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-990/produit-4\">TEF Qu&eacute;bec (TEFAQ) &agrave; Qu&eacute;bec</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-989/produit-2\">TEF Canada &agrave; Montr&eacute;al</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;<a href=\"https://francais.cci-paris-idf.fr/inscription-candidat/centre-989/produit-4\">TEF Qu&eacute;bec (TEFAQ) &agrave; Montr&eacute;al</a></p>\r\n\r\n<p style=\"margin-left: 40px;\">Le jour suivant votre pr&eacute;inscription, vous recevrez un courriel afin de proc&eacute;der rapidement au paiement. C&#39;est votre paiement qui confirmera officiellement&nbsp;votre inscription.</p>\r\n\r\n<p style=\"margin-left: 40px;\">Quelques jours avant votre test, vous recevrez un dernier courriel avec toutes les informations pratiques (p. ex. heure de convocation, pi&egrave;ces d&rsquo;identit&eacute; n&eacute;cessaire et&nbsp;consignes).</p>\r\n\r\n<p><strong>Contactez les centres de passation de La Pocati&egrave;re et de Qu&eacute;bec</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &Eacute;lise Mercier<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Agente de d&eacute;veloppement<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"mailto:tef@leadercsa.com\">tef@leadercsa.com</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"tel:418 292-2001\">418 292-2001</a></p>\r\n\r\n<p><strong>Contactez le centre de passation de Montr&eacute;al</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"mailto:tef.mtl@leadercsa.com\">tef.mtl@leadercsa.com</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"tel:418 292-2001\">418 292-2001</a></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"line-height:12px;\"><em>Veuillez noter que nous ne pouvons pas r&eacute;pondre aux questions li&eacute;es aux d&eacute;marches d&rsquo;immigration. Pour toute information &agrave; ce sujet, il faut communiquer directement avec Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) ou avec le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI) du Qu&eacute;bec.</em></span></span></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(44, 50, 'fr', 'DFP', 'DFP', '<p>Le <strong>DFP </strong>(Dipl&ocirc;me de fran&ccedil;ais professionnel) est une certification officielle qui atteste des comp&eacute;tences en fran&ccedil;ais dans un contexte de travail et de communication professionnelle. Il est con&ccedil;u et d&eacute;livr&eacute; par la Chambre de commerce et d&rsquo;industrie de Paris &Icirc;le-de-France (CCI Paris &Icirc;le-de-France) et reconnu &agrave; l&rsquo;international par des entreprises, des institutions &eacute;ducatives et divers organismes professionnels.</p>\r\n', '/assets/images/dfp_cci2.png', '<p><span style=\"font-size:24px;\"><u><strong>DFP</strong></u></span></p>\r\n\r\n<p>Dates des prochaines sessions : <i>&Agrave; venir</i><br />\r\nTarifs&nbsp;: &Agrave; venir<br />\r\nPour vous inscrire :&nbsp;<em>Lien &agrave; venir</em></p>\r\n\r\n<p>D&eacute;couvrez en plus sur le <a href=\"https://www.lefrancaisdesaffaires.fr/candidat/diplomes-francais-professionnel/\" target=\"_blank\">DFP</a></p>\r\n\r\n<p><strong>Contact</strong><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &Eacute;lise Mercier<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Agente de d&eacute;veloppement<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"mailto:elisemercier@leadercsa.com\">elisemercier@leadercsa.com</a><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"tel:418 292-2001\">418 292-2001</a></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"line-height:12px;\"><em>Veuillez noter que nous ne pouvons pas r&eacute;pondre aux questions li&eacute;es aux d&eacute;marches d&rsquo;immigration. Pour toute information &agrave; ce sujet, il faut communiquer directement avec Immigration, R&eacute;fugi&eacute;s et Citoyennet&eacute; Canada (IRCC) ou avec le minist&egrave;re de l&rsquo;Immigration, de la Francisation et de l&rsquo;Int&eacute;gration (MIFI) du Qu&eacute;bec.</em></span></span></p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(45, 51, 'fr', 'TFI', 'TFI', '<p>Section en construction</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(46, 52, 'fr', 'TFI', 'TFI', '<p>Ce test n&#39;est plus offert.</p>\r\n', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(47, 53, 'fr', 'Centres de passation d\'examens de français', 'Centre de passation d\'examens de français', '<p>Reconnu pour la qualit&eacute; de son enseignement et son expertise en francisation, le Coll&egrave;ge est &eacute;galement un centre officiel de passation d&rsquo;examens de fran&ccedil;ais. Nous offrons, tout au long de l&rsquo;ann&eacute;e scolaire, plusieurs tests et dipl&ocirc;mes reconnus internationalement tels que le TEF/TEFAQ, le TCF, le DELF/DALF et le DFP.</p>\r\n', '/assets/images/hero-image-direction-generale.jpg', '<p>Avec plusieurs sessions offertes chaque mois dans&nbsp;nos trois centres de passation d&#39;examens de fran&ccedil;ais, nous accueillons des centaines de candidats chaque ann&eacute;e. Ceux-ci b&eacute;n&eacute;ficient d&rsquo;un confort optimal : salles d&rsquo;examen &eacute;quip&eacute;es de mat&eacute;riel informatique de haute qualit&eacute;, salles d&rsquo;attente r&eacute;cemment am&eacute;nag&eacute;es et cadres enchanteurs favorisant la concentration et la r&eacute;ussite.</p>\r\n\r\n<p>Notre &eacute;quipe bienveillante et professionnelle assure une ambiance rassurante, en accompagnant chaque candidat avec respect et patience, afin de leur offrir une exp&eacute;rience humaine et sereine.</p>\r\n\r\n<h4><strong>TROIS CENTRES, UN SEUL NUM&Eacute;RO : <a href=\"tel:418 292-2001\">418 292-2001</a></strong></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><u>La Pocati&egrave;re</u></strong><br />\r\n100, 4e avenue Painchaud<br />\r\nLa Pocati&egrave;re (QC)&nbsp;G0R 1Z0<br />\r\n<a href=\"mailto:tef@leadercsa.com\">tef@leadercsa.com</a></p>\r\n\r\n<p style=\"margin-left: 40px;\">Id&eacute;alement situ&eacute; &agrave; 60 minutes de Qu&eacute;bec, 45 minutes de Rivi&egrave;re-du-Loup et 1 h 50 de Rimouski, le Coll&egrave;ge est facilement accessible en voiture comme en autocar (arr&ecirc;t Orl&eacute;ans Express &agrave; 2 minutes de marche).&nbsp;Notre centre, qui est LA r&eacute;f&eacute;rence dans l&#39;est de la province, allie le charme d&rsquo;un environnement calme &agrave; la qualit&eacute; d&rsquo;un encadrement personnalis&eacute;, offrant aux candidats une exp&eacute;rience &agrave; la fois humaine et professionnelle.</p>\r\n\r\n<p><strong><u>Montr&eacute;al</u></strong><br />\r\n1071, rue Saint-Urbain, bureau 117<br />\r\nMontr&eacute;al (QC) H2Z 9Y9<br />\r\n<a href=\"mailto:tef.mtl@leadercsa.com\">tef.mtl@leadercsa.com</a></p>\r\n\r\n<p style=\"margin-left: 40px;\">Situ&eacute; au c&oelig;ur du centre-ville, notre centre d&rsquo;examen de Montr&eacute;al est facilement accessible en transport en commun, &agrave; proximit&eacute; du Quartier des spectacles et du m&eacute;tro Place-des-Arts. Les candidats profitent d&rsquo;un environnement moderne et accueillant, id&eacute;al pour se pr&eacute;senter &agrave; leur &eacute;valuation en toute confiance.</p>\r\n\r\n<p><strong><u>Ville de Qu&eacute;bec</u></strong><br />\r\n1015, avenue Wilfrid-Pelletier, bureau 480<br />\r\nQu&eacute;bec (QC) G1W 0C4<br />\r\n<a href=\"mailto:???????tef@leadercsa.com\">tef@leadercsa.com</a></p>\r\n\r\n<p style=\"margin-left: 40px;\">Voisin de l&rsquo;autoroute Henri-IV, notre centre de Qu&eacute;bec se distingue par son accessibilit&eacute; et son confort. Les candidats y trouvent des installations modernes, un stationnement facile et une ambiance professionnelle qui favorise la r&eacute;ussite.</p>\r\n\r\n<p style=\"margin-left: 40px;\">&nbsp;</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0),
(48, 54, 'fr', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 0);
INSERT INTO `studentServices` (`id`, `category`, `ranking`, `image`, `field1`, `field2`, `field3`, `field5`, `field7`, `field11`, `field12`, `field13`, `field14`, `field15`, `creationDate`, `creationHour`, `updateDate`, `updateHour`, `ogimage`, `visible`) VALUES
(1, 0, 2, '/assets/images/services-aux-eleves/services-aux-eleves-image-01.jpg', NULL, '<p>Notre &eacute;quipe dynamique et exp&eacute;riment&eacute;e d&#39;&eacute;ducateurs assure une pr&eacute;sence rassurante et &eacute;nergique aupr&egrave;s de tous les &eacute;l&egrave;ves, chaque jour. La vie &eacute;tudiante au Coll&egrave;ge est riche en activit&eacute;s vari&eacute;es, permettant &agrave; chacun de d&eacute;velopper ses talents et de cultiver ses passions. Elles enrichissent l&rsquo;exp&eacute;rience scolaire et leur permettent de grandir dans un environnement chaleureux et stimulant.</p>\r\n\r\n<p>Qu&#39;il s&#39;agisse d&#39;arts, de sports ou d&#39;engagement communautaire, nos &eacute;l&egrave;ves b&acirc;tissent des amiti&eacute;s durables et vivent des exp&eacute;riences inoubliables qui les accompagneront toute leur vie.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '23:59:23', '2025-05-11', '23:59:39', NULL, 1),
(2, 0, 3, '/assets/images/services-aux-eleves/services-aux-eleves-image-02.jpg', NULL, '<p>Face aux d&eacute;fis que rencontrent les adolescents dans leur qu&ecirc;te de sens, notre animateur de vie spirituelle et d&#39;engagement communautaire est un partenaire pr&eacute;cieux et complice bienveillant. Pr&eacute;sent au quotidien, il accompagne nos &eacute;l&egrave;ves pour les aider &agrave; d&eacute;couvrir et &agrave; affirmer leur identit&eacute;. Il est &agrave; leurs c&ocirc;t&eacute;s dans les moments d&#39;espoir comme dans les p&eacute;riodes plus difficiles, offrant &eacute;coute et soutien.</p>\r\n\r\n<p>Gr&acirc;ce &agrave; des activit&eacute;s enrichissantes, nos &eacute;l&egrave;ves sont invit&eacute;s &agrave; r&eacute;fl&eacute;chir sur des valeurs essentielles telles que la vie, l&#39;ouverture aux autres, le pardon, l&#39;espoir et la solidarit&eacute;. Ils apprennent ainsi &agrave; int&eacute;grer ces principes dans leur quotidien, devenant des citoyens responsables et respectueux des diff&eacute;rences.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-11', '23:59:46', '2025-05-12', '00:00:01', NULL, 1),
(3, 0, 4, '/assets/images/services-aux-eleves/services-aux-eleves-image-03.jpg', NULL, '<p>Notre biblioth&egrave;que, avec ses nombreux ouvrages et son architecture unique, est bien plus qu&rsquo;un simple lieu de lecture. C &#39;est un lieu d&rsquo;inspiration et de r&eacute;f&eacute;rence o&ugrave; les &eacute;l&egrave;ves aiment se retrouver pour lire, &eacute;tudier ou simplement s&#39;&eacute;vader.</p>\r\n\r\n<p>Prof. Secours, un service de tutorat gratuit offert deux fois par semaine&nbsp;par un enseignant qualifi&eacute;, est disponible pour nos &eacute;l&egrave;ves faisant partie de notre programme Volleyball.<br />\r\n<br />\r\nNos &eacute;l&egrave;ves ont acc&egrave;s &agrave; Internet et peuvent imprimer leurs travaux, b&eacute;n&eacute;ficiant d&rsquo;un espace propice aux &eacute;tudes et &agrave; la recherche. Situ&eacute; &agrave; proximit&eacute;, le Centre d&#39;archives de la C&ocirc;te-du-Sud pr&eacute;serve des tr&eacute;sors historiques, permettant aux &eacute;l&egrave;ves d&rsquo;acc&eacute;der &agrave; un patrimoine riche et diversifi&eacute;.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-12', '00:00:07', '2025-09-08', '15:12:06', NULL, 1),
(4, 0, 5, '/assets/images/services-aux-eleves/services-aux-eleves-image-04.jpg', NULL, '<p>Choisir son avenir professionnel est une &eacute;tape importante et parfois d&eacute;licate. C&#39;est pourquoi notre conseiller en orientation est disponible pour guider nos &eacute;l&egrave;ves dans leurs choix. Qu&#39;il s&#39;agisse de s&eacute;lectionner les options pour l&#39;ann&eacute;e suivante, de s&#39;informer sur les programmes du secondaire professionnel, de conna&icirc;tre les pr&eacute;requis pour le c&eacute;gep ou de r&eacute;fl&eacute;chir &agrave; un parcours universitaire, nos &eacute;l&egrave;ves b&eacute;n&eacute;ficient d&#39;un accompagnement personnalis&eacute;.</p>\r\n\r\n<p>En tenant compte de leurs aptitudes, de leurs int&eacute;r&ecirc;ts et de leurs valeurs, nous aidons chaque &eacute;l&egrave;ve &agrave; explorer ses r&ecirc;ves et &agrave; construire un projet d&#39;avenir solide.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-12', '00:00:29', '2025-06-23', '18:29:28', NULL, 1),
(5, 0, 6, '/assets/images/services-aux-eleves/services-aux-eleves-image-05.jpg', NULL, '<p>Conscients de l&#39;importance de la pr&eacute;vention et de l&rsquo;accompagnement en mati&egrave;re de d&eacute;pendances, nous offrons tout au long de l&#39;ann&eacute;e des ateliers de sensibilisation.</p>\r\n\r\n<p>Pour les &eacute;l&egrave;ves qui expriment des besoins sp&eacute;cifiques ou qui rencontrent des difficult&eacute;s li&eacute;es &agrave; la d&eacute;pendance, une ressource sp&eacute;cialis&eacute;e, en partenariat avec le Centre La Mont&eacute;e, assure un suivi individuel et confidentiel, leur offrant un soutien adapt&eacute; &agrave; leur situation. Au besoin, nous collaborons avec des ressources externes sp&eacute;cialis&eacute;es pour un accompagnement compl&eacute;mentaire, assurant ainsi que chaque jeune re&ccedil;oive l&rsquo;aide n&eacute;cessaire pour d&eacute;velopper des habitudes de vie saines.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-12', '00:00:53', '2025-06-23', '18:29:46', NULL, 1),
(6, 0, 7, '/assets/images/services-aux-eleves/services-aux-eleves-image-06.jpg', NULL, '<p>Qu&rsquo;il s&rsquo;agisse de crises personnelles, de conflits relationnels ou de d&eacute;fis scolaires, notre intervenante en psycho&eacute;ducation est l&agrave; pour offrir un soutien imm&eacute;diat aux &eacute;l&egrave;ves en difficult&eacute;. Gr&acirc;ce &agrave; une &eacute;coute attentive et &agrave; des interventions adapt&eacute;es, elle aide chaque jeune &agrave; retrouver son &eacute;quilibre et &agrave; renforcer ses capacit&eacute;s d&rsquo;adaptation.</p>\r\n\r\n<p>Travaillant en collaboration avec les enseignants et les parents, elle oriente les &eacute;l&egrave;ves vers des ressources externes si n&eacute;cessaire, pour un accompagnement plus cibl&eacute;. En compl&eacute;ment, des ateliers de pr&eacute;vention et de d&eacute;veloppement personnel sont organis&eacute;s tout au long de l&rsquo;ann&eacute;e. Notre service d&#39;intervention sociale contribue ainsi &agrave; cr&eacute;er un environnement s&eacute;curisant et &eacute;panouissant pour chaque &eacute;l&egrave;ve.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-12', '00:01:12', '2025-05-12', '00:01:33', NULL, 1),
(7, 0, 8, '/assets/images/services-aux-eleves/services-aux-eleves-image-07.jpg', NULL, '<p>Notre institution a son propre personnel affect&eacute; aux services alimentaires compos&eacute; de gens exp&eacute;riment&eacute;s et d&eacute;vou&eacute;s. Chaque midi, nous offrons des repas vari&eacute;s et &eacute;quilibr&eacute;s, r&eacute;pondant aux besoins nutritionnels de nos &eacute;l&egrave;ves. Des micro-ondes sont &eacute;galement disponibles pour ceux qui pr&eacute;f&egrave;rent apporter leur repas.</p>\r\n\r\n<p>En tant que lieu d&rsquo;accueil, le Coll&egrave;ge se distingue par sa qualit&eacute; de restauration et d&rsquo;h&eacute;bergement, accueillant &eacute;galement divers groupes ext&eacute;rieurs, des &eacute;v&eacute;nements corporatifs et un programme estival reconnu, le programme Explore, o&ugrave; plus de 26 000 repas sont servis chaque &eacute;t&eacute;.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-12', '00:02:04', '2025-05-12', '00:02:21', NULL, 1),
(8, 0, 9, '/assets/images/services-aux-eleves/services-aux-eleves-image-08.jpg', NULL, '<section>\r\n<p>Gr&acirc;ce &agrave; un partenariat avec le Centre de sant&eacute; et de services sociaux de Kamouraska, une infirmi&egrave;re est pr&eacute;sente une journ&eacute;e par semaine au sein de notre &eacute;tablissement. Elle propose des activit&eacute;s de sensibilisation en groupe, des rencontres individuelles et des r&eacute;f&eacute;rences vers des sp&eacute;cialistes, offrant ainsi un soutien complet &agrave; nos &eacute;l&egrave;ves.</p>\r\n\r\n<p>En cas de malaise ou d&#39;urgence, notre personnel form&eacute; est disponible en tout temps au Coll&egrave;ge pour intervenir rapidement. De plus, notre proximit&eacute; avec un h&ocirc;pital et un CLSC, situ&eacute;s &agrave; quelques minutes, assure un acc&egrave;s rapide aux soins n&eacute;cessaires.</p>\r\n</section>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-12', '00:02:27', '2025-05-12', '00:02:51', NULL, 1),
(9, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-09-08', '15:07:45', NULL, NULL, NULL, 0);
INSERT INTO `studentServices_f` (`id`, `originId`, `category`, `ranking`, `name`, `image`, `field1`, `field2`, `field3`, `field4`, `field5`, `field6`, `field7`, `field8`, `field9`, `field10`, `field11`, `field12`, `field13`, `field14`, `field15`) VALUES
(1, 0, '', '\"rank\":1, \r\n\"type\":4, \r\n\"width\":50, \r\n\"name\":\"Numéro\",\n\"help\":\"Pour l\'ordre d\'apparition sur le site\"', '\"rank\":2, \r\n\"type\":4, \r\n\"width\":900, \r\n\"name\":\"Nom\"', '\"rank\":5, \r\n\"type\":14,\r\n\"name\":\"Image\",\r\n\"folder\":\"services-aux-eleves\"', '', '\"rank\":4, \r\n\"type\":10, \r\n\"width\":900, \r\n\"name\":\"Description\"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `studentServices_ml` (`id`, `originId`, `langCode`, `name`, `field1`, `field2`, `field3`, `field4`, `field6`, `field7`, `field8`, `field9`, `field10`, `field11`, `field12`, `urlRewrite`, `title`, `descriptionMeta`, `h1`) VALUES
(1, 1, 'fr', 'Animation de vie étudiante', NULL, '<p>Notre &eacute;quipe dynamique et exp&eacute;riment&eacute;e d&#39;&eacute;ducateurs assure une pr&eacute;sence rassurante et &eacute;nergique aupr&egrave;s de tous les &eacute;l&egrave;ves, chaque jour. La vie &eacute;tudiante au Coll&egrave;ge est riche en activit&eacute;s vari&eacute;es, permettant &agrave; chacun de d&eacute;velopper ses talents et de cultiver ses passions. Elles enrichissent l&rsquo;exp&eacute;rience scolaire et leur permettent de grandir dans un environnement chaleureux et stimulant.</p>\r\n\r\n<p>Qu&#39;il s&#39;agisse d&#39;arts, de sports ou d&#39;engagement communautaire, nos &eacute;l&egrave;ves b&acirc;tissent des amiti&eacute;s durables et vivent des exp&eacute;riences inoubliables qui les accompagneront toute leur vie.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 2, 'fr', 'Animation de vie spirituelle', NULL, '<p>Face aux d&eacute;fis que rencontrent les adolescents dans leur qu&ecirc;te de sens, notre animateur de vie spirituelle et d&#39;engagement communautaire est un partenaire pr&eacute;cieux et complice bienveillant. Pr&eacute;sent au quotidien, il accompagne nos &eacute;l&egrave;ves pour les aider &agrave; d&eacute;couvrir et &agrave; affirmer leur identit&eacute;. Il est &agrave; leurs c&ocirc;t&eacute;s dans les moments d&#39;espoir comme dans les p&eacute;riodes plus difficiles, offrant &eacute;coute et soutien.</p>\r\n\r\n<p>Gr&acirc;ce &agrave; des activit&eacute;s enrichissantes, nos &eacute;l&egrave;ves sont invit&eacute;s &agrave; r&eacute;fl&eacute;chir sur des valeurs essentielles telles que la vie, l&#39;ouverture aux autres, le pardon, l&#39;espoir et la solidarit&eacute;. Ils apprennent ainsi &agrave; int&eacute;grer ces principes dans leur quotidien, devenant des citoyens responsables et respectueux des diff&eacute;rences.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 3, 'fr', 'Bibliothèque', NULL, '<p>Notre biblioth&egrave;que, avec ses nombreux ouvrages et son architecture unique, est bien plus qu&rsquo;un simple lieu de lecture. C &#39;est un lieu d&rsquo;inspiration et de r&eacute;f&eacute;rence o&ugrave; les &eacute;l&egrave;ves aiment se retrouver pour lire, &eacute;tudier ou simplement s&#39;&eacute;vader.</p>\r\n\r\n<p>Prof. Secours, un service de tutorat gratuit offert deux fois par semaine&nbsp;par un enseignant qualifi&eacute;, est disponible pour nos &eacute;l&egrave;ves faisant partie de notre programme Volleyball.<br />\r\n<br />\r\nNos &eacute;l&egrave;ves ont acc&egrave;s &agrave; Internet et peuvent imprimer leurs travaux, b&eacute;n&eacute;ficiant d&rsquo;un espace propice aux &eacute;tudes et &agrave; la recherche. Situ&eacute; &agrave; proximit&eacute;, le Centre d&#39;archives de la C&ocirc;te-du-Sud pr&eacute;serve des tr&eacute;sors historiques, permettant aux &eacute;l&egrave;ves d&rsquo;acc&eacute;der &agrave; un patrimoine riche et diversifi&eacute;.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 4, 'fr', 'Orientation scolaire', NULL, '<p>Choisir son avenir professionnel est une &eacute;tape importante et parfois d&eacute;licate. C&#39;est pourquoi notre conseiller en orientation est disponible pour guider nos &eacute;l&egrave;ves dans leurs choix. Qu&#39;il s&#39;agisse de s&eacute;lectionner les options pour l&#39;ann&eacute;e suivante, de s&#39;informer sur les programmes du secondaire professionnel, de conna&icirc;tre les pr&eacute;requis pour le c&eacute;gep ou de r&eacute;fl&eacute;chir &agrave; un parcours universitaire, nos &eacute;l&egrave;ves b&eacute;n&eacute;ficient d&#39;un accompagnement personnalis&eacute;.</p>\r\n\r\n<p>En tenant compte de leurs aptitudes, de leurs int&eacute;r&ecirc;ts et de leurs valeurs, nous aidons chaque &eacute;l&egrave;ve &agrave; explorer ses r&ecirc;ves et &agrave; construire un projet d&#39;avenir solide.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 5, 'fr', 'Intervention en dépendance', NULL, '<p>Conscients de l&#39;importance de la pr&eacute;vention et de l&rsquo;accompagnement en mati&egrave;re de d&eacute;pendances, nous offrons tout au long de l&#39;ann&eacute;e des ateliers de sensibilisation.</p>\r\n\r\n<p>Pour les &eacute;l&egrave;ves qui expriment des besoins sp&eacute;cifiques ou qui rencontrent des difficult&eacute;s li&eacute;es &agrave; la d&eacute;pendance, une ressource sp&eacute;cialis&eacute;e, en partenariat avec le Centre La Mont&eacute;e, assure un suivi individuel et confidentiel, leur offrant un soutien adapt&eacute; &agrave; leur situation. Au besoin, nous collaborons avec des ressources externes sp&eacute;cialis&eacute;es pour un accompagnement compl&eacute;mentaire, assurant ainsi que chaque jeune re&ccedil;oive l&rsquo;aide n&eacute;cessaire pour d&eacute;velopper des habitudes de vie saines.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 6, 'fr', 'Intervention sociale', NULL, '<p>Qu&rsquo;il s&rsquo;agisse de crises personnelles, de conflits relationnels ou de d&eacute;fis scolaires, notre intervenante en psycho&eacute;ducation est l&agrave; pour offrir un soutien imm&eacute;diat aux &eacute;l&egrave;ves en difficult&eacute;. Gr&acirc;ce &agrave; une &eacute;coute attentive et &agrave; des interventions adapt&eacute;es, elle aide chaque jeune &agrave; retrouver son &eacute;quilibre et &agrave; renforcer ses capacit&eacute;s d&rsquo;adaptation.</p>\r\n\r\n<p>Travaillant en collaboration avec les enseignants et les parents, elle oriente les &eacute;l&egrave;ves vers des ressources externes si n&eacute;cessaire, pour un accompagnement plus cibl&eacute;. En compl&eacute;ment, des ateliers de pr&eacute;vention et de d&eacute;veloppement personnel sont organis&eacute;s tout au long de l&rsquo;ann&eacute;e. Notre service d&#39;intervention sociale contribue ainsi &agrave; cr&eacute;er un environnement s&eacute;curisant et &eacute;panouissant pour chaque &eacute;l&egrave;ve.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 7, 'fr', 'Services alimentaires', NULL, '<p>Notre institution a son propre personnel affect&eacute; aux services alimentaires compos&eacute; de gens exp&eacute;riment&eacute;s et d&eacute;vou&eacute;s. Chaque midi, nous offrons des repas vari&eacute;s et &eacute;quilibr&eacute;s, r&eacute;pondant aux besoins nutritionnels de nos &eacute;l&egrave;ves. Des micro-ondes sont &eacute;galement disponibles pour ceux qui pr&eacute;f&egrave;rent apporter leur repas.</p>\r\n\r\n<p>En tant que lieu d&rsquo;accueil, le Coll&egrave;ge se distingue par sa qualit&eacute; de restauration et d&rsquo;h&eacute;bergement, accueillant &eacute;galement divers groupes ext&eacute;rieurs, des &eacute;v&eacute;nements corporatifs et un programme estival reconnu, le programme Explore, o&ugrave; plus de 26 000 repas sont servis chaque &eacute;t&eacute;.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 8, 'fr', 'Services de santé', NULL, '<section>\r\n<p>Gr&acirc;ce &agrave; un partenariat avec le Centre de sant&eacute; et de services sociaux de Kamouraska, une infirmi&egrave;re est pr&eacute;sente une journ&eacute;e par semaine au sein de notre &eacute;tablissement. Elle propose des activit&eacute;s de sensibilisation en groupe, des rencontres individuelles et des r&eacute;f&eacute;rences vers des sp&eacute;cialistes, offrant ainsi un soutien complet &agrave; nos &eacute;l&egrave;ves.</p>\r\n\r\n<p>En cas de malaise ou d&#39;urgence, notre personnel form&eacute; est disponible en tout temps au Coll&egrave;ge pour intervenir rapidement. De plus, notre proximit&eacute; avec un h&ocirc;pital et un CLSC, situ&eacute;s &agrave; quelques minutes, assure un acc&egrave;s rapide aux soins n&eacute;cessaires.</p>\r\n</section>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 9, 'fr', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `successSupport` (`id`, `category`, `ranking`, `image`, `field1`, `field2`, `field3`, `field5`, `field7`, `field11`, `field12`, `field13`, `field14`, `field15`, `creationDate`, `creationHour`, `updateDate`, `updateHour`, `ogimage`, `visible`) VALUES
(1, 0, 1, '/assets/images/aide-a-la-reussite/aide-a-la-reussite-image-01.jpg', NULL, '<p>Nous mettons tout en &oelig;uvre pour que chaque &eacute;l&egrave;ve puisse atteindre son plein potentiel. En plus des s&eacute;ances de r&eacute;cup&eacute;ration gratuites dans les mati&egrave;res de base, nous sommes fiers de compter sur l&rsquo;expertise d&rsquo;une orthop&eacute;dagogue. Que ce soit pour b&acirc;tir de solides m&eacute;thodes de travail, surmonter les difficult&eacute;s en fran&ccedil;ais ou en math&eacute;matiques, ou encore offrir un soutien sp&eacute;cifique pour des d&eacute;fis comme la dyslexie, la dysorthographie, la concentration et l&rsquo;hyperactivit&eacute;, notre orthop&eacute;dagogue apporte un soutien quotidien, personnalis&eacute; et bienveillant. Au fil du temps, les obstacles s&rsquo;amenuisent, et chaque &eacute;l&egrave;ve peut progresser avec confiance vers la r&eacute;ussite scolaire &ndash; et ce, sans frais suppl&eacute;mentaires.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-12', '00:10:52', '2025-05-12', '00:12:47', NULL, 1),
(2, 0, 2, '/assets/images/aide-a-la-reussite/aide-a-la-reussite-image-02.jpg', NULL, '<p>Un jeune sur trois qui fr&eacute;quente le CSA a besoin de mesures d&rsquo;appui pour poursuivre son parcours scolaire avec succ&egrave;s.</p>\r\n\r\n<p>C&rsquo;est pourquoi nous proposons des cours de r&eacute;cup&eacute;ration gratuits dans toutes les mati&egrave;res de base pour les &eacute;l&egrave;ves ayant besoin d&rsquo;aide en fran&ccedil;ais, en anglais, en math&eacute;matiques et en sciences au 2e cycle. Nombreux sont nos &eacute;l&egrave;ves qui b&eacute;n&eacute;ficient de cette aide pr&eacute;cieuse qui renforce leurs apprentissages et les aide &agrave; atteindre leurs objectifs scolaires.</p>\r\n\r\n<p>Pour ceux qui n&eacute;cessitent un accompagnement plus personnalis&eacute;, une aide individuelle est &eacute;galement disponible, permettant &agrave; chaque &eacute;l&egrave;ve de progresser et de surmonter efficacement ses difficult&eacute;s sp&eacute;cifiques.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-12', '00:12:51', '2025-05-12', '00:13:06', NULL, 1),
(3, 0, 3, '/assets/images/aide-a-la-reussite/aide-a-la-reussite-image-03.jpg', NULL, '<p>Nous offrons des p&eacute;riodes d&rsquo;&eacute;tude et de devoirs quotidiennes, encadr&eacute;es par nos &eacute;ducateurs. Ces moments permettent aux &eacute;l&egrave;ves de travailler dans un cadre structur&eacute; et de b&eacute;n&eacute;ficier de l&rsquo;appui d&rsquo;adultes qualifi&eacute;s.</p>\r\n\r\n<p>Pour les parents comme pour les &eacute;l&egrave;ves, c&rsquo;est un avantage de taille : les travaux sont r&eacute;alis&eacute;s dans les meilleures conditions, les retards peuvent &ecirc;tre &eacute;vit&eacute;s, et les soir&eacute;es &agrave; la maison sont plus sereines, lib&eacute;r&eacute;es d&rsquo; une partie du travail scolaire &eacute;tant d&eacute;j&agrave; faite et bien faite.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-12', '00:13:08', '2025-05-12', '00:13:20', NULL, 1),
(4, 0, 5, '/assets/images/aide-a-la-reussite/aide-a-la-reussite-image-04.jpg', NULL, '<p>Deux jours par&nbsp;semaine, de 15 h 45 &agrave; 17 h 15, notre service Prof. Secours est &agrave; la disposition des &eacute;l&egrave;ves. Un enseignant est pr&eacute;sent &agrave; la biblioth&egrave;que pour offrir une aide dans toutes les mati&egrave;res, permettant aux &eacute;l&egrave;ves d&rsquo;aborder leurs difficult&eacute;s scolaires avec confiance. Ce service gratuit pour &eacute;l&egrave;ves de notre programme Volleyball est un pilier d&rsquo;aide &agrave; la r&eacute;ussite scolaire, qui r&eacute;pond aux besoins imm&eacute;diats et renforce les acquis.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-12', '00:13:24', '2025-09-08', '15:10:52', NULL, 1),
(5, 0, 6, '/assets/images/aide-a-la-reussite/aide-a-la-reussite-image-05.jpg', NULL, '<p>Au CSA, chaque &eacute;l&egrave;ve est accompagn&eacute; d&rsquo;un enseignant titulaire qui assure un suivi de pr&egrave;s du parcours scolaire et du comportement des jeunes sous sa responsabilit&eacute;. Le titulaire n&rsquo;est pas seulement un guide acad&eacute;mique, mais aussi une figure de r&eacute;f&eacute;rence qui veille au bien-&ecirc;tre de chaque jeune, favorise le sentiment d&rsquo;appartenance, et aide &agrave; b&acirc;tir une coh&eacute;sion forte dans la classe. Pour les &eacute;l&egrave;ves et les parents, savoir qu&rsquo;il y a un adulte d&eacute;di&eacute; &agrave; l&rsquo;encadrement de son enfant est une source de r&eacute;assurance et d&rsquo;encouragement.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-05-12', '00:13:38', '2025-05-12', '00:13:47', NULL, 1),
(6, 0, 4, '/assets/images/aide-a-la-reussite/intervenant_en_soutien_educatif.jpg', NULL, '<p data-end=\"619\" data-start=\"201\">Parce que chaque &eacute;l&egrave;ve est unique, le Coll&egrave;ge met en place un service de soutien &eacute;ducatif afin d&rsquo;accompagner les jeunes qui rencontrent des besoins ou des difficult&eacute;s&nbsp;sur le plan comportemental ou disciplinaire. Notre approche repose sur l&rsquo;&eacute;coute, l&rsquo;accompagnement individuel et la recherche de solutions adapt&eacute;es pour favoriser une int&eacute;gration harmonieuse en classe et un parcours scolaire r&eacute;ussi.</p>\r\n\r\n<p data-end=\"1017\" data-start=\"621\">Le r&ocirc;le de l&rsquo;intervenant en soutien &eacute;ducatif est d&rsquo;accueillir les &eacute;l&egrave;ves dans les moments plus difficiles, de les aider &agrave; r&eacute;fl&eacute;chir sur leurs comportements et de les guider vers de meilleures strat&eacute;gies d&rsquo;adaptation.&nbsp;En offrant un encadrement bienveillant et structur&eacute;, nous aidons nos &eacute;l&egrave;ves &agrave; d&eacute;velopper leur sens des responsabilit&eacute;s, &agrave; renforcer leur autonomie et &agrave; progresser dans un climat scolaire positif et respectueux.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-09-08', '15:12:34', '2025-09-10', '17:05:29', NULL, 1);
INSERT INTO `successSupport_f` (`id`, `originId`, `category`, `ranking`, `name`, `image`, `field1`, `field2`, `field3`, `field4`, `field5`, `field6`, `field7`, `field8`, `field9`, `field10`, `field11`, `field12`, `field13`, `field14`, `field15`) VALUES
