INSERT INTO `successSupport_ml` (`id`, `originId`, `langCode`, `name`, `field1`, `field2`, `field3`, `field4`, `field6`, `field7`, `field8`, `field9`, `field10`, `field11`, `field12`, `urlRewrite`, `title`, `descriptionMeta`, `h1`) VALUES
(1, 1, 'fr', 'Orthopédagogie', NULL, '<p>Nous mettons tout en &oelig;uvre pour que chaque &eacute;l&egrave;ve puisse atteindre son plein potentiel. En plus des s&eacute;ances de r&eacute;cup&eacute;ration gratuites dans les mati&egrave;res de base, nous sommes fiers de compter sur l&rsquo;expertise d&rsquo;une orthop&eacute;dagogue. Que ce soit pour b&acirc;tir de solides m&eacute;thodes de travail, surmonter les difficult&eacute;s en fran&ccedil;ais ou en math&eacute;matiques, ou encore offrir un soutien sp&eacute;cifique pour des d&eacute;fis comme la dyslexie, la dysorthographie, la concentration et l&rsquo;hyperactivit&eacute;, notre orthop&eacute;dagogue apporte un soutien quotidien, personnalis&eacute; et bienveillant. Au fil du temps, les obstacles s&rsquo;amenuisent, et chaque &eacute;l&egrave;ve peut progresser avec confiance vers la r&eacute;ussite scolaire &ndash; et ce, sans frais suppl&eacute;mentaires.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 2, 'fr', 'Récupération scolaire et aide individuelle', NULL, '<p>Un jeune sur trois qui fr&eacute;quente le CSA a besoin de mesures d&rsquo;appui pour poursuivre son parcours scolaire avec succ&egrave;s.</p>\r\n\r\n<p>C&rsquo;est pourquoi nous proposons des cours de r&eacute;cup&eacute;ration gratuits dans toutes les mati&egrave;res de base pour les &eacute;l&egrave;ves ayant besoin d&rsquo;aide en fran&ccedil;ais, en anglais, en math&eacute;matiques et en sciences au 2e cycle. Nombreux sont nos &eacute;l&egrave;ves qui b&eacute;n&eacute;ficient de cette aide pr&eacute;cieuse qui renforce leurs apprentissages et les aide &agrave; atteindre leurs objectifs scolaires.</p>\r\n\r\n<p>Pour ceux qui n&eacute;cessitent un accompagnement plus personnalis&eacute;, une aide individuelle est &eacute;galement disponible, permettant &agrave; chaque &eacute;l&egrave;ve de progresser et de surmonter efficacement ses difficult&eacute;s sp&eacute;cifiques.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 3, 'fr', 'Périodes d’étude et de devoirs', NULL, '<p>Nous offrons des p&eacute;riodes d&rsquo;&eacute;tude et de devoirs quotidiennes, encadr&eacute;es par nos &eacute;ducateurs. Ces moments permettent aux &eacute;l&egrave;ves de travailler dans un cadre structur&eacute; et de b&eacute;n&eacute;ficier de l&rsquo;appui d&rsquo;adultes qualifi&eacute;s.</p>\r\n\r\n<p>Pour les parents comme pour les &eacute;l&egrave;ves, c&rsquo;est un avantage de taille : les travaux sont r&eacute;alis&eacute;s dans les meilleures conditions, les retards peuvent &ecirc;tre &eacute;vit&eacute;s, et les soir&eacute;es &agrave; la maison sont plus sereines, lib&eacute;r&eacute;es d&rsquo; une partie du travail scolaire &eacute;tant d&eacute;j&agrave; faite et bien faite.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 4, 'fr', 'Prof. Secours', NULL, '<p>Deux jours par&nbsp;semaine, de 15 h 45 &agrave; 17 h 15, notre service Prof. Secours est &agrave; la disposition des &eacute;l&egrave;ves. Un enseignant est pr&eacute;sent &agrave; la biblioth&egrave;que pour offrir une aide dans toutes les mati&egrave;res, permettant aux &eacute;l&egrave;ves d&rsquo;aborder leurs difficult&eacute;s scolaires avec confiance. Ce service gratuit pour &eacute;l&egrave;ves de notre programme Volleyball est un pilier d&rsquo;aide &agrave; la r&eacute;ussite scolaire, qui r&eacute;pond aux besoins imm&eacute;diats et renforce les acquis.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 5, 'fr', 'Titulariat', NULL, '<p>Au CSA, chaque &eacute;l&egrave;ve est accompagn&eacute; d&rsquo;un enseignant titulaire qui assure un suivi de pr&egrave;s du parcours scolaire et du comportement des jeunes sous sa responsabilit&eacute;. Le titulaire n&rsquo;est pas seulement un guide acad&eacute;mique, mais aussi une figure de r&eacute;f&eacute;rence qui veille au bien-&ecirc;tre de chaque jeune, favorise le sentiment d&rsquo;appartenance, et aide &agrave; b&acirc;tir une coh&eacute;sion forte dans la classe. Pour les &eacute;l&egrave;ves et les parents, savoir qu&rsquo;il y a un adulte d&eacute;di&eacute; &agrave; l&rsquo;encadrement de son enfant est une source de r&eacute;assurance et d&rsquo;encouragement.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 6, 'fr', 'Soutien éducatif', NULL, '<p data-end=\"619\" data-start=\"201\">Parce que chaque &eacute;l&egrave;ve est unique, le Coll&egrave;ge met en place un service de soutien &eacute;ducatif afin d&rsquo;accompagner les jeunes qui rencontrent des besoins ou des difficult&eacute;s&nbsp;sur le plan comportemental ou disciplinaire. Notre approche repose sur l&rsquo;&eacute;coute, l&rsquo;accompagnement individuel et la recherche de solutions adapt&eacute;es pour favoriser une int&eacute;gration harmonieuse en classe et un parcours scolaire r&eacute;ussi.</p>\r\n\r\n<p data-end=\"1017\" data-start=\"621\">Le r&ocirc;le de l&rsquo;intervenant en soutien &eacute;ducatif est d&rsquo;accueillir les &eacute;l&egrave;ves dans les moments plus difficiles, de les aider &agrave; r&eacute;fl&eacute;chir sur leurs comportements et de les guider vers de meilleures strat&eacute;gies d&rsquo;adaptation.&nbsp;En offrant un encadrement bienveillant et structur&eacute;, nous aidons nos &eacute;l&egrave;ves &agrave; d&eacute;velopper leur sens des responsabilit&eacute;s, &agrave; renforcer leur autonomie et &agrave; progresser dans un climat scolaire positif et respectueux.</p>\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
